INSERT INTO university_infos VALUES ('1', 'Florida Institute of Technology', 'webservice@fit.edu', '+1321674800', '150, W. University Blvd, Melbourne. Florida USA. 32901', 'With our focus on student success, Florida Institute of Technology’s mission is to provide high-quality education to a culturally diverse student body in order to prepare students for entering the global workforce, seeking higher-education opportunities, and serving within their communities. The university also seeks to expand knowledge through basic and applied research and to serve the diverse economic, cultural and societal needs of our local, state, national and international constituencies.\r\n\r\nIn support of this mission, we are committed to:\r\n- Promoting student development by fostering and sustaining a productive institutional culture of assessment that leads to the continuous improvement of academic and administrative programs;\r\n- Developing an organizational culture that values and encourages intellectual curiosity, a sense of belonging and shared purpose among faculty, students and staff, and the pursuit of excellence in all endeavors;\r\n- Recruiting and developing excellent faculty to become leaders in their respective fields and internationally recognized scholars;\r\n- Achieving recognition as an effective, innovative, technology-focused educational and research institution; Recruiting and retaining an excellent, highly select and culturally diverse student body;\r\n- Continually improving the quality of campus life for all members of the university community;\r\n- Providing personal and career growth opportunities for both traditional and nontraditional students and members of the faculty and staff;\r\n- Securing and maintaining professional accreditation for all appropriate programs.', 'The Florida Institute of Technology (commonly referred to as Florida Tech and FIT) is a private doctoral/research university in Melbourne, Florida.[5] Florida Tech has six academic divisions with emphases on science, technology, engineering, mathematics (STEM), and aviation.[6] The university\'s 130-acre primary residential campus is located near the Melbourne International Airport and the Florida Tech Research Park.[7] It is about 50 miles (80 km) from the Kennedy Space Center and 75 miles (121 km) from Orlando.\r\n\r\nThe university was founded in 1958 as Brevard Engineering College and has been known by its present name since 1966.[8] In 2013, Florida Tech had an on-campus student body of 4,633, almost equally divided between graduate- and undergraduate-level students with the majority of them focusing their studies on engineering and the sciences', 'Florida Institute of Technology was founded as Brevard Engineering College by Dr. Jerome P. Keuper in 1958.[8] Classes were originally held at the Melbourne Municipal Airport in buildings formerly used by the Naval Air Station Melbourne.[9] In 1961, the university moved its location to Melbourne, Florida.[10] During the 1960s additional classroom and laboratory buildings, a library, the Denius Student Center, Hedgecock Gymnasium, Gleason Auditorium and several dormitories were constructed.[10][11] The university was accredited by the Southern Association of Colleges and Schools in 1964[12] and officially changed its name to Florida Institute of Technology in 1966.[8]\r\n\r\nThe Evans Library was completed in the early 1984.[14] The following year the original library was renovated and dedicated as the Jerome P. Keuper Administration Building.[11] In 1988, the Homer R. Denius Student Center was renovated, the student plaza completed, and the applied research laboratory building acquired.[10] The Claude Pepper Institute for Aging and Therapeutic Research and Skurla Hall, home of the School of Aeronautics, opened in 1990. In 1997, the university received a $50 million grant from the F. W. Olin Foundation.[15] An engineering building and life sciences building were opened in 1999 in result of the grant.[16][17]\r\n\r\nSeven new residence halls were completed in 2003.[11] Each resident hall was named after one of the seven fallen astronauts of the Shuttle Columbia disaster and dedicated to their memory.[11] In 2005, the F. W. Olin Physical Sciences Center opened.[11] Construction on the Emil Buehler Center for Aviation Training and Research at Melbourne International Airport began in 2008.[18] The following year, the College of Business became the Nathan M. Bisk College of Business, and the Ruth Funk Center for Textile Arts, the Emil Buehler Center for Aviation Training and Research at the Melbourne International Airport, the Scott Center for Autism Treatment, the Harris Center for Science and Engineering and the Harris Institute for Information Assurance were opened.[11] November 20, 2015, marked the unveiling of the Harris Student Design Center, a 11,500 square foot building on the south side of campus.[19] This facility provides space for students completing design projects. In 2016, the Center for Advanced Manufacturing and Innovative Design (CAMID) and the Larsen Motorsports High Performance Vehicles & Research Development Center opened at the Research and Development Center on Palm Bay Road.\r\n\r\nThe university established its football program in 2010.[20] The Panther Aquatic Center was opened a year later.[11] In 2011, the university partnered with the Brevard Art Museum and established it as the Foosaner Art Museum', 'Ad Astra Per Scientiam \"To the stars through science.\"', 'http://fit.edu', null, null, '/uploads/2/FIT.jpg', 'FIT.jpg', '2331', '2', '2016-11-10 23:59:29', '2016-11-10 23:59:29');
INSERT INTO university_infos VALUES ('2', 'Harvard University', 'president@harvard.edu', '+16174951502', 'Harvard University. Massachusetts Hall. Cambridge, MA 02138 USA.', 'Harvard University is devoted to excellence in teaching, learning, and research, and to developing leaders in many disciplines who make a difference globally. The University, which is based in Cambridge and Boston, Massachusetts, has an enrollment of over 20,000 degree candidates, including undergraduate, graduate, and professional students. Harvard has more than 360,000 alumni around the world.', 'Established\r\nHarvard is the oldest institution of higher education in the United States, established in 1636 by vote of the Great and General Court of the Massachusetts Bay Colony.\r\n\r\nFaculty\r\nAbout 2,400 faculty members and more than 10,400 academic appointments in affiliated teaching hospitals\r\n\r\nStudents\r\nHarvard College: About 6,700\r\nGraduate and professional students: About 15,250\r\nTotal: About 22,000', 'Harvard is the oldest institution of higher education in the United States, established in 1636 by vote of the Great and General Court of the Massachusetts Bay Colony. It was named after the College’s first benefactor, the young minister John Harvard of Charlestown, who upon his death in 1638 left his library and half his estate to the institution. A statue of John Harvard stands today in front of University Hall in Harvard Yard, and is perhaps the University’s best known landmark.', ' “VERITAS” (“Verity” or “Truth”)', 'http://www.harvard.edu/', null, null, '/uploads/2/photo.jpg', 'photo.jpg', '2792', '2', '2016-11-13 13:56:46', '2016-11-13 13:56:46');
INSERT INTO university_infos VALUES ('3', 'Massachusetts Institute of Technology', 'admissions@mit.edu', '+1 617-253-1000', '77 Massachusetts Ave, Cambridge, MA 02139, USA', 'The mission of the Massachusetts Institute of Technology is to advance knowledge and educate students in science, technology, and other areas of scholarship that will best serve the nation and the world in the 21st century. We are also driven to bring knowledge to bear on the world’s great challenges.', 'The Institute is an independent, coeducational, privately endowed university, organized into five Schools (architecture and planning; engineering; humanities, arts, and social sciences; management; and science). It has some 1,000 faculty members, more than 11,000 undergraduate and graduate students, and more than 130,000 living alumni.\r\n\r\nAt its founding in 1861, MIT was an educational innovation, a community of hands-on problem solvers in love with fundamental science and eager to make the world a better place. Today, that spirit still guides how we educate students on campus and how we shape new digital learning technologies to make MIT teaching accessible to millions of learners around the world.\r\n\r\n', 'The soul of MIT is research. For more than 150 years, the Institute has brought together teaching, engineering and scientific studies to produce a series of advancements. Many of these advancements are world-changing and occupy all corners of science and technology, from advanced engineering to the study of genetics and the arts. ', 'Mind and Hand', 'http://www.mit.edu/', null, null, '/uploads/2/MIT-Seal-wallpaper.gif', 'MIT-Seal-wallpaper.gif', '5124', '2', '2016-11-13 14:16:07', '2016-11-13 14:16:07');
INSERT INTO university_infos VALUES ('4', '	Maastricht University ', 'premium@maastrichtuniversity.nl', '+31 43 388 2222', 'Minderbroedersberg 4-6, 6211 LK Maastricht, Netherlands', 'Maastricht University is a research university where fundamental and applied research are inextricably linked with education and educational innovation. Maastricht University:\r\n\r\nmakes a genuine, tangible contribution to a better world\r\nis truly international: in student population, curricula and mentality\r\nhelps students develop as global citizens at the forefront of their generation\r\nhas an innovative approach to education: students seek their own answers and their own added value\r\nis anchored in society, in Maastricht and the Euregion', 'Maastricht University became a member of the Worldwide Universities Network (WUN) in 2013, as the network’s first and only Dutch university. WUN consists of 18 research universities in 11 countries on 6 continents, including renowned institutions such as the University of Alberta, the University of Cape Town, the University of Sydney and the Chinese University of Hong Kong. Membership is by invitation only. The network offers a platform for collaboration on education and transnational research projects on varied themes of global importance.', '\r\nOfficial opening\r\nBut the grands plans hit a stumbling block – by the early seventies the shortage of medical students had waned. Nonetheless, in 1974 the decision was made to launch the medical programme in Maastricht without official approval. Fortunately, however, legal approval followed in late 1975 and the university officially opened its doors on 9 January 1976.\r\n\r\nYoung university\r\nAt less than 50 years old, Maastricht University certainly belongs in the category of Young Universities. It was only on 9 January 1976 that Queen Juliana signed the papers marking the establishment of what was then known as the Rijksuniversiteit Limburg.\r\n', 'UM is the 4th best young university in the world', 'https://www.maastrichtuniversity.nl', null, null, '/uploads/2/mu.png', 'mu.png', '10359', '2', '2016-11-14 13:34:08', '2016-11-14 13:34:08');
INSERT INTO university_infos VALUES ('5', '	Kobe University', 'koryu@kobe-u.ac.jp', '+81 78-881-1212', '1-1 Rokkodaicho, Nada Ward, Kobe, Hyogo Prefecture 657-0013, Japan', 'Kobe University, working in a spirit of integrity, freedom, and cooperation in keeping with its open and cosmopolitan culture and environs, aims to contribute to the global community through the creation of knowledge founded on universal values and the fostering of rich understanding and strong leadership skills.', 'Kobe University is an academic institution that has continued to encourage forward-looking and independent thinking in working toward our ideal of creating ‘harmony between theory and reality’. Building on these traditions, we are now endeavoring to further utilize our ability for collaboration and integration. We pledge to become an outstanding research university that meets the highest international standards for teaching and research and can serve as a center for value creation that will help to solve the issues facing our society both at present and in the future.', 'The origin of Kobe University can be traced back to the Kobe College of Commerce established in 1902 as an institution for higher learning, when our history of over a hundred years started.', 'Kobe University – toward an outstanding research university exceling in advanced and integrated research in the humanities and sciences', 'http://www.kobe-u.ac.jp/', null, null, '/uploads/2/ku.png', 'ku.png', '4541', '2', '2016-11-14 13:44:14', '2016-11-14 13:44:14');
INSERT INTO university_infos VALUES ('6', 'Indian Institute of Science Bangalore', 'regr@admin.iisc.ernet.in', '+91-80-23600757', 'C V Raman Ave, Devasandra Layout, Bengaluru, Karnataka 560012, India', 'With the recent construction of modern buildings, acquisition of new research facilities, and induction of a large number of new faculty members, the Institute can look forward to an era of high productivity, increasing impact, and rising prominence in the world.', 'Indian Institute of Science (IISc) is a public university for scientific research and higher education located in Bangalore, India. Established in 1909 with active support from Jamsetji Tata and H.H. Sir Krishnaraja Wodeyar IV, the Maharaja of Mysore. It is also locally known as the \"Tata Institute\". It acquired the status of a Deemed University in 1958. IISc is widely regarded as India\'s finest institution in science, and has been ranked at number 11 and 18 worldwide (and ranked 3rd and 6th in Asia) when considering the criteria of Citations per Faculty in 2014 and 2015 respectively. IISc was ranked 11 in the world when considering the criteria \"Citations per faculty\" by QS World Universities rankings in 2016.', 'The Indian Institute of Science was founded in 1909 as a result of the joint efforts of Jamsetji Nussarwanji Tata, the Government of India and the Maharaja of Mysore.<br>\r\n\r\nTata conceived of a university of science in 1896 that would work for the benefit of India, and in 1898, created an endowment for establishing such an institution.<br>\r\n\r\nThe Government of India decided to locate the Institute in Bengaluru, where the Maharaja of Mysore, Krishnaraja Wodeyar IV, donated over 370 acres of land for this initiative.<br>\r\n\r\nThe Institute was formally vested in 1909, the foundation stone was laid in 1911, and the first batch of students started their studies the same year', 'Indian Institute of Science is a public university for scientific research and higher education located in Bangalore, India', 'http://www.iisc.ac.in/', null, null, '/uploads/2/IIsc_logo.jpg', 'IIsc_logo.jpg', '3351', '2', '2016-11-14 14:12:38', '2016-11-14 14:12:38');
INSERT INTO university_infos VALUES ('7', 'University of Catania', 'urp@unict.it', '+39 800 644 590', 'Piazza Università, 2, 95124 Catania CT, Italy', 'The University of Catania is a public institution with a strong and ever growing international orientation and community. Our main goal is to provide international students with a stimulating learning environment, and to offer them an international dimension based on excellence and innovation, both key elements of the educational experience', 'The second largest city in Sicily by population, Catania spreads out over the Plain of Catania, between the Ionian Sea and the slopes of Etna. The surrounding countryside, which the volcanic eruptions have made very fertile, is mainly given up to the cultivation of citrus fruit. The close link between the city and the volcano is also visible in the buildings, many of which are constructed in lava stone.', 'The foundation of the University of Catania, the oldest in Sicily, dates back to 1434, when the king of Spain, Alfonso of Aragon (who was also King Alfonso I of Sicily) authorised the establishment of a Studium generale with the privilege of issuing legally valid academic titles - baccellierati, licenses and degrees - in the four core disciplines of theology, canon and civil law, physical (medical) and joint philosophy, liberal arts (literature), the papal recognition arriving ten years later from Pope Eugene IV.', ' \"Siculorum Gymnasium\"', 'http://www.unict.it/', null, null, '/uploads/2/cat.jpg', 'cat.jpg', '9443', '2', '2016-11-14 14:29:14', '2016-11-14 14:29:14');
INSERT INTO university_infos VALUES ('8', 'University of Fribourg', 'communication@unifr.ch', '+41 26 300 71 11', 'Avenue de l\'Europe 20, 1700 Fribourg, Switzerland', 'In order to fulfil the task assigned to it by the Canton of Fribourg in the University Act and making full use of its autonomy, the University of Fribourg promotes quality, responsibility and readiness to engage in dialogue.', 'The University of Fribourg is a place where learning, research, employment and events all happen at the same time. Its innovative force makes it an important mover in the commercial and cultural life of the region. Since it attracts students and researchers from every part of Switzerland and from all over the world it has shaped life in the bilingual city of Fribourg since it was founded in 1889. Its wide range of course offerings, together with its comfortable size, makes the University of Fribourg a place where interdisciplinary and personal contact are the order of the day.', 'The university owes its earliest origin to the foundation of the Jesuit College St. Michel on Belze Hill by Peter Canisius in 1580 at the invitation of the government of Fribourg.. In 1763, an Academy of Law was founded, housed in the Albertinium (now a Dominican residence). In 1834, the cantonal library was formed from works brought to Fribourg (from Catholic monasteries) for safekeeping. The College St. Michel was closed following the expulsion of the Jesuits from Fribourg after the canton\'s defeat in the Sonderbund war.<br>\r\n\r\nIn 1886, Georges Python, founder of the cantonal bank and State Counsellor for Fribourg (M.P. in the upper house of the Swiss parliament) became Director of Public Education. He raised funds through a lottery and was granted some 2,500,000 CHF by the canton.[10] The cantonal library became integrated with that of the university and the Academy became the Faculty of Law. In 1939, the university moved to a new campus constructed on the former cemetery of Misericorde, ceding St. Michel to one of Fribourg\'s gymnasia, which took the name College St. Michel. During the Second World War, the university set up \"university camps\" along with the University of Zürich, HEC in St. Gall and a Lycée camp at Wetzikon provided a wide variety of courses to educate Polish prisoners of war.\r\n\r\n', 'Scientia et Sapientia (\"Knowledge and Wisdom\")', 'http://www3.unifr.ch/uni/en/', null, null, '/uploads/2/uf.jpg', 'uf.jpg', '10142', '2', '2016-11-14 14:40:32', '2016-11-14 14:40:32');
INSERT INTO university_infos VALUES ('9', 'Warsaw University of Technology', 'students@cwm.pw.edu.pl', '+48 22 234 72 11', 'plac Politechniki 1, 00-661 Warszawa, Poland', 'The Warsaw University of Technology, so named in 1915, continues the tradition of the Preparatory School for the Institute of Technology set up in Warsaw in 1826 thanks to the efforts of Stanisław Staszic. The University\'s roots also reach down to the Hipolit Wawelberg and Stanisław Rotwand School of Machine Construction and Electrical Engineering, created in 1895. The many generations of engineers it turned out and its significant contributions to the development of technical sciences earned the Warsaw University of Technology an acclaimed position in the country as well as international renown.', 'The Warsaw University of Technology  is one of the leading institutes of technology in Poland, and one of the largest in Central Europe. It employs 2,453 teaching faculty, with 357 professors (including 145 titular professors). The student body numbers 36,156 (as of 2011), mostly full-time.There are 19 faculties (divisions) covering almost all fields of science and technology. All are situated in Warsaw, except for one in Płock.', 'The origins of Polish universities of technology go back to the 18th century. They were related to either military technology or mining, which demanded complicated technological processes as a result of the exploitation of deeper seams.', 'Warsaw University of Technology WUT is a technical research institution with traditions in education dating back to the nineteenth century', 'https://www.pw.edu.pl/engpw', null, null, '/uploads/2/logo nowe PW2.jpg', 'logo nowe PW2.jpg', '6075', '2', '2016-11-14 15:01:07', '2016-11-14 15:01:07');
INSERT INTO university_infos VALUES ('10', 'Brunel University', 'brunelmba@brunel.ac.uk', '+44 1895 274000', 'Kingston Ln, London, Uxbridge UB8 3PH, UK', 'One immediate challenge is to ensure that more people are better appraised regarding the quality of our work. For too long we have been overly-modest about our achievements and have not been as successful as we should in ensuring that the different communities we serve know how good we really are.', 'Brunel University London is a public research university located in Uxbridge, London, United Kingdom. Founded in 1966, it was named after the Victorian engineer Isambard Kingdom Brunel.<br>\r\n\r\nBrunel\'s campus is located on the outskirts of Uxbridge. It is organised into three colleges and three major research institutes, a structure adopted in August 2014 which also changed the university\'s name to Brunel University London. Brunel has over 12,900 students and 2,500 staff and had a total income of £200.7 million in 2014/15, of which 25% came from grants and research contracts', 'In 2016, Brunel celebrates 50 years as a university.  However, our history can be traced back much further to 1798 through our predecessor colleges of Borough Road College, Maria Grey College, Shoreditch College and the West London Institute of Higher Education and as well as through Acton Technical College then Brunel College.  Our rise since 1966 has been impressive and our reputation grows year on year.  Now a university of 12,746 students – 3,309 students engaged in postgraduate and research study – our special approach is to combine academic rigour with the practical, entrepreneurial and imaginative approach pioneered by Isambard Kingdom Brunel.', 'Arms of Brunel University London', 'http://www.brunel.ac.uk', null, null, '/uploads/2/bru.jpg', 'bru.jpg', '993', '2', '2016-11-14 15:14:04', '2016-11-14 15:14:04');
INSERT INTO university_infos VALUES ('11', 'Donghua University', 'ices@dhu.edu.cn', '+86 21 6779 2401', ' 2999 Renmin N Rd, Songjiang Qu, Shanghai Shi, China', ' DHU commenced to accept international students who were among the first group of overseas students enrolled by Chinese universities. To date, DHU has brought up a huge number of international students from over 130 countries. Almost all of undergraduate programs, postgraduate and research programs are open to international students. Besides, non-degree programs including Chinese language programs, Degree-Preparation program, advanced study programs, and a variety of short-term programs are available to international students', 'Donghua University  is a public research university in Shanghai, China. Established in 1951, it is a member of China\'s Project 211 group of national key universities, with a heavy focus on high level technological and scientific research. Among its various departments it is especially well known for engineering, business, and textile design, among which its fashion design, textile engineering, international trade, material science, and information technology departments have been consistently ranked highly in China for decades', 'Founded in June 1951, Donghua University was originally named East-China Textile Institute of Science and Technology . In September 1985, the university changed its name to China Textile University  and changed it once again to Donghua University in August 1999. It has been a state-key university since 1960 and was one of the first educational institutions in China authorized to confer all three levels of degree: bachelor\'s, master\'s, and doctorate.', '	崇德博学, 励志尚实', 'http://www.dhu.edu.cn/', null, null, '/uploads/2/dong.png', 'dong.png', '1775', '2', '2016-11-14 15:21:33', '2016-11-14 15:21:33');
INSERT INTO university_infos VALUES ('12', 'University of Idaho', 'president@uidaho.edu', '+1 208-885-6111', '709 S Deakin St, Moscow, ID 83844, USA', 'The University of Idaho is the state’s land-grant research university. From this distinctive origin and identity comes our commitment to enhance the scientific, economic, social, legal, and cultural assets of our state, and to develop solutions for complex problems facing society. We deliver on this commitment through focused excellence in teaching, research, outreach, and engagement in a collaborative environment at our residential main campus, regional centers, extension offices, and research facilities throughout the state. Consistent with the land-grant ideal, our outreach activities serve the state at the same time they strengthen our teaching as well as scholarly and creative capacities.', 'The University of Idaho, home of the Vandals, is one of only 72 land-grant research universities in the United States. From its residential campus in Moscow, UI serves the state of Idaho through educational centers in Coeur d’Alene, Boise, Idaho Falls and Twin Falls, and Extension offices in 42 counties. Home to more than 11,000 students statewide, UI is a leader in student-centered learning and excels at interdisciplinary research, service to businesses and communities and their advancement of diversity, citizenship and global outreach. UI competes in the Big Sky Conference and Sun Belt Conference.', 'Formed by the territorial legislature on January 30, 1889, the university opened its doors in 1892 on October 3, with an initial class of 40 students. The first graduating class in 1896 contained two men and two women. It presently has an enrollment exceeding 12,000, with over 11,000 on the Moscow campus. The university offers 142 degree programs, from accountancy to wildlife resources, including bachelor\'s, master\'s, doctoral, and specialists\' degrees. Certificates of completion are offered in 30 areas of study. At 25% and 53%, its 4 and 6 year graduation rates[5] are the highest of any public university in Idaho, and it generates 74 percent of all research money in the state, with research expenditures of $100 million in 2010 alone.', '	A Legacy of Leading', 'http://www.uidaho.edu/', null, null, '/uploads/2/idaho.png', 'idaho.png', '10668', '2', '2016-11-14 15:27:02', '2016-11-14 15:27:02');
INSERT INTO university_infos VALUES ('13', 'Illinois Institute of Technology', 'finaid@iit.edu', '+1 312-567-3000', '3300 S Federal St, Chicago, IL 60616, USA', 'In spring 2008, an exciting new chapter of IIT history was launched as the Board of Trustees enthusiastically endorsed plans for a university-wide planning process aimed at reestablishing the university as a major force in higher education. That plan, Many Voices, One Vision: 2010-2014, helped focus the institution’s initiatives and strengthen its infrastructure—and it is now time to move the university forward into a new era of accomplishment and excellence.<br>\r\n\r\nMany Voices, One Vision 2014-2019, Moving Forward: A Strategic Plan for Illinois Institute of Technology, is more than a continuation of the original plan. It is a statement of intent—about where IIT will concentrate its focus and its resources. It is also a statement of resolve—to find new ways to achieve excellence and fiscal stability while holding fast to the mission and vision that has guided the university for 125 years.', 'lllinois Institute of Technology is a private, technology-focused, research university offering undergraduate and graduate degrees in engineering, science, architecture, business, design, human sciences, applied technology, and law.', 'In 1890, when advanced education was often reserved for society\'s elite, Chicago minister Frank Wakely Gunsaulus delivered what came to be known as the \"Million Dollar Sermon.\" From the pulpit of his South Side church, near the site Illinois Institute of Technology now occupies, Gunsaulus said that with a million dollars he could build a school where students of all backgrounds could prepare for meaningful roles in a changing industrial society.', 'Transforming Lives. Inventing the Future.', 'http://web.iit.edu/', null, null, '/uploads/2/red.jpg', 'red.jpg', '3315', '2', '2016-11-14 15:32:45', '2016-11-14 15:32:45');
INSERT INTO university_infos VALUES ('14', '	Indian Institute of Technology Bombay', 'nandk@chem.iitb.ac.in', '+91 22 2572 2545', ' IIT Area, Powai, Mumbai, Maharashtra 400076, India', 'The Vision of IIT Bombay is to be the fountainhead of new ideas and of innovators in technology and science. Its Mission is to create an ambience in which new ideas and creativity flourish and from which research and scholarship and leaders and innovators of tomorrow emerge.', 'The institute is recognised worldwide as a leader in the field of engineering education and research. Reputed for the outstanding calibre of students graduating from its undergraduate and postgraduate programmes, the institute attracts the best students from the country for its bachelor\'s, master\'s and doctoral programmes. Research and academic programmes at IIT Bombay are driven by an outstanding faculty, many of whom are reputed for their research contributions internationally.', 'A high-powered committee of the Government of India, headed by Sir Nalini Ranjan Sarkar, a businessman, educationist, industrialist and public figure, recommended in 1946 the establishment of four higher institutes of technology on the lines of their counterparts in Europe and the United States to set the direction for the development of technical education in the country. The committee had recommended the establishment of institutes of national importance in different regions of India. The first of the IITs was set up in Kharagpur (whose other claim to fame is that it has the longest railway platform in the world) in the state of West Bengal in 1950 at a site in Hijli village which used to be a detention camp. Four more IITs followed in quick succession. IIT Bombay was established in 1958, followed by those at Madras (1959), Kanpur (1959) and Delhi (1961). Though the names of the cities Bombay and Madras were later changed, respectively, to Mumbai and Chennai, the institutes at these two places retain their original names. So our institute is IIT Bombay, often shortened to IITB.', 'ज्ञानम् परमम् ध्येयम् (jñānam paramam dhyeyam)', 'http://www.iitb.ac.in/', null, null, '/uploads/2/ind.jpg', 'ind.jpg', '3360', '2', '2016-11-14 15:37:36', '2016-11-14 15:37:36');
INSERT INTO university_infos VALUES ('15', 'Ohio University', 'servicedesk@ohio.edu', '+1 740-593-4100', 'Athens, OH 45701, USA', 'Ohio University holds as its central purpose the intellectual and personal development of its students. Distinguished by its rich history, diverse campus, international community, and beautiful Appalachian setting, Ohio University is also known for its outstanding faculty of accomplished teachers whose research and creative activity advance knowledge across many disciplines.', 'Ohio University strives to be the best student-centered, transformative learning community in America, where students realize their promise, faculty advance knowledge, staff achieve excellence, and alumni become global leaders! OHIO is the university that fits what you want to do and who you want to be. It’s the place where you can be yourself—and become your best self!', 'In 1786, 11 men gathered at the Bunch of Grapes Tavern in Boston to propose development of the area north of the Ohio River and west of the Allegheny Mountains known then as the Ohio Country. Led by Manasseh Cutler and Rufus Putnam, the Ohio Company petitioned Congress to take action on the proposed settlement. The eventual outcome was the enactment of the Northwest Ordinance of 1787, which provided for settlement and government of the territory and stated that \"…schools and the means of education shall forever be encouraged.\"\r\nIn 1803, Ohio became a state and on February 18, 1804, the Ohio General Assembly passed an act establishing \"The Ohio University.\" The University opened in 1808 with one building, three students, and one professor, Jacob Lindley. One of the first two graduates of the University, Thomas Ewing, later became a United States senator and distinguished himself as cabinet member or advisor to four presidents.<br>\r\nTwenty-four years after its founding, in 1828, Ohio University conferred an A.B. degree on John Newton Templeton, its first black graduate and only the third black man to graduate from a college in the United States. In 1873, Margaret Boyd received her B.A. degree and became the first woman to graduate from the University. Soon after, the institution graduated its first international alumnus, Saki Taro Murayama of Japan, in 1895.\r\n ', 'Religio Doctrina Civilitas, Prae Omnibus Virtus', 'https://www.ohio.edu/', null, null, '/uploads/2/ohi.jpeg', 'ohi.jpeg', '6031', '2', '2016-11-14 16:22:30', '2016-11-14 16:22:30');
INSERT INTO university_infos VALUES ('16', 'New Mexico State University', 'help@nmsu.edu', '+1 575-646-0111', '1780 E University Ave, Las Cruces, NM 88003, USA', 'NMSU Grants provides an accessible quality education through innovative teaching and learning that promotes respect and service for our diverse students and community', 'We are a comprehensive research land-grant university excelling in teaching, research and public service. NMSU is truly a reflection of the region’s vibrant communities – an exciting place to tackle challenges, find answers to important issues and prepare for the future.', '\r\nNMSU was founded in 1888 as Las Cruces College. The Territorial Legislature of 1889 established the land-grant Agricultural College and Experiment Station, which officially opened on January 21, 1890. During its first full academic year, the college became known as the New Mexico College of Agriculture and Mechanic Arts, the first degree-granting institution in the Territory. Under the provisions of the Morrill Act of 1862 and subsequent federal legislation, the special mission of land-grant institutions has been to provide a liberal and practical education for students and to sustain programs of research, extension education, and public service.', 'all about discovery', 'https://www.nmsu.edu/', null, null, '/uploads/2/nm.jpg', 'nm.jpg', '5790', '2', '2016-11-14 17:04:22', '2016-11-14 17:04:22');
INSERT INTO university_infos VALUES ('17', 'Hunan University', 'xiaoban@hnu.cn', '+86 731 8882 2736', '2号 Lushan S Rd, Yuelu Qu, Changsha Shi, Hunan Sheng, China, 410012', '\"Be Profound\" means \"to learn profoundly\", which requires the teachers and the students to learn to enrich themselves in the sea of knowledge. It has been a major characteristic of Yuelu Academy.\r\n\r\n\"Be intelligent\" requires the teachers and the students to think actively, effectively and deeply in order to achieve in-depth thinking, independent thinking, creative thinking and open thinking. It embodies the emphasis on thinking in the educational tradition of Yuelu Academy.\r\n\r\n\"Be Diligent\" advocates the students\' spirit of studying hard and making constant progress and at the same time requires the teachers to be fully involved in their educational work. It is also an important requirement of the Code of Conduct for the Students of Yuelu Academy.\r\n\r\n\"Be Dedicated to the Pursuit of Knowledge\" requires the teachers and the students to be engaged in the endless pursuit of knowledge to practical affairs. It is a good embodiment of Yuelu Academy\'s educational tradition of \"laying emphasis on practice and practical affairs\" and a good expression of Huxiang Culture\'s characteristic of \"being steadfast to morality and bearing current affairs in mind\"', 'Hunan University is situated at the foot of the picturesque Yuelu Mountain and on the west bank of the rippling Xiangjiang River in the historically and culturally renowned City of Changsha, capital of Hunan Province. It enjoys the title of an \"Ancient Millenarian Academy, Famous Centennial University\". As one of the key and most comprehensive universities affiliated with the Ministry of Education, it has been included in the state\'s \"Project 211\" and \"Project 985\" for priority investment and construction. Professor Jiang Changzhong is the Party Secretary of the CPC Hunan University Committee and Professor Duan Xianzhong the President.', 'Hunan University, originating from Yuelu Academy founded in 976 A.D. during the Northern Song Dynasty, is the oldest institution in Chinese history, earning it the name \"One-Thousand-Year-Old Institution\". With 1030 year old history it has transformed  from an ordinary ancient academy to a famous modern institute, from a provincial university to a national university, from the \"211 Project\" to the \"985 Project\".  Hunan University has withstood the tests of time, wars and the reform and readjustment of educational systems, and has always stood erect leading in the formation of China\'s glorious higher education.', '实事求是 敢为人先', 'http://www-en.hnu.edu.cn/', null, null, '/uploads/2/hunan.png', 'hunan.png', '3253', '2', '2016-11-14 17:25:17', '2016-11-14 17:25:17');
INSERT INTO university_infos VALUES ('18', 'University of Texas at San Antonio', 'fiscalservices@utsa.edu', '+1 210-458-4011', '1 UTSA Circle, San Antonio, TX 78249, USA', 'The University of Texas at San Antonio is dedicated to the advancement of knowledge through research and discovery, teaching and learning, community engagement and public service. As an institution of access and excellence, UTSA embraces multicultural traditions and serves as a center for intellectual and creative resources as well as a catalyst for socioeconomic development and the commercialization of intellectual property – for Texas, the nation and the world.', 'The University of Texas at San Antonio is an emerging Tier One research institution with nearly 29,000 students. It is the largest university in the San Antonio metropolitan region.', 'Founded by the Texas Legislature in 1969, UTSA now offers access and opportunity for nearly 29,000 students. UTSA has come a long way in 46 years. Administrative offices for the first UTSA president, Arleigh B. Templeton, were set up in 1970 in Hemisfair Park, and architects Ford, Powell and Carson Inc. began developing a conceptual master plan for the campus.', 'Disciplina Praesidium Civitatis', 'http://www.utsa.edu/', null, null, '/uploads/2/uts.png', 'uts.png', '7782', '2', '2016-11-14 17:32:52', '2016-11-14 17:32:52');
INSERT INTO university_infos VALUES ('19', 'University of Nevada las Vegas', 'admissions@unlv.edu', '+1 702-895-3011', '4505 S Maryland Pkwy, Las Vegas, NV 89154, USA', 'The University of Nevada, Las Vegas is a public research institution committed to rigorous educational programs and the highest standards of a liberal education.\r\n\r\n\r\n', 'Since our first classes were held on campus in 1957, UNLV has transformed\r\nitself from a small branch college into a thriving urban research institution.\r\nAlong the way, our urban university has become an indispensable resource\r\nin one of the country\'s fastest-growing and most enterprising cities.', 'Since its first classes were held in 1957, the University of Nevada, Las Vegas (UNLV), has undergone an amazing transformation — from a dusty outpost on the south edge of town to a thriving urban research institution. Along the way, thanks to its innovative frontier spirit, UNLV has kept pace with one of the country\'s fastest-growing and most enterprising cities.', 'Omnia Pro Patria', 'https://www.unlv.edu/', null, null, '/uploads/2/unl.jpg', 'unl.jpg', '10821', '2', '2016-11-14 17:40:46', '2016-11-14 17:40:46');
INSERT INTO university_infos VALUES ('20', 'University of Nantes', 'registration@lacite-nantes.fr', '+33 2 40 99 83 83', '1 Quai de Tourville, 44035 Nantes Cedex 1, France', 'Université de Nantes enjoys the major assets needed to encourage local, national and international cooperation and to make interdisciplinary a factor of innovation and success. It contributes to the innovation of the socioeconomic make-up thanks to its researchers, laboratories, equipment and state-of-the-art technological platforms. Furthermore, recent university graduates (8,000 every year) constitute a tremendous pool of skills and talent. By getting involved in local issues while keeping an international perspective, Université de Nantes shows its capacity to work with the new scales of territory. This is essential to any development.', 'Université de Nantes has never stopped moving forward. In the last 50 years, Université de Nantes has taken training and research to the highest level. Facing a rapidly changing world, Université de Nantes invents a new model of university. This model places the student at its centre and, more than ever, the human being at the heart of its ambitions. Rooted in Nantes - a city renowned for its vitality, culture, economic development and its quality of life - Université de Nantes radiates also thanks to its 2 campuses in Saint- Nazaire and La-Roche-sur-Yon. \r\n', 'The current University was founded in 1970 under the terms of the 1968 law which reformed French higher education. This newly established institution replaced the former University of Nantes which had been founded in the early 1960s. This itself was a re-establishment of the original University of Nantes which was established by papal bull in 1460 but was abolished during the French Revolution.', 'Universitas Naundes', 'http://www.univ-nantes.fr/', null, null, '/uploads/2/nan.png', 'nan.png', '10184', '2', '2016-11-14 17:59:05', '2016-11-14 17:59:05');
INSERT INTO university_infos VALUES ('21', 'University of Milano-Bicocca', 'bicocca.international@unimib.it', '+02 6448 1', 'Università degli Studi di Milano Bicocca, Piazza dell\'Ateneo Nuovo, 1, 20126 Milano, Italy', 'The University was established with the aim of making Research the strategic foundation of all institutional activities. Research is meant as expansion of knowledge, as enhancement of training, a vehicle through which is organized the relationship with the territory, that also gives a strong contribution to the development of the productive system. The University of Milano-Bicocca pays special attention to the territory in which it operates, focusing at the same time the international dimension.', 'The University of Milano-Bicocca was founded as autonomous organization on June, 10th 1998. In the Times Higher Education rankings 2015 dedicated to the best hundred universities with less than 50 years, the University was ranked 24th in the world, 1st in Italy.', 'The University of Milano-Bicocca has its origins from the splitting of the University of Milan, which with about 90,000 students in the 1990s was becoming overcrowded. A large area in the north of Milan, the Bicocca, was chosen as the location for the new university. This area was occupied by the Pirelli industrial complex until the 1980s and the new campus was part of a larger urban renewal project. The university was officially established on 10 June 1998.\r\n\r\nMilan-Bicocca is a multidisciplinary university which offers a wide range of academic programs in different disciplinary fields: Economics, Informatics, Statistics, Law, Education, Sociology, Medicine and Surgery, Maths, Natural Sciences, Physics and Astrophysics, Chemistry, Computer Sciences, Biotechnology and Psychology.', 'Audentes fortuna iuvat (Fortune favors the bold)', 'http://www.unimib.it/go/102/Home', null, null, '/uploads/2/deg.jpg', 'deg.jpg', '9454', '2', '2016-11-14 18:05:48', '2016-11-14 18:05:48');
INSERT INTO university_infos VALUES ('22', 'University of Nevada Reno', 'asknevada@unr.edu', '+1 775-784-1110', '1664 N Virginia St, Reno, NV 89557, USA', 'The Division of Student Services exists to recruit, retain, and graduate students.  We accomplish this as part of the University\'s learning mission by creating a thriving campus community which integrates the curricular and co-curricular experience and allows students to maximize achievement of their educational and personal goals.', 'One of the nation\'s top public research universities—\r\nyet small enough to connect with professors who guide you to success', 'The University of Nevada, Reno was founded in 1874 as the State University of Nevada in Elko, Nev., about 300 miles northeast of its present-day campus in Reno. The site for the university preparatory school in eastern Nevada (where no state institutions had previously been located) proved to be impractical, as nearly half of the state\'s residents lived in the Reno-Carson City area. In 1885, the legislature approved the move of the University from Elko to Reno.', 'Omnia Pro Patria', 'http://www.unr.edu/', null, null, '/uploads/2/nn.jpg', 'nn.jpg', '10822', '2', '2016-11-15 02:36:01', '2016-11-15 02:36:01');
INSERT INTO university_infos VALUES ('23', 'Budapest University of Technology and Economics', 'info@bme.hu', '+36 1 463 1111', 'Budapest, Műegyetem rkp. 3, 1111 Hungary', 'The primary task of BME OMIKK is to support the high quality education, scientific training, research, development and innovation in the fields of engineering, technology, natural, business and social sciences at the Budapest University of Technology and Economics through efficient exploitation of the available resources. <br>\r\n\r\nWorks as an organisational unit of its host institute and a center supporting the fruitful learning and research as a social space of the University.', 'More than 110 departments and institutes operate within the structure of eight faculties. About 1100 lecturers, 400 researchers and other degree holders and numerous invited lecturers and practising expert specialists participate in education and research at the Budapest University of Technology and Economics. Approximately 800 of the university\'s 14.000 students are from 50 countries abroad. The Budapest University of Technology and Economics issues about 70% of Hungary\'s engineering degrees.', '1635 – Péter Pázmány, Primate – Archbishop of Hungary, founds the first Hungarian University of the New Age at Nagyszombat\r\nLate 18th century – The University moves to Buda and becomes the University of Buda.\r\n1735 – The \"Berg-Schola,\" the world\'s first institute of technology, was founded in Selmecbánya, Kingdom of Hungary[2] (today Banská Štiavnica, Slovakia) in 1735. Many members of the first teaching staff of BME arrived from Selmecbánya.\r\n1782 – Emperor Joseph II establishes the Institutum Geometricum as part of the Faculty of Liberal Arts at the University of Buda. The Institutum, the direct predecessor of the Budapest University of Technology and Economics, is the first in Europe to award engineering degrees to students of land surveying, river control, and road construction.\r\n1850 – The Institutum Geometricum merges with the Joseph College of Technology.\r\n1856 – The merged institutions become the Royal Joseph Polytechnic.\r\n1860 – Hungarian replaces Latin as the language of instruction.\r\n1862 – Royal Joseph Polytechnic becomes the Royal Joseph University.\r\n1872 – Royal Joseph University gains full autonomy and the right to issue engineering diplomas after five years of studies. It is among the first institutions in Europe, to train engineers on university level.\r\n1901 – Royal Joseph University is entitled to confer the doctoral degree, \"Doctor Rerum Technicarum.\"\r\n1910 – The university moved to its current site near Gellért square (next to the Art Nouveau Hotel Gellért).\r\n1925 – First women students enroll.\r\n1934 – The university was reorganized again as Palatine Joseph University of Technology and Economics and it played a dominant role in the interwar industrialization process, together with engineering and economist training in Hungary.\r\n1939 – The Institute for Continuing Education opens its gates.\r\n1949 – The name \"Technical University of Budapest\" becomes official. At this time the university consists of the faculties of: Civil Engineering, Mechanical Engineering, Architecture, Chemical Engineering and Electrical Engineering (in historical order).\r\n1955 – Faculty of Transportation Engineering is established.\r\n1956 – The 1956 Hungarian Revolution was partly launched by students at the university, followed by many professors.\r\n1967 – The two technical universities seated in Budapest were merged to form the Technical University of Budapest, with six faculties.\r\n1984 – Instruction is offered in English as well as Hungarian.\r\n1994 – The Technical University of Budapest is among the first universities in Hungary to introduce the credit system. The university applies the credit assignment according to the European Credit Transfer System (ECTS) in its accredited academic programs.\r\n1998 – Faculty of Natural Sciences and Faculty of Economic and Social Sciences are established.\r\n2000 – The official name changes to Budapest University of Technology and Economics.', 'Courses in Contemporary Engineering - harmonising theory and practice', 'http://www.bme.hu/', null, null, '/uploads/2/bud.jpg', 'bud.jpg', '1010', '2', '2016-11-15 02:42:09', '2016-11-15 02:42:09');
INSERT INTO university_infos VALUES ('24', '	Ryerson University', 'ask@ryerson.ca', '+1 416-979-5000', '350 Victoria St, Toronto, ON M5B 2K3, Canada', 'The special mission of Ryerson University is the advancement of applied knowledge and research to address societal need, and the provision of programs of study that provide a balance between theory and application and that prepare students for careers in professional and quasi-professional fields.<br>\r\n\r\nAs a leading centre for applied education, Ryerson is recognized for the excellence of its teaching, the relevance of its curriculum, the success of its students in achieving their academic and career objectives, the quality of its scholarship, research and creative activity and its commitment to accessibility, lifelong learning, and involvement in the broader community.\r\n\r\n ', 'Ryerson is Canada\'s leader in innovative, career-focused education and a university clearly on the move. It is a distinctly urban university with a focus on innovation and entrepreneurship. Ryerson has a mission to serve societal need and a long-standing commitment to engaging its community.<br>\r\n\r\nGuided by a bold Academic Plan, an ambitious research agenda, and a Master Plan to revitalize the campus and surrounding neighbourhood, Ryerson is the most applied-to university in Ontario relative to available spaces, and its reputation with business and community leaders continues to rise.', 'In 1852 at the core of the present main campus, the historic St. James Square, Egerton Ryerson founded Ontario\'s first teacher training facility, the Toronto Normal School.[10] It also housed the Department of Education and the Museum of Natural History and Fine Arts, which became the Royal Ontario Museum. An agricultural laboratory on the site led to the later founding of the Ontario Agricultural College and the University of Guelph. St. James Square went through various other educational uses before housing a namesake of its original founder.<br>\r\n\r\nEgerton Ryerson was a leading educator, politician, and Methodist minister.[11] He is known as the father of Ontario\'s public school system.[12] He is also a founder of the first publishing company in Canada in 1829, The Methodist Book and Publishing House, which was renamed The Ryerson Press in 1919 and today is part of McGraw-Hill Ryerson, Canadian publisher of educational and professional books, which still bears Egerton Ryerson\'s name for its Canadian operations.', 'Mente et Artificio', 'http://www.ryerson.ca/about/', null, null, '/uploads/2/rr.jpg', 'rr.jpg', '6517', '2', '2016-11-15 02:51:48', '2016-11-15 02:51:48');
INSERT INTO university_infos VALUES ('25', 'Universität Bayreuth', 'praesident@uni-bayreuth.de', '+49 921 550', ' Universitätsstraße 30, 95447 Bayreuth, Germany', '\"The University of Bayreuth is a dynamic and research-oriented campus university, which provides a future-oriented education through science and research-based teaching, and offers excellent study conditions for students and students from Germany and abroad Researchers from all over the world are highly attractive in the field of regional, national and international competition and have a focussed internationalization strategy.We cooperate worldwide with universities, universities and non-university research institutions and promote dialogue between science and society. \"', 'The University of Bayreuth is a public research university situated in Bayreuth, Germany.  The university has an outstanding reputation in a broad range of disciplines and currently maintains a network of more than 450 international cooperations with research institutes and universities around the world.[2] It is broadly organized into six undergraduate and graduate faculties, with each faculty defining its own admission standards and academic programs in near autonomy.', 'It was founded in 1975 as a campus university focusing on international collaboration and inter disciplinarity.', '	Ordo et Claritas', 'http://www.uni-bayreuth.de/', null, null, '/uploads/2/bay.png', 'bay.png', '9898', '2', '2016-11-15 03:00:15', '2016-11-15 03:00:15');
INSERT INTO university_infos VALUES ('26', 'University of Graz', 'info@uni-graz.at', '+43 316 3800', '8010, Universitätspl. 3, 8010 Graz, Austria', 'As a comprehensive university, the University of Graz regards itself as an international institution for education and research committed to research and teaching for the benefit of society.\r\nIt is our policy to maintain freedom in research and teaching, which permanently commits us to social, political and technological developments. Increasing flexibilisation and globalisation are the essential frame conditions.\r\n\r\nBesides our ambition to create profile and visibility in a European and global context, it is above all one of our most outstanding characteristics that our university has acquired a special position in the south-eastern European region.', 'The University of Graz, which was founded in 1585, is Austria\'s second oldest university and one of the largest in the country. Many excellent scientists, amongst them six Nobel laureates, have taught and researched here.<br>\r\n\r\n\r\nWith 32,500 students and 4,300 employees the University of Graz contributes significantly to the vibrating life of the Styrian capital. Its location in Europe encourages a lively scientific, economic and cultural exchange with South-East Europe, from which not only the city benefits, but also its educational institutions.', 'The second oldest university in Austria was founded in 1585 by Archduke Charles II of Inner Austria, initially with just two faculties, those of philosophy and theology in a Jesuit college; in 1778, the faculty of law was established. After the college had been turned into a lyceum, Emperor Francis I re-established the institution as Karl Franzens University in 1827, to which in 1863 a faculty of medicine was added. Today’s campus dates back to 1870.\r\n\r\n\r\nThe flourishing scientific life was severely damaged in 1938, when numerous teachers, amongst them Nobel laureates Otto Loewi, Viktor Hess and Erwin Schrödinger, as well as some third of the students were expelled by the Nazis. From the 1960s onwards, the number of students steadily increased.\r\n\r\nAfter the Faculty of Medicine had become independent in 2004, a sixth faculty of Environmental and Regional Sciences and Education (URBI) was created in 2007.', '	Numquam retro', 'http://www.uni-graz.at/', null, null, '/uploads/2/alm.jpg', 'alm.jpg', '9919', '2', '2016-11-15 03:06:52', '2016-11-15 03:06:52');
INSERT INTO university_infos VALUES ('27', 'Montana State University', 'NetID@msu.montana.edu', '+1 406-994-0211', ' 211 Montana Hall, Bozeman, MT 59717, United States', 'Montana State University, the state\'s land-grant institution, educates students, creates knowledge and art, and serves communities by integrating learning, discovery and engagement.', 'Montana State University is as remarkable as its setting. Created as a land-grant institution, it is a welcoming, adventurous community of students, faculty and staff distinguished by its commitment to address the world\'s greatest challenges. The university energizes individuals to discover and pursue their aspirations. It inspires people to engage with the university to improve the human prospect through excellence in education, research, creativity and civic responsibility.', 'MSU was founded in 1893 as the Agricultural College of the State of Montana. It opened on February 16 with five male and three female students. The first classes were held in rooms in the county high school, and later that year in the shuttered Bozeman Academy (a private preparatory school). The first students were from Bozeman Academy, and were forced to transfer to the college. Only two faculty existed on opening day: Luther Foster, a horticulturalist from South Dakota who was also Acting President, and Homer G. Phelps, who taught business. Within weeks, they were joined by S.M. Emery (who ran the agricultural experiment station) and Benjamin F. Maiden (an English teacher from the former Bozeman Academy). Augustus M. Ryon, a coal mine owner, was named the first president of the college on April 17, 1893. Ryon immediately clashed with the board of trustees and faculty. Where the trustees wanted the college to focus on agriculture, Ryon pointed out that few of its students intended to go back to farming. While the rapidly expanding faculty wanted to establish a remedial education program to assist unprepared undergraduates (Montana\'s elementary and secondary public education system was in dire shape at the time), Ryon refused. The donation of the Story land to the college occurred in 1894, but Ryon was forced out in 1895 and replaced by the Rev. Dr. James R. Reid, a Presbyterian minister who had been president of the Montana College at Deer Lodge since 1890.\r\n\r\nThe college grew quickly under Reid, who provided 10 years of stability and harmony. The student body grew so fast that the high school building was completely taken over by the college. A vacant store on Main Street was rented to provide additional classroom space. Both the Agricultural Experiment Station (now known as Taylor Hall) and the Main Building (now known as Montana Hall) were constructed in 1896, although the agricultural building was the first to open. Both structures were occupied in 1898. The university football team was established in 1897, and the college graduated its first four students that same year. The curriculum expanded into civil and electrical engineering in 1898.', 'Mountains & Minds', 'http://www.montana.edu/', null, null, '/uploads/2/mont.jpg', 'mont.jpg', '5357', '2', '2016-11-15 03:16:57', '2016-11-15 03:16:57');
INSERT INTO university_infos VALUES ('28', 'Victoria University of Wellington', 'victoria-international@vuw.ac.nz', '+64 4-472 1000', 'Kelburn, Wellington 6012, New Zealand', 'Our vision is for Victoria University to be a world-leading capital city university and one of the great global-civic universities.', 'Victoria University of Wellington  is a university in Wellington, New Zealand. It was established in 1897 by Act of Parliament, and was a constituent college of the University of New Zealand. <br>\r\n\r\nThe university is well known for its programmes in law, the humanities, and some scientific disciplines, and offers a broad range of other courses. Entry to all courses at first year is open, and entry to second year in some programmes (e.g. law, criminology, creative writing, architecture) is restricted.', 'Victoria University of Wellington was founded in 1897. Prominent among the motives for Victoria’s establishment was the pressing need for the nation’s capital and its region to be supported by a public university. Today, Victoria University views this mandate of civic engagement in a global context and is determined to ensure that its local communities benefit from the University’s internationally respected academic excellence.', 'Sapientia magis auro desideranda', 'http://www.victoria.ac.nz/', null, null, '/uploads/2/vic.jpg', 'vic.jpg', '11248', '2', '2016-11-15 03:23:02', '2016-11-15 03:23:02');
INSERT INTO university_infos VALUES ('29', 'University of Rhode Island', 'helpdesk@uri.edu', '+1 401-874-1000', '45 Upper College Rd, Kingston, RI 02881, USA', 'The University of Rhode Island is the State’s public learner-centered research university. We are a community joined in a common quest for knowledge. The University is committed to enriching the lives of its students through its land, sea, and urban grant traditions. URI is the only public institution in Rhode Island offering undergraduate, graduate, and professional students the distinctive educational opportunities of a major research university. Our undergraduate, graduate, and professional education, research, and outreach serve Rhode Island and beyond. Students, faculty, staff, and alumni are united in one common purpose: to learn and lead together. Embracing Rhode Island ’s heritage of independent thought, we value:\r\n\r\nCreativity and Scholarship\r\nDiversity, Fairness, and Respect\r\nEngaged Learning and Civic Involvement\r\nIntellectual and Ethical Leadership', 'The University of Rhode Island, commonly referred to as URI, is the principal public research as well as the land grant and sea grant university for the state of Rhode Island. Its main campus is located in the village of Kingston in southern Rhode Island. Additionally, smaller campuses include the Feinstein Campus in Providence, the Narragansett Bay Campus in Narragansett, and the W. Alton Jones Campus in West Greenwich.<br>\r\n\r\nThe university offers bachelor\'s degrees, master\'s degrees, and doctoral degrees in 80 undergraduate and 49 graduate areas of study through seven academic colleges. These colleges include Arts and Sciences, Business Administration, Engineering, Human Science and Services, Environment and Life Sciences, Nursing and Pharmacy. Another college, University College (UC) serves primarily as an advising college for all incoming undergraduates and follows them through their enrollment at URI.', 'The University was chartered as the state’s agricultural school in 1888. The Oliver Watson farm was purchased as a site for the school, and the old farmhouse, now restored, still stands on the campus. The school became the Rhode Island College of Agriculture and Mechanic Arts in 1892, and the first class of 17 members was graduated two years later.\r\n\r\nThe Morrill Act of 1862 provided for the sale of public lands. Income from these sales was to be used to create at least one college in each state with the principal purpose of teaching agriculture and mechanic arts. From this grant of land comes the term “land grant,” which applied to the national system of state colleges. In a later adaptation of the concept, federal funds given to colleges for marine research and extension are called “sea grants.”\r\n\r\nIn 1909 the name of the college was changed to Rhode Island State College, and the program of study was revised and expanded. In 1951 the college became the University of Rhode Island by an act of the General Assembly. The Board of Governors for Higher Education appointed by the governor became the governing body of the University in 1981.', 'Think Big. We Do.', 'http://www.uri.edu/', null, null, '/uploads/2/rho.jpg', 'rho.jpg', '10872', '2', '2016-11-15 03:32:38', '2016-11-15 03:32:38');
INSERT INTO university_infos VALUES ('30', 'Binghamton University', 'stuaccts@binghamton.edu', '+1 607-777-2000', '4400 Vestal Parkway East, Binghamton, NY 13902, USA', 'Binghamton University is a premier public university dedicated to enriching the lives of people in the region, state, nation and world through discovery and education and to being enriched by partnerships with those communities.', 'A world-class institution, Binghamton University offers students a broad, interdisciplinary education with an international perspective and one of the most vibrant research programs in the nation.\r\nRanked among the elite public universities in the country, Binghamton challenges students academically, not financially, in its unique, best-of-both-worlds environment.\r\nOur academic culture rivals a first-rate private university — rigorous, collaborative and boldly innovative — while our campus culture exemplifies the best kind of public university experience: richly diverse students, active social life and deep engagement with the community.\r\nOur students, both undergraduate and graduate, work one-on-one with an exceptional faculty and groundbreaking scholars. They take advantage of special academic opportunities like combined degrees, foreign language study groups and an unparalleled international education program.', 'Binghamton University opened its doors as Triple Cities College in 1946 to serve the needs of local veterans returning from service in World War II. Originally located in Endicott, five miles west of the present campus, the fledgling school was a branch of Syracuse University.\r\nFour years later, when the college was incorporated into the State University of New York, it was renamed Harpur College in honor of Robert Harpur, a Colonial teacher, patriot and pioneer, who devoted his later years to settling the area around Binghamton.\r\nUntil 1953, Harpur College was one of only two public liberal arts colleges in the state. In 1961, the campus was moved across the Susquehanna River to Vestal. Growing enrollment and a reputation for excellence soon led to the selection of Harpur College as one of four doctorate-granting University Centers in the state system.\r\nIn 1965, the campus was formally designated the State University of New York at Binghamton. Binghamton University was adopted as our informal name in 1992', 'From breadth through depth to perspective', 'http://www.binghamton.edu/', null, null, '/uploads/2/bing.jpg', 'bing.jpg', '897', '2', '2016-11-15 03:38:07', '2016-11-15 03:38:07');
INSERT INTO university_infos VALUES ('31', 'Waseda University ', 'admission@list.waseda.jp', '+81 3-3203-4141', '1 Chome-104 Totsukamachi, Shinjuku, Tokyo 169-8050, Japan', 'On Waseda University’s 30th anniversary in October 1913, President Shigenobu Okuma proclaimed its newly adopted Mission Statement.\r\nAs the fundamental statement of its educational policy, the mission was drafted by Sanae Takata, Shoyo Tsubouchi, Kenkichi Ichijima, Kazutami Ukita, Yasukuni Matsudaira and their colleagues, and approved by Okuma before its presentation at the anniversary celebration.\r\nIn 1937 a monument inscribed with the mission statement, in calligraphy by Hisoka Maejima, was installed near the main gate.', 'Waseda’s culture and traditions have evolved over more than a century, but its founding principles remain firm, and the Waseda spirit lives in the hearts of over 500,000 alumni. Here we present the changing, the unchanged, the little-known and the lovable about Waseda.', 'Waseda University started life as Tokyo Senmon Gakko (Tokyo College) on October 21, 1882. In the early years it was also commonly known as the Waseda Gakko (Waseda School) or Totsuka Gakko (Totsuka School), after the location of founder Shigenobu Okuma’s villa in the village of Waseda and the school’s location in Totsuka Village.\r\n\r\nAround 1892, the vernacular name Waseda Gakko became prevalent, and the institution was formally renamed Waseda Daigaku (Waseda University) upon acquiring university designation in 1902.', '学問の独立 (Independence of Learning)', 'https://www.waseda.jp/top/en', null, null, '/uploads/2/was.png', 'was.png', '11385', '2', '2016-11-15 03:44:23', '2016-11-15 03:44:23');
INSERT INTO university_infos VALUES ('32', 'University of Science & Technology Beijing ', 'dfa@ustb.edu.cn', '+86 10 6232 5294', 'China, Beijing, Haidian, 学院路30号', '   Our mission is   To develop and train our students with integrity，practical ability and innovation in engineering and other disciplines to best serve the needs of the industry and the society.', 'he University of Science and Technology Beijing (USTB) was founded in 1952 following the amalgamation of the best departments in related fields of five eminent universities as a result of a nationwide reorganization of the higher education system. Over half a century of remarkable growth, it has developed into one of the most influential key national universities sponsored by the Chinese Ministry of Education. USTB is renowned for its study of metallurgy and materials science. Its main focus is on engineering;at the same time it maintains a balanced programme of science, management, humanities, economics and law. It was one of the first universities to be entitled to establish state-approved graduate schools and was chosen to be part of China\'s \"211 Project\", which is designed to develop a hundred first rate universities in the 21st century. In 2006 it was also selected as one of a select group of pilot universities for the \"Platform for National Advanced Disciplines Innovation\" program.', 'The university was founded in 1952 from the combination of five former colleges. It known then as the Beijing Industrial Institute of Steel and Iron(北京钢铁工业学院). It was renamed as Beijing Steel and Iron Institute (北京钢铁学院) in 1960. The University of Science and Technology Beijing name was not adopted until 1988.\r\n\r\nIn 1997, USTB was selected into the first tier of universities for China\'s 211 Project (involved with the development of 100 world class universities in the 21st century for China).', '求实鼎新 ( Seeking Truth and Endorse Innovation)', 'http://www.ustb.edu.cn/index.asp', null, null, '/uploads/2/sc.png', 'sc.png', '10900', '2', '2016-11-15 03:50:47', '2016-11-15 03:50:47');
INSERT INTO university_infos VALUES ('33', 'Saint Petersburg State University', 'admission@spbu.ru', '+7 812 328-94-55', 'University Embankment, 7-9, Sankt-Peterburg, Russia, 199034', 'USF St. Petersburg will shine. USF St. Petersburg faculty and administrators will work shoulder-to- shoulder with students and community partners to build a better world. We will challenge ourselves to excel in research, teaching and service.', 'For more than 290 years, St. Petersburg University has been committed to advancing science, generating knowledge and training outstanding professionals. The University is rich in history – it dates back to 1724, when Peter the Great founded the Academy of Sciences and Arts as well as the first Academic University in Russia.', 'In 1821 the university was renamed Saint Petersburg Imperial University.[4] In 1823 most of the university moved from the Twelve Collegia to the southern part of the city beyond the Fontanka. In 1824 a modified version of the charter of Moscow University was adopted as the first charter of the Saint Petersburg Imperial University. In 1829 there were 19 full professors and 169 full-time and part-time students at the university. In 1830 Tsar Nicholas returned the entire building of the Twelve Collegia back to the university, and courses resumed there. In 1835 a new Charter of the Imperial Universities of Russia was approved. It provided for the establishment of the Faculty of Law, the Faculty of History and Philology, and the Faculties of Physics and Mathematics were merged into the Faculty of Philosophy as the 1st and 2nd Departments, respectively.', 'Hic tuta perennat (Here all in safety lasts)', 'http://spbu.ru/', null, null, '/uploads/2/ppp.png', 'ppp.png', '6568', '2', '2016-11-15 04:01:27', '2016-11-15 04:01:27');
INSERT INTO university_infos VALUES ('34', 'Adam Mickiewicz University in Poznań', 'wse@amu.edu.pl', '+48 61 829 40 00', 'Wieniawskiego 1, 61-712 Poznań, Poland', 'Our mission is to be a internationally-recognized model for chemical research and education that is to provide an excellent education in chemistry within a liberal arts tradition for a variety of learners to help understand that chemistry is a way of thinking about how matter is constructed, organized, and functions and to provide our faculty with career and research opportunities for their scholarly development. The Faculty of Chemistry is one of the leading chemistry faculties in Poland. The faculty members are engaged in teaching and research in almost all fields of modern chemistry, including implementation of innovative results in practice. The Faculty offers several types of educational programmes structured in accordance with the Bologna process: 3-year bachelor degree studies bachelor, 2-year master degree studies and 4-year doctoral studies. The Faculty also offers several one-year postgraduate courses directed mainly at high school teachers. The average total enrolment over the last several years reached over 1000 students.\r\n', 'University. Adam Mickiewicz University in Poznan j eden of the best Polish universities, worthy of continuing the tradition of the Academy Lubrański and Poznan the Jesuit college - pearls educational system of the former Republic.\r\nToday our University, for many years in all the rankings placing him at the forefront of the best Polish universities, representing a European level training and conducted research , is experiencing a period of comprehensive development of scientific, educational and investment.', 'By virtue of the royal privilege of Sigismund III Vasa 28 October 1611. Jesuit College existed as the first university in Poznan. The privilege of King Sigismund III was confirmed by King John Casimir in 1650. And King John III Sobieski in 1678r. On the basis of these privileges broadcast in Poznan degrees and master degrees and doctorates. It was not until May 7, 1919, the 308 years after the formal establishment of the university life by the Polish king, was held in Poznan, the solemn inauguration of the first academic year the newly established University Extension Piast, as originally called the University of Poznan (the current name given to the university from December 24, 1955 year). The ceremony inauguration coincided with czterechsetleciem of establishment of the Academy Lubrański, which admittedly does not have the status of a university, however, it is considered to be the spiritual predecessor Wszechnica Piast. The first department, who began teaching immediately after the inauguration, was omnidirectional, brought to life April 4, 1919, Faculty of Philosophy. During the first meeting of the Faculty of April 5, 1919., From professors elected rector, which was prof. Heliodor Święcicki. Young Wszechnica Piast supported by professors from Krakow, Lviv, Vilnius and Warsaw. The school, renamed the University of Poznan, throughout the interwar period perfectly developed, educating students in five faculties in the field: law and economics, medicine, humanities, mathematics and natural sciences, and agriculture and forestry. He received a diploma here every tenth graduate of universities in Poland.', 'Adam Mickiewicz University Poznan', '	http://international.amu.edu.pl', null, null, '/uploads/2/uam.png', 'uam.png', '11124', '2', '2016-11-15 04:11:35', '2016-11-15 04:11:35');
INSERT INTO university_infos VALUES ('35', 'Ben Gurion University of the Negev', 'msihadmissions@post.bgu.ac.il', '+972 8-646-1600', 'ניברסיטת ב-גוריון בנגב, ת.ד , 653, Be\'er Sheva, 8499000, Israel', '\r\nNatural sciences are the basis of many of the study programs at BGU.  As part of BGU’s educational mission and as a basis for research the Faculty strives to provide a means for students to develop an understanding in natural sciences, and to educate scholars with a deep knowledge and understanding of the different related disciplines. We aim to develop independent, critical awareness and systematic research abilities in our students so as to create a new generation of researchers.  The undergraduate study programs include also several interdisciplinary programs aimed to provide excelling students with a rich platform for scientific, technological and social changes.', 'Ben-Gurion University of the Negev aspires to be among the best inter-disciplinary research universities in the world, a leader in scientific innovation, inter-disciplinary research and applied sciences – all of which impact daily life. It is committed to social and environmental responsibility and is working to develop the Negev, Israel and the world.\r\n\r\nThe University attracts excellent students and researchers from Israel and abroad, original thinkers with a developed social conscience, who integrate into the country\'s leadership in a variety of ways.', 'Ben-Gurion University was established in 1969 as the University of the Negev with the aim of promoting the development of the Negev desert that comprises more than sixty percent of Israel. The University was later renamed after Israel\'s founder and first prime minister David Ben-Gurion, who believed that the future of the country lay in this region. After Ben-Gurion\'s death in 1973, the University was renamed Ben-Gurion University of the Negev.', 'University of the Negev', 'http://in.bgu.ac.il/Pages/default.aspx', null, null, '/uploads/2/bgu.jpg', 'bgu.jpg', '833', '2', '2016-11-15 04:19:41', '2016-11-15 04:19:41');
INSERT INTO university_infos VALUES ('36', 'University of Belgrade', 'kabinet@rect.bg.ac.rs', '+381 11 3207400', 'Studentski trg 1, Beograd, Serbia', 'The mission of the University of Belgrade is to provide superior education and exceptional knowledge to its students, not only in terms of their intellectual growth and development, but also in terms of growth and development of their human qualities and ethical values, and inspiring their wish and inclination to be leaders; moving the boundaries of knowledge and higher education, promoting intellectual surroundings which cherishes and honors true values, respect and accepting people’s differences and devotion to knowledge, development and human values.\r\nDevoted to studying, education, progress and prosperity, the University of Belgrade strives to set the strongest standards in higher education, to cherish and encourage intellectual and personal growth and to stimulate meaningful work and effort which serve to the well-being of the entire society', 'University is an institution which is rightly considered one of the greatest contributions of the peoples of Europe to the world\'s cultural heritage.\r\nThe University of Belgrade is a state university. Its main activities in the fields of higher education and scientific research are activities of public interest, and they are carried out in accordance with the legal regulations.\r\nThe University of Belgrade celebrates September 13 as its day. This is the date when lessons started at the first Higher School, founded by Dositej Obradovic.', 'The University of Belgrade was established in 1808 as the Belgrade Higher School (Serbian: Велика школа, a Grande École) by Dositej Obradović, Serbian key figure in the Age of Enlightenment. It was the highest ranking educational institution in Serbia between 1808 and 1905, as the first Higher School (1808–1813), the Belgrade Lyceum (1838–1863), and the second Higher School (1863–1905). It was initially located at the Countess Ljubica\'s Residence building and then moved to another significant site in Belgrade, the Captain Miša’s Mansion, today\'s seat of the university', 'oldest and the largest university in Serbia.', 'http://bg.ac.rs/', null, null, '/uploads/2/bel.jpg', 'bel.jpg', '822', '2', '2016-11-15 13:36:14', '2016-11-15 13:36:14');
INSERT INTO university_infos VALUES ('37', 'Università degli studi di Bari Aldo Moro', 'redazioneweb@uniba.it', '+39 080 883046', 'Piazza Umberto I, 1, 70121 Bari, Italy', 'The University of Bari is one of the most prestigious universities in Southern Italy and it is one of the largest universities in Italy, with a student population of around 60,000.', 'The University of Bari Aldo Moro  is a higher education institution in Bari, Apulia, in southern Italy. The university offers various courses for undergraduate, graduate and post-graduate students. Aside from teaching, the university is also focused on scientific research at the doctorate level. The University of Bari research centres are highly-interactive, having connections among different departments, universities, and other research centres.', 'The University of Bari was founded in 1925. It is a state-supported university which is divided into 12 faculties. Each faculty has its own set of departments that focus on the arts sciences, mathematics, social sciences, literature, medicine, law, and educatio', 'Universitatis Barensis', '	www.uniba.it', null, null, '/uploads/2/tis.jpg', 'tis.jpg', '9436', '2', '2016-11-15 13:45:23', '2016-11-15 13:45:23');
INSERT INTO university_infos VALUES ('38', 'Northwest A & F University', 'ipo@nwsuaf.edu.cn', '+86 29 8708 0114', '3 Taicheng Rd, 杨凌区 Xianyang Shi, Shaanxi Sheng, China, 712100', 'The mission of the Northwestern University Division of Student Affairs is to educate students, engage the community, and enrich the Northwestern experience.\r\nWe pursue our mission through providing learning programs, services, and mentoring to maximize students’ potential; removing barriers to learning; strengthening readiness to learn; and sustaining a safe and healthy Northwestern community.', 'Northwest A&F University  is a national key university located in Yangling Agricultural Hi-tech Industries Demonstration Zone, Shaanxi Province, P.R.China. The university has an old and abandoned name called Northwest Sci-tech University of Agriculture and Forestry, NWSUAF for short, which is still kept in the domain name of the university\'s official website.', 'The history of Northwest A&F University can be dated back to 1934 when National Northwest Senior College of Agriculture and Forestry (simplified Chinese: 国立西北农林专科学校; traditional Chinese: 國立西北農林專科學校) was established by Ministry of Education, Republic of China based on an act drafted by Tai Chi-Tao, General Yang Hucheng and Yu Youren in 1932. This was the first national senior college with speciality on agriculture field in the north-west of China and was also the only independent senior college of its kind. Yangling, where the university is located, is believed as the birthplace of Houji, God of Abundant Harvests, and is the area where he taught people how to grow and harvest cereals. Since 1934, 7 academic institutions or universities resided here gradually and it is reputable as Town of Agriculture Sciences. Many achievements have been made by university, such as wheat cultivars Biman 1 (by Zhao, Hongzhang)[5] and Xiaoyan 6 (by Li, Zhensheng) which were dominant wheat cultivars in Yellow River-Huai River Wheat Growth Area and significantly increased wheat quality and yield. The Ministry of Education and Shaanxi Province Government proposed to merge the 7 scientific organizations to 1 new University and finally get approved by State Council in 1999, thus establishing Northwest A&F University.', 'Be honest, modest, brave and resolute', 'http://www.nwsuaf.edu.cn/', null, null, '/uploads/2/th.jpg', 'th.jpg', '5944', '2', '2016-11-15 13:52:30', '2016-11-15 13:52:30');
INSERT INTO university_infos VALUES ('39', 'Southwest University', 'marketing@swu.edu.ph', '+1 504-468-2900', ' 2 Tiansheng Rd, Beibei Qu, Chongqing Shi, China, 400700', 'The university covers a broad range of academic disciplines including philosophy, economics, law, pedagogics, literature, history, science, engineering, agriculture and management. It offers 40 national key disciplines, 66 doctoral programs, 9 postdoctoral programs, 159 master’s programs and 97 bachelor’s programsSWU is known nationwide for its teaching methodological and agricultural studies. Studies in Pedagogics, psychology and agriculture have distinguished predominance in China; The Research of Silkworm genome is top in the world. A great deal of creative research works have been achieved in the fields like Zero Tillage Cultivation, Silkworm Genome, Studies on the Education and Psychological Behavior of Minorities in Southwestern China, and the Research on Human Time Cognition.', 'Southwest University (SWU) is a comprehensive and national key university sponsored by the Ministry of Education of China. SWU was founded in July 2005, by the merger of Southwest Normal University and Southwest Agricultural University. The history of both universities can be traced back to 100 years ago. It is one of the \"211 Project\" universities (top 100) which get preferential support for their development and construction from the Central Government of China. The total number of the students at SWU is more than 80,000, of which 50,000 are full-time students. There are many international students working for their bachelors, masters, doctors degrees and advanced studies in SWU every year.', 'Southwest University(Chinese: 西南大學） was originally established in 1906, during the Qing Dynasty. Much of its development occurred after the Republic of China was established.', '西南大學', '	www.swu.edu.cn', null, null, '/uploads/2/su.png', 'su.png', '7126', '2', '2016-11-15 14:01:23', '2016-11-15 14:01:23');
INSERT INTO university_infos VALUES ('40', 'Hong Kong Baptist University', 'adato@hkbu.edu.hk', '+852 3411 7400', 'Kowloon Tong, Hong Kong', 'HKBU is committed to academic excellence in teaching, research and service, and to the development of the whole person in all these endeavours built upon the heritage of Christian higher education.\r\n', 'Today HKBU encompasses eight Faculties/Schools offering a range of undergraduate programmes, associate degree and higher diploma programmes as well as taught postgraduate programmes and research postgraduate programmes leading to the award of master and doctoral degrees.  It prides itself on its dual focus on teaching and research and encourages service to society among its staff and students.  Over the years, HKBU has remained committed to academic excellence and the development of the whole person, and has gained a reputation as one of Asia’s finest institutions of higher learning.\r\n', 'In 1956, Hong Kong Baptist College was founded by the Baptist Convention of Hong Kong as a post-secondary college committed to the provision of whole person education.  In 1983, Hong Kong Baptist College became a fully-funded public tertiary institution. It gained university status in 1994 and was renamed Hong Kong Baptist University (HKBU).', '篤信力行  Light and truth', 'www.hkbu.edu.hk', null, null, '/uploads/2/hb.jpg', 'hb.jpg', '3175', '2', '2016-11-15 14:06:03', '2016-11-15 14:06:03');
INSERT INTO university_infos VALUES ('41', 'James Cook University', 'studentservices-singapore@jcu.edu.au', '+61 7 4781 4111', '1 James Cook Dr, Townsville City QLD 4811, Australia', '\r\n\r\nCreating a brighter future for life in the tropics world-wide through graduates and discoveries that make a difference.', 'One of the world\'s leading institutions focusing on the tropics, Australia\'s James Cook University is surrounded by the spectacular ecosystems of the rainforests of the Wet tropics, the dry savannahs, and the iconic Great Barrier Reef. Our unique location enables students from Australia and overseas to study in a diverse physical environment unparalleled by any university in the world.', 'Born of the traditional model of excellence in teaching and research, James Cook University has become a modern and dynamic university of truly global standing. Our graduates hold top-level positions around Australia and the world, and our research has earned us a worldclass reputation.\r\n\r\nJCU is Queensland’s second oldest university. We offered our first courses in Townsville in 1961 as an annex of the University of Queensland. Since then we have become a dynamic, multi-campus university with a total of 17,500 students. Our main campuses are located in Townsville and Cairns, and we have international campuses in Singapore and Brisbane.\r\n\r\nAfter a decade under the stewardship of the University of Queensland, JCU became a university in its own right on 20 April 1970. The proclamation was signed by Queen Elizabeth II at a special ceremony in Townsville, which took place 200 years, to the day, after the University’s namesake, explorer Captain James Cook, first sighted Australia.', 'Light ever increasing', 'http://www.jcu.edu.au', null, null, '/uploads/2/mot.jpg', 'mot.jpg', '4073', '2', '2016-11-15 14:11:20', '2016-11-15 14:11:20');
INSERT INTO university_infos VALUES ('42', 'Tampere University of Technology ', 'admissions@tut.fi', '+358 3 311511', 'Korkeakoulunkatu 10, 33720 Tampere, Finland', 'Tampere University of Technology is at the leading edge of technological development and a sought-after collaboration partner among the scientific and business communities. The University produces skilful graduates to serve the needs of society', 'Tampere University of Technology (TUT) (Finnish: Tampereen teknillinen yliopisto (TTY)) is Finland\'s second-largest university in engineering sciences. The university is located in Hervanta, a suburb of Tampere.<br>\r\n\r\nThe university\'s statutory duty is to pursue research and give the highest education in its field. The research, conducted by some 1,800 staff and faculty members, mostly focuses on applied science and often has close ties to many different companies (such as Nokia). Located next to the university campus is a Technology Centre Hermia, including a large Nokia research facility. The yearly budget of the university is some 147 million euros. TUT is one of the only two Finnish universities which operate as foundation. Close to 50% of its budget is external funding. According to Times Higher Education, TUT ranks 11th in the world, and 4th in Europe, for industry collaboratio', 'From the late 19th century, Tampere had been the most important industrial center in Finland. The Technical Institute of Tampere had provided engineers for its industries since 1911, but all higher technological education in Finland took place in Helsinki University of Technology. In the 1950s, the city of Tampere started actively remedying the situation, first founding a municipal scientific library in 1955. This library later formed the core for the libraries of the TUT and the medical faculty of the University of Tampere In 1960, city succeeded in persuading the small private university Yhteiskunnallinen korkeakoulu to move to Tampere from Helsinki. A few years later, this university changed its name to University of Tampere.', 'Technology for the Benefit of People and the Environment', '	www.tut.fi', null, null, '/uploads/2/kam.jpg', 'kam.jpg', '7456', '2', '2016-11-15 14:18:26', '2016-11-15 14:18:26');
INSERT INTO university_infos VALUES ('43', 'Universidad Nacional de la Plata', 'aci@presi.unlp.edu.ar', '+54 221 423-6673', 'Calle 124 & Avenida 51 E, Ensenada, Buenos Aires, Argentina', 'Its mission is to contribute to the regional socio-economic transformation through a process of mutual transfer and enrichment which creates values to all the stakeholders and sectors involved in the cooperation action, understanding for international cooperation those actions and programs to be performed as academic and scientific exchange, as well as programs and actions of services and knowledge transfer, to produce significant improvements regarding life quality of the inhabitants of the beneficiary region.', 'The National University of La Plata  is one of the most important Argentine national universities and the biggest one situated in the city of La Plata, capital of Buenos Aires Province. It has over 90,000 regular students, 10,000 teaching staff, 16 departments and 106 available degrees.', 'The national capital of Buenos Aires was federalized in 1880. This forced the surrounding Province of Buenos Aires to cede the city, and as a result it was left without the greater part of its institutions. The new provincial capital in La Plata was subsequently founded in 1882 but lacked a center of higher education and investigation. With the purpose of rectifying this situation, the provincial senators Rafael Hernández, Emilio J. Carranza, Marcelino Aravena, and Valentín Fernández Blanco presented a bill on 12 June 1889 to create a provincial university in La Plata.', 'For science and the motherland', 'www.unlp.edu.ar', null, null, '/uploads/2/nac.jpg', 'nac.jpg', '8806', '2', '2016-11-15 14:26:34', '2016-11-15 14:26:34');
INSERT INTO university_infos VALUES ('44', 'École Normale Supérieure de Lyon', 'webmaster@ens-lyon.fr', '+33 4 72 72 80 00', '46 Allée d\'Italie, 69007 Lyon, France', 'The students of the ENS de Lyon are recruited by competitive examination or selected on the basis of their academic profiles for study within the French \"LMD\" framework (Bachelor\'s, Master\'s, Doctorate). \r\nThe ENS de Lyon also awards Master\'s degrees and doctorates jointly with other universities, prepares candidates for the agrégation teaching qualification and awards the HDR doctoral studies supervision accreditation.', 'The École Normale Supérieure de Lyon is an elite French public institution that trains professors, researchers, senior civil servants as well as business and political leaders. Students choose their courses and split their time between training and research in sciences and humanities. Founded in 1880, the ENS de Lyon also focuses on educational research. It is a symbol of French Republican meritocracy and it remains committed today to disseminating knowledge to the widest audience and to promoting equal opportunity', 'The École Normale Supérieure (ENS) was founded in post-revolutionary France to train teachers for secondary schools and ensure a consistent, critical and secular education for all pupils across the country. \r\n\r\nSoon the ENS became home to the nation\'s leading research and intellectual life: famous alumni of France\'s oldest ENS, the ENS Ulm in Paris, include Louis Pasteur, Jean-Paul Sartre and Simone Weil. \r\n\r\nBuilding on this first success, other ENS were created in the late 19th century with the mission to train the future teachers of France\'s primary and secondary education system: in Fontenay-aux-Roses for young women and in Saint-Cloud for young men. \r\n\r\nAfter World War II, these two schools focused on preparing teachers for the higher education system through a training-by-research model that remains today the hallmark of the ENS. From the 1980\'s onwards, the schools gradually moved to Lyon, where the ENS de Lyon was officially founded in 2010.', 'Education through research, for research', '	www.ens-lyon.eu', null, null, '/uploads/2/lol.jpg', 'lol.jpg', '1961', '2', '2016-11-15 14:34:53', '2016-11-15 14:34:53');
INSERT INTO university_infos VALUES ('45', 'University of Crete', 'secretary@rector.uoc.gr', '+30 2831 077900', 'Rethimno 741 00, Greece', '\r\nThe mission of Universities in Greece is ‘to generate and transmit knowledge through research and teaching, to prepare students for its application on a professional level and to cultivate the arts and culture’', 'The University of Crete is a young public educational institution committed to excellence in research and teaching.\r\n\r\nThe international orientation of the University is reflected in its track record of collaborations with many of the leading research and educational institutions in Europe and worldwide as well as active promotion of mobility and exchange programmes. Research and research training at all levels benefits also from the close collaboration between many of the University’s research groups with the Institutes of the Foundation for Research and Technology – Hellas (FORTH) and the Institute of Marine Biology, Biotechnology and Aquaculture (IMBBC)', 'Established in 1973, the University accepted its first students in 1977-78. It now has 16 Departments in 5 Schools (Philosophy, Education, Social, Economic & Political Sciences, Sciences & Engineering, and Medicine) as well as a number of affiliated research-oriented institutions, including the Skinakas Observatory, the Natural History Museum, and the University General Hospital. Currently, over 16,000 undergraduates and 2500 postgraduate students are registered here. They are educated by an outward looking academic faculty of around 500 members, supported by adjunct lecturers, post-doctoral researchers, laboratory support staff and instructors, as well as around 300 technical and administrative support staff.', 'Πανεπιστήμιο Κρήτης', '	http://www.uoc.gr', null, null, '/uploads/2/cre.png', 'cre.png', '10570', '2', '2016-11-15 14:50:23', '2016-11-15 14:50:23');
INSERT INTO university_infos VALUES ('46', 'University of Navarra', 'clasaosa@unav.es', '+34 948 42 56 00', 'Calle de Irunlarrea, 1, 31008 Pamplona, Navarra, Spain', 'To seek and present the truth; contribute to the academic, cultural and personal education of its students; promote academic research and healthcare activities; provide suitable opportunities for the development of its professors and employees; and carry out broad cultural outreach and social promotion work with a clear goal of service.', 'The University of Navarra is a private non-for-profit university located on the southeast border of Pamplona, Spain. It was founded in 1952 by St. Josemaría Escrivá de Balaguer, the founder of Opus Dei, as a corporate work of the apostolate of Opus Dei.<br>\r\n\r\nThrough its six campuses (Pamplona, San Sebastián, Madrid, Barcelona, Munich and New York City), the University confers 35 official degrees, 13 dual degrees and more than 38 master\'s programs in 14 faculties, 2 university schools, 17 institutes, its graduate business school, IESE (\"Instituto de Estudios Superiores de la Empresa\"; in English: \"International Graduate School of Management\" or \"Institute of Higher Business Studies\"), ISSA (\"Instituto Superior de Secretariado y Administracion\"; in English: Superior Institute of Secretarial and Administrative Studies), and other centers and institutions', 'The institution was founded as the Estudio General de Navarra on October 17, 1952 with the encouragement of Josemaría Escrivá. It began as a School of Law with 48 students and eight professors, under the direction of Ismael Sánchez Bella', 'Universitas Studiorum Navarrensis', '	www.unav.edu', null, null, '/uploads/2/nav.png', 'nav.png', '8465', '2', '2016-11-15 14:58:20', '2016-11-15 14:58:20');
INSERT INTO university_infos VALUES ('47', 'Medical University of South Carolina', 'finaid@musc.edu', ' +1 843-792-2300', '171 Ashley Ave, Charleston, SC 29425, USA', '\r\nMUSC’s purpose is to preserve and optimize human life in South Carolina and beyond.\r\n\r\n', 'The Medical University of South Carolina (MUSC) opened in Charleston, South Carolina in 1824 as a small private college for the training of physicians. It is one of the oldest continually operating schools of medicine in the United States and the oldest in the Deep South. The school\'s main building was designed by Charleston architect Albert W. Todd.', 'The College of Medicine began in 1823 with the incorporation of the Medical College of South Carolina, a private institution of the Medical Society of South Carolina. Seven Charleston physicians formed the initial faculty with 30 students enrolled in 1824. The first graduation was on April 4, 1825. With the exception of the American Civil War, the college has served continuously to the present, even when there was a total enrollment of two students. At the time of Dr. Robert Wilson’s appointment as Dean of the College of Medicine in 1908, Abraham Flexner was beginning his survey of the Medical College. Flexner’s survey resulted in the report titled Medical Education in the United States and Canada. It was highly critical of the Medical College and its poor facilities, lack of full-time faculty, lack of equipment, and lack of money. Recognizing that the college did not meet national requirements, Dr. Wilson determined that the only way to save the college from closure was to transfer it to state ownership in order to have access to state appropriations. The state took over formal control of the college in 1913.', '\"She (the college) enriches by giving generously.\"', '	www.musc.edu', null, null, '/uploads/2/usc.png', 'usc.png', '5165', '2', '2016-11-15 15:03:53', '2016-11-15 15:03:53');
INSERT INTO university_infos VALUES ('48', 'University of the Witwatersrand', 'studysa.international@wits.ac.za', '+27 11 717 1000', 'Richard Ward, 1 Jan Smuts Ave, Braamfontein, Johannesburg, 2000, South Africa', 'Develop a distinctive brand identity and unique position for Wits in the city research landscape. Draw together the university’s urban scholars who conduct research across a wide range of fields and throughout each of its schools and Faculties into multidisciplinary programmes of research, teaching and graduate student support. Provide an intellectual hub around which scholars from many disciplines and research entities at Wits and elsewhere can collaborate on large-scale, city-related initiatives. Stimulate and expand critical and collaborative research that seeks new knowledge and novel approaches to complex city economies, societies and environments. Build adequate financial resources and services to support a network of sufficient critical mass of city-related researchers to undertake large-scale research projects. - See more at: https://www.wits.ac.za/cityinstitute/about-us/vision-and-mission/#sthash.6kuf8p1h.dpuf', 'Wits is a remarkable university that is internationally distinguished for its excellent research, high academic standards and commitment to social justice.\r\n\r\nOur partners, networks and relationships serve as catalysts for the great ideas that help us to make the impossible, incredible. We invite you to join us on our extraordinary journey to effect meaningful change in society and pave the way for a bright future for generations to come.', 'The origins of Wits lie in the South African School of Mines, which was established in Kimberley in 1896 and transferred to Johannesburg as the Transvaal Technical Institute in 1904, becoming the Transvaal University College in 1906 and renamed the South African School of Mines and Technology four years later. Other departments were added as Johannesburg grew and in 1920 the name was changed to the University College, Johannesburg. Full university status was granted in 1922, incorporating the College as the University of the Witwatersrand, with effect March 1st. Seven months later the inauguration of the University was duly celebrated. Prince Arthur of Connaught, Governor-General of the Union of South Africa, became the University\'s first Chancellor, and Professor Jan H Hofmeyr its first Principal. Building began at Milner Park on a site donated to the University by the Johannesburg municipality. - See more at: http://www.wits.ac.za/about-wits/history-and-heritage/#sthash.rZjr24h5.dpuf', 'Knowledge and work', '	www.wits.ac.za', null, null, '/uploads/2/wits.jpg', 'wits.jpg', '11008', '2', '2016-11-15 15:09:28', '2016-11-15 15:09:28');
INSERT INTO university_infos VALUES ('49', 'Middle East Technical University', 'ico@metu.edu.tr', ' Phone: +90 312 210 20 00', 'Üniversiteler, Eskişehir Yolu No:1, 06800 Çankaya/Ankara, Turkey', 'The mission of the Middle East Technical University is to reach, produce, apply and promote knowledge, and to educate individuals with that knowledge for the social, cultural, economic, scientific and technological development of our society and humanity. This is to be done by bringing teaching, research and social services up to universal standards.', 'Middle East Technical University (commonly referred to as METU; in Turkish, Orta Doğu Teknik Üniversitesi ODTÜ) is a public technical university located in Ankara, Turkey. The university puts special emphasis on research and education in engineering and natural sciences, offering about 40 undergraduate programs within 5 faculties, and 97 masters and 62 doctorate programs within 5 graduate schools.[ The main campus of METU spans an area of 11,100 acres (4,500 ha), comprising, in addition to academic and auxiliary facilities, a forest area of 7,500 acres (3,000 ha), and the natural lake Eymir. METU has more than 120,000 alumni worldwide.[4] The official language of instruction at METU is English', 'Middle East Technical University is founded under the name of \"Orta Doğu Yüksek Teknoloji Enstitüsü\" (Middle East High Technology Institute) on November 15th, 1956 to contribute to the development of Turkey and Middle East countries and especially to train people so as to create a skilled workforce in the fields of natural and social sciences. \"Arrangements and Procedures as for the Foundation of METU, Law No 6887\" was enacted on January 29th, 1957. Finally, \"Foundation Act No 7307\", which sets forth the particular standing of METU and describes the conditions rendering METU as a juridical entity, was enacted on May 27th, 1959.', 'Science is the truest guide in life', '	metu.edu.tr', null, null, '/uploads/2/ooo.png', 'ooo.png', '6162', '2', '2016-11-15 15:16:35', '2016-11-15 15:16:35');
INSERT INTO university_infos VALUES ('50', 'National Chung Hsing University', 'oia@nchu.edu.tw', '+886 4 2287 3181', 'No. 145, Xingda Rd, South District, Taichung City, Taiwan 402', 'Currently, NCHU is among the four universities of Taiwan\'s Public Ivy - the Taiwan Comprehensive University System.', 'National Chung Hsing University is a research-led comprehensive university in South District, Taichung, Taiwan. According to Ministry of Education rankings, it is the best university in central Taiwan', 'National Chung Hsing University has undergone a number of significant stages of change. It began as the Advanced Academy of Agronomy and Forestry, founded by the Japanese in Taipei in 1919. After 1928, the Academy became a special department affiliated to Taihoku Imperial University (now National Taiwan University). However, the department became an independent school again in 1943, and was moved to Taichung.\r\n\r\nAfter the Restoration of Taiwan in 1945, the school was reorganized and renamed Taiwan Provincial Taichung Agricultural Junior College. In 1946, the Junior College evolved into a higher institution, Taiwan Provincial College of Agriculture. Then in 1961, it combined with the newly-established College of Science and Engineering on the same Taichung campus and the College of Law and Business founded in Taipei in 1949, to become Taiwan Provincial Chung Hsing University. In 1964, an Evening School was set up on the Taipei Campus. In 1968 another Evening School and the College of Liberal Arts were added to the Taichung Campus. The University continued to grow in size, and in 1971 it became a national university, and assumed its present name: National Chung Hsing University (NCHU).', 'Honesty, Simplicity, Advancement, Diligence', '	www.nchu.edu.tw', null, null, '/uploads/2/nch.png', 'nch.png', '5596', '2', '2016-11-15 15:24:24', '2016-11-15 15:24:24');
INSERT INTO university_infos VALUES ('51', 'Chemnitz University of Technology', 'iuz@chemnitz.de', '+49 371 5310', ' Str. der Nationen 62, 09111 Chemnitz, Germany', 'The Technische Universität Chemnitz is engaged in multidisciplinary dialogue within the university and beyond and is also your point of contact regarding the important questions of tomorrow – whether in teaching and learning, in research, in the training and development of the next generation of scientists or the transfer of knowledge and technological know-how in society or in the economy. This website showcases the work done in Chemnitz, networked on a national and international level, which continues to grow in importance every day.', 'Situated in the center of the Chemnitz “Wissenschaftsregion” (“science region”), the Technische Universität (TU) Chemnitz is home to more than 11,000 students from 90 countries – in less than 25 years, the number of students has increased by about 4,000. With approximately 2,300 employees in science, engineering and management, the TU Chemnitz is among the most important employers in the region. Today, the TU Chemnitz stands for outstanding research. Within the core competencies “Materials and Smart Systems”, “Resource-efficient Production and Lightweight Structures” and “Humans and Technology”, solutions for the challenges of tomorrow are developed. The main focus in economic and social development is the creation of value, which in turn is influenced by major trends such as globalization, demographic change and the availability of resources. The TU Chemnitz’s profile is characterized by a unique constellation of competencies across eight faculties. Thanks to this constellation, Chemnitz is emerging as an internationally visible research hub for future value creation processes and sustainable growth for the future.', 'The engineering training at the Chemnitz alma mater has a more than 175-year tradition. Already in 1836 founded the \"Royal Gewerbschule Chemnitz\" the reputation of the educational institution. Here studied and taught in the past personalities who performed essential to the development of science and technolog', 'Technische Universität Chemnitz', '	www.tu-chemnitz.de', null, null, '/uploads/2/tec.png', 'tec.png', '7530', '2', '2016-11-15 15:32:39', '2016-11-15 15:32:39');
INSERT INTO university_infos VALUES ('52', 'American University Washington DC', 'alumupdate@american.edu', '+1 202-885-1000', ' 4400 Massachusetts Ave NW, Washington, DC 20016, USA', 'The American University Career Center supports the university’s commitment to uncompromising quality in the education of its students. The Career Center teaches undergraduates, graduate students and alumni how to develop educational and career goals, decision-making skills and job search strategies needed to manage their professional and academic pursuits.<br>\r\n\r\nWe accomplish our mission by providing AU students, alumni, employers, faculty and staff with expert advising, leadership in experiential education, current information and resources, and networking opportunities on and off campus, as well as online.', 'American University (AU or American) is a private research university in Washington, D.C., United States, affiliated with the United Methodist Church,although the university\'s curriculum is secular. The university was chartered by an Act of Congress on February 24, 1893 as \"The American University,\" when the bill was approved by President Benjamin Harrison', 'The American University was established in the District of Columbia by an Act of Congress on December 5, 1892, primarily due to the efforts of Methodist bishop John Fletcher Hurst.', 'For God and Country', '	american.edu', null, null, '/uploads/2/auw.png', 'auw.png', '352', '2', '2016-11-15 15:40:01', '2016-11-15 15:40:01');
INSERT INTO university_infos VALUES ('53', 'Beijing University of Chemical Technology ', 'news@buct.edu.cn', '+86 10 6443 4820', 'China, Beijing, Chaoyang, 北三环东路15号 邮政编码: 100029', 'In an era of globalization and information, the School of Foreign Languages constantly checks the direction of its discipline development. It has two missions: one is to conduct the study of foreign languages, literature and cultures, and related trans-cultural study while producing high quality talents in these fields; the other is to provide courses in foreign languages, literature, and cultures to the university and the whole society.', 'Beijing University of Chemical Technology is a technological university in mainland China. BUCT was founded in 1958 and is affiliated with the Ministry of Education. As a member university of the Project 211, BUCT has developed from an institution of scientific specialties to a more comprehensive university, with a curriculum including liberal arts.', 'The origin of the School of Foreign Languages at Peking University goes back to Jingshi Tongwenguan (Capital House of Foreign Languages), which was set up in 1862 to train experts in foreign languages for the Qing government. In their memorial to the throne, Yi Xin, Prince Gong, and his fellow officials stated that the intention of setting up Jingshi Tongwenguan was to master foreign languages so as to avoid being deceived by other countries. The Qing government  -- while being forced to open up -- chose to develop the navy and education as the countermeasures, and so Jingshi Tongwenguan was the first modern university to be set up as a result of the new governmental policy.\r\nJingshi Tongwenguan offered courses in English (1862), French (1863), Russian (1863), German (1871) and Japanese (1897). Suggested by officials in the Qing government who saw the significance of science, courses in astronomy, mathematics, physics and chemistry have been offered since 1867. In addition, courses in international law also became available. Thus the courses fell into three categories: foreign language, science, and law. Those three were considered the most important instruments for China to empower itself during that era. Among the 110 teachers, there were 27 foreigners, most of whom were language teachers and were the first foreign teachers at a Chinese university.\r\n In 1898, Jingshi Daxuetang (Capital University), which later became Peking University), was set up and offered courses in English, French, German, Russian, and Japanese but was closed briefly in 1900. In 1902, shortly after being reopened, Jingshi Daxuetang merged with Jingshi Tongwenguan and was renamed Yixueguan (House of Translation) the next year. Thus the two predecessors of the School of Foreign Languages at Peking University were combined.  ', 'Integrity, Knowledge, Sharing & Works', '	www.buct.edu.cn', null, null, '/uploads/2/beij.png', 'beij.png', '795', '2', '2016-11-15 15:48:46', '2016-11-15 15:48:46');
INSERT INTO university_infos VALUES ('54', 'National Yang Ming University', 'trudy@ym.edu.tw', '+886 2 2826 7000', 'No. 155號, Section 2, Linong St, Beitou District, Taipei City, Taiwan 112', 'To become:\r\nA reliable community hospital providing patient-centered and high quality medical services\r\nA university hospital providing extraordinary multidisciplinary medical education, A research center with excellence in certain fields.', 'National Yang-Ming University (NYMU; Chinese: 國立陽明大學)[3] is a research university located in Shipai, Beitou District, Taipei, Taiwan. It is famous for research in fields of Medicine, Life Sciences and Biotechnology. In the 2010 QS Asian Universities Rankings, Yang Ming University was placed 4th among universities in Taiwan[4] and 2nd in the field of Life Science & Biomedicine', 'the school motto of \"benevolent mind and art, putting knowledge into practice\" while training excellent humane doctors to provide service by solving medical problems in remote and rural areas.\r\n \r\nGraduated in 1982, the first government-sponsored class of the Faculty of Medicine was sent to public clinics and hospitals. Since then, our graduates have penetrated all corners of Taiwan and became pioneers in basic healthcare services. As our graduates won warm acclaim from society, we found that we had successfully accomplished our initial mission.', 'benevolent mind and art, putting knowledge into practice', '	nymu-e.web.ym.edu.tw', null, null, '/uploads/2/nym.gif', 'nym.gif', '5737', '2', '2016-11-15 15:54:55', '2016-11-15 15:54:55');
INSERT INTO university_infos VALUES ('55', 'Beijing (Northern) Jiaotong University / 北京交通大学', 'chlv@bjtu.edu.cn', '+86 10 6225 6622', 'China, Beijing Shi, Haidian Qu, BeiXiaGuan, 上园村3号', 'As one of the three origins of the Jiaotong University, BJTU grew out of Beijing Railway Management Institute, China’s first higher educational institution which was committed to fostering railway management talents and initiated modern China’s education in railway management and telecommunication. Some renowned people in Chinese history received education at the University, including Liu Han, founder of China’s first radio station, Ying Shangcai, inventor of China’s first high-power steam engine, Zheng Zhenduo, famous writer and literary critic and historian, Jin Shixuan, author of China’s first railway management monograph, Xu Jing, pioneer of railway transport economics in China, and Yang Rumei, one of the early four major accountants in China. Some famous scholars worked at the University, including Xiang Zhejun, Chief Prosecutor of the Tokyo Trial and Ma Yinchu, famous demographer and economist.', ' Beijing Jiaotong University (BJTU, formerly known as Northern Jiaotong University) is a national key university under the direct administration of the Ministry of Education and now is jointly supported by the Ministry of Education, the China Railway Corporation (formerly known as the Ministry of Railways) and Beijing Municipal Government. BJTU is one of the first universities selected into the “National 211 Project” and the “985 Strength Discipline Innovation Platform” project, one of the first institutions authorized to confer master’s and doctoral degrees. BJTU, as the leading organization, has established the Collaborative Innovation Centre for Rail Transit Safety, which is one of the first 14 collaborative centers approved by the Chinese government to enter the “National 2011 Projects', 'The university was a component of Jiaotong University (also named Chiao Tung University). In September 1909, the Postal Department of the Qing government founded the Railway Management Institute in Beijing. In 1920s, it merged with two technical schools in Shanghai and Tangshan to form the Jiaotong University, which had three campuses in Beijing, Shanghai and Tangshan, respectively, changing its name to Beiping Railway Management School. The Beijing campus was named National Jiaotong University, Beijing (交通大学北京学校). In 1949, the Beijing campus was renamed Northern Jiaotong University (Chinese: 北方交通大学). In September, 2003, it was once again renamed Beijing Jiaotong University (Chinese: 北京交通大学) to make its favorable locality explicit. The Shanghai campus has since separated into two universities which are now Shanghai Jiaotong University and Xi\'an Jiaotong University, with a further sister branch in Nanchang.', 'Knowledge and Action', '	www.njtu.edu.cn', null, null, '/uploads/2/jia.png', 'jia.png', '788', '2', '2016-11-15 16:00:39', '2016-11-15 16:00:39');
INSERT INTO university_infos VALUES ('56', 'University of Haifa', 'info@mail.uhaifa.org', '+972 4-824-0111', 'Abba Khoushy Ave 199, Haifa, 3498838, Israel', 'Beyond the objective of a first-rate higher education, the University of Haifa aims to provide equal educational opportunities to all, and in particular to encourage mutual understanding and cooperation between the Jewish and Arab populations on and off campus. The university is a home for students from all sectors of Israeli society - Jews, Muslims, Christians, Druze, religious and secular students and also many students from all over the world who study in the international school.', 'The University of Haifa was founded in 1963[1] by Haifa mayor Abba Hushi, to operate under the academic auspices of the Hebrew University of Jerusalem. Haifa University is located on Mount Carmel. In 1972, the University of Haifa declared its independence and became the sixth academic institution in Israel and the fourth university.', 'In its first year 472 students attended the University.[citation needed] Studies in Humanities and Social Sciences were offered in the following departments: Biblical Studies, Hebrew Literature and Language, Jewish History, General History, French Literature and Language, English Literature and Language, Arabic Literature and Language, Geography, Sociology, and Political Science. The academic staff included 180 instructors, 50 of them Haifa residents.', 'Academic excellence with a personal touch', '	www.haifa.ac.il', null, null, '/uploads/2/haifa.png', 'haifa.png', '10643', '2', '2016-11-15 16:04:27', '2016-11-15 16:04:27');
INSERT INTO university_infos VALUES ('57', 'Tunghai University', 'iruka@thu.edu.tw', '+886 4 2359 0121', 'No. 1727, Section 4, Taiwan Blvd, Xitun District, Taichung City, Taiwan 407', 'By establishing various key interdisciplinary research centers, such as the Center of Chinese Studies, the Life Science Research Center, Center Nanoscience and Technology, Center for Tropical Ecology and Biodiversity, Software Engineering & Technology Center, Tunghai has been proactively staying in sync with the latest global trends in research and development. Tunghai University will continue to follow its founding pioneering spirit and its school motto of Truth, Faith and Deed, Tunghai University will continue to innovate and make its unique contribution to higher education in Taiwan.', 'Tunghai University was established in 1955 and it is located on the level plateau of Taichung’s Tatu Mountain. Tunghai University, a liberal institution is full of scholarly elites and abundant resources and is well-known for its beautiful campus. Tunghai has 9 colleges, 34 departments and 35 Master’s programs (1 independent Master’s program and 13 In-Service Master’s programs) and 14 PhD programs.', 'Beginning with the founding of St. John’s University in 1865, the Protestant Church established, in all, 13 Christian universities in regions of mainland China, making a great contribution to the nation’s higher education. However, after 1949 these institutions were forced to close, thereby frustrating Christian education. The following year, a group of enthusiastic Chinese educators proposed to the United Board for Christian Colleges in China to foster the spirit of Chinese youth by establishing an ideal university in Taiwan, that would both continue the \r\nwork of Christian education in China and inherit the grand tradition of the 13 mainland universities. In 1952, the Board’s secretary, Dr. William P. Fenn, made a trip to Taiwan to investigate the possibility. He decided to establish a university that would meet Taiwan’s needs and also maintain the highest academic standards. In June of 1953, the Board sent Dr. Thomas W. Graham of Oberlin College, Ohio representing the organization, together with Dr. Fenn to set up a preparatory office and board to oversee the establishment of the school. They appointed Dr. Li-wu Hang to chair both the office and board. After careful assessment, Ta-tu Hill, west to Taichung City, was chosen as the site of the campus. The school was named Tunghai University meaning Eastern Sea to China.', 'Truth, Faith, Deeds', '	www.thu.edu.tw', null, null, '/uploads/2/tung.png', 'tung.png', '8014', '2', '2016-11-16 02:36:36', '2016-11-16 02:36:36');
INSERT INTO university_infos VALUES ('58', 'Old Dominion University', 'intladm@odu.edu', '+1 757-683-3000', '5115 Hampton Blvd, Norfolk, VA 23529, USA', 'The development of the Old Dominion University Strategic Plan: 2009-2014 provided the University with the opportunity to review progress on its previous Strategic Plan and to chart a direction for the next five year period and beyond. This process garnered input from multiple constituencies including the Faculty, Board of Visitors, Students, Staff, and members of the external community.', 'Old Dominion University is Virginia\'s forward-focused research university with rigorous academics, an energetic residential community, entrepreneurial research and collaboration, and initiatives that contribute nearly $2.1 billion to the economy. Located along the Elizabeth River in Norfolk, Virginia, the ODU campus boasts state-of-the-art academic facilities, 14 residence halls and amenities such as the Student Recreation Center.', 'Old Dominion University began its tradition of excellence when it was founded in 1930 by the College of William and Mary, the second oldest university in the United States. Established as an extension of William and Mary in Williamsburg, Virginia, and Virginia Polytechnic Institute in Blacksburg, Virginia, Old Dominion began educating teachers and engineers. The two-year school rapidly evolved into a four-year institution, and was granted independence in 1962 as Old Dominion College.', '	Idea Fusion	', '	www.odu.edu', null, null, '/uploads/2/old.jpg', 'old.jpg', '6061', '2', '2016-11-16 02:41:16', '2016-11-16 02:41:16');
INSERT INTO university_infos VALUES ('59', 'San Francisco State University', 'pubcom@sfsu.edu', '+1 415-338-1111', ' 1600 Holloway Ave, San Francisco, CA 94132, USA', 'At San Francisco State University, we are serious about student success -- and the proof is in the impressive achievements of our alumni.', 'San Francisco State University (commonly referred to as San Francisco State, SF State and SFSU) is a public comprehensive university located in San Francisco, California, United States. As part of the 23-campus California State University system, the university offers 118 different Bachelor\'s degrees, 94 Master\'s degrees, 5 Doctoral degrees including two Doctor of Education, a Doctor of Physical Therapy, a Ph.D in Education and Doctor of Physical Therapy Science, along with 26 teaching credentials among six academic colleges', 'Just one year after SF State was founded in 1899, as the San Francisco State Normal School, the school’s teaching methods were defined as “radical.”\r\n\r\nWe’ve been shaking things up ever since.\r\n\r\nThrough a process of continuous improvement and evolution, SF State has become a university like no other.', 'Experientia Docet', '	www.sfsu.edu', null, null, '/uploads/2/san.jpg', 'san.jpg', '6623', '2', '2016-11-16 02:51:35', '2016-11-16 02:51:35');
INSERT INTO university_infos VALUES ('60', 'Flinders University', 'internationalapply@flinders.edu.au', '+61 8 8201 3911', 'Sturt Rd, Bedford Park SA 5042, Australia', 'we live in an era of disruptive change in which the pace of technological innovation is remarkable. Unprecedented access to information is redefining the ways we live, learn and work. As a university, we must rise to the challenge of preparing our graduates for success in a future that will be every bit as dynamic and unpredictable as it is exciting.', 'Flinders University enjoys a well-justified reputation for its excellence in teaching and research. It has a long-standing commitment to enhancing educational opportunities for all and a proud record of community engagement.\r\n\r\nSince being established in 1966, Flinders has achieved much of which we can be very proud—in innovative research, in high quality teaching and in community engagement.', 'By the late 1950s, the University of Adelaide\'s North Terrace campus was approaching capacity. In 1960, Premier Thomas Playford announced that 150 hectares (370 acres) of state government-owned land in Burbank (now Bedford Park) would be allocated to the University of Adelaide for the establishment of a second campus.<br>\r\n\r\nPlanning began in 1961. The principal-designate of the new campus, economist and professor Peter Karmel, was adamant that the new campus should operate independently from the North Terrace campus. He hoped that the Bedford Park campus would be free to innovate and not be bound by tradition.<br>\r\n\r\nCapital works began in 1962 with a grant of ₤3.8 million from the Australian Universities Commission. Architect Geoff Harrison, in conjunction with architectural firm Hassell, McConnell and Partners, designed a new university that, with future expansions, could eventually accommodate up to 6000 students', '\"Inspiring Achievement\"', '	www.flinders.edu.au', null, null, '/uploads/2/flinders.jpg', 'flinders.jpg', '2326', '2', '2016-11-16 02:57:44', '2016-11-16 02:57:44');
INSERT INTO university_infos VALUES ('61', '	Beijing University of Technology ', 'mail@bjut.edu.cn', ' +86 10 6739 3456', 'China, 北京市朝阳区平乐园100号', 'Rooted in Beijing, Serving Beijing, Inspiring China and Orienting itself to the World.', 'At present, BJUT has 33 colleges and institutes, offering programs in science, engineering, literature, economics, management, law, philosophy, education and arts etc. It has 3 national key disciplines and 39 municipal key disciplines and 18 Post-doctoral research programs. It offers 34 Master’s Degree programs, 57 Bachelor’s Degree programs and 10 Professional Degree programs. BJUT has now over 29,670 students, including 13,435 undergraduates, 11,253 postgraduates, 3,968 undergraduates of continuing education and 1014 international students.', 'Founded in 1960, Beijing University of Technology (BJUT) is a key university under the administration of Beijing Municipal Government, with its main campus located at No.100 Ping Leyuan, Chaoyang District in Beijing.\r\n\r\n \r\n\r\nIn 1996, BJUT was included in National 211 Project, joining the rank of China’s 100 top universities in 21st century. In 2016, according to the latest QS University Ranking, BJUT is ranked at 100th among all universities in Asia and 26th in Mainland China.', 'Taking persistence in pursuit as the substance, taking innovation everyday as the way', '	http://www.bjut.edu.cn', null, null, '/uploads/2/ing.png', 'ing.png', '799', '2', '2016-11-16 03:49:15', '2016-11-16 03:49:15');
INSERT INTO university_infos VALUES ('62', 'Beijing University of Posts and Telecommunications ', 'news@bupt.edu.cn', '+86 10 6228 2222', '10 Xitucheng Rd, BeiTaiPingZhuang, Haidian Qu, China, 100088', 'Guided by the moral of \"United, Diligent, Rigorous, Innovative\", the motto of \"Great Virtue, Profound Knowledge, Total Commitment, Harmonious Cooperation\", and the university’s spirit of \"Valuing Dedication, Pursuing Excellence\", BUPT is heading toward the grand goal of building high-level research-oriented university with distinctive features and outstanding advantages', ' Beijing University of Posts and Telecommunications under the Ministry of Education, and the Ministry of Industry and Information Technology, the first a \"211 Project\" construction of national key university, is \"985 advantage discipline innovation platform\" project key universities, it is a feature of information technology, Engineering as the main categories, multidisciplinary Arts and BBA coordinated development of research universities is an important training base of China\'s information technology professionals.', 'Beijing University of Posts and Telecommunications, founded in 1955, formerly known as the Beijing University of Posts, Telecommunications Department is Tianjin University, telephone and telegraph communications and radio communications and broadcasting two professional Chongqing University Department of Electrical Engineering & T communications professional to form the basis of new China\'s first Posts and institutions of higher learning, under the former Ministry of Posts.', 'Great Virtue, Profound Knowledge, Total Commitment, Harmonious Cooperation', 'www.bupt.edu.cn', null, null, '/uploads/2/post.png', 'post.png', '798', '2', '2016-11-16 04:10:24', '2016-11-16 04:10:24');
INSERT INTO university_infos VALUES ('63', 'King Abdulaziz University', 'info@itc.edu.sa', '+966 800 116 9528', 'Abdullah Sulayman, Jeddah 21589, Saudi Arabia', 'Community Responsibility : Knowledge Development, Research, Innovation and Entrepreneurship\" .', 'King Abdulaziz University (KAU) (Arabic: جامعة الملك عبد العزيز‎‎ ǧāmiʿat al-malik ʿabd al-ʿazīz) was founded in 1967 in Jeddah, Saudi Arabia. Designed by English architect John Elliott, it had 2,000 faculty and more than 37,000 students in 2000/2001. Established initially as a private university by a group of businessmen led by Sheikh Muhammad Abu Bakr Bakhashab Pasha and including the writer Hamza Bogary. in 1974 King Abdulaziz University was converted to a public university by a resolution of the Council Ministers of Saudi Arabia. In 2016, it was ranked the top Arab university by Times Higher Education', 'King Abdulaziz University carries the name of the establisher of Saudi Arabia- God bless him. This university was established in 1387 H / 1967 G as a national university aiming at spreading higher education in the western area of Saudi Arabia. This dream has come true through the continuous efforts of the loyal citizens of this country. The members of the initiating committee had the chance to meet King Faisal Bin Abdulaziz –God bless him- and His Majesty showed all support for this idea. The establishing committee was formed headed by King Faisal- God bless him and his highness the Minister if Education at that time Sheikh Hasan Bin Abdullah Al Al- Sheikh.\r\n\r\nThe university started its first year in (1388h- 1968g) by inaugurating the preparation study program with a few number of students( 68 male students and 30 female students,) and directly the year after, the university inaugurated its first college ( the College of Economics and Management,) then in the following yea', 'Community Responsibility : Knowledge Development, Research, Innovation and Entrepreneurship\" .', 'http://www.kau.edu.sa/Home.aspx', null, null, '/uploads/2/abd.jpg', 'abd.jpg', '4485', '2', '2016-11-16 04:17:22', '2016-11-16 04:17:22');
INSERT INTO university_infos VALUES ('64', 'University of North Carolina Charlotte', 'admissions@uncc.edu', '+1 704-687-8622', '9201 University City Blvd, Charlotte, NC 28223, USA', 'UNC Charlotte is North Carolina’s urban research university. It leverages its location in the state’s largest city to offer internationally competitive programs of research and creative activity, exemplary undergraduate, graduate, and professional programs, and a focused set of community engagement initiatives. UNC Charlotte maintains a particular commitment to addressing the cultural, economic, educational, environmental, health, and social needs of the greater Charlotte region. The complete mission statement is available online.', 'UNC Charlotte is North Carolina\'s urban research institution. Our campus is located in the piedmont of North Carolina, just two hours from the mountains and three hours from the Atlantic Ocean. A large public university with a small college feel, more than 28,700 students consider UNC Charlotte’s 1,000-acre campus their home away from home.', 'The city of Charlotte had sought a public university since 1871 but was never able to sustain one. For years, the nearest state-supported university was 90 miles (140 km) away. The city submitted a bid in the late 1880s for what would become North Carolina State University, but lost to the city of Raleigh after a local farmer offered to donate land for the campus. In 1946, the city sought a state-run medical school; instead, the state expanded the existing two-year school at UNC-Chapel Hill', 'University of North Carolina Charlotte', '	www.uncc.edu', null, null, '/uploads/2/unc.jpg', 'unc.jpg', '10837', '2', '2016-11-16 04:23:21', '2016-11-16 04:23:21');
INSERT INTO university_infos VALUES ('65', 'University of Trieste', 'deams@pec.units.it', '+39 040 558 7111', 'Piazzale Europa, 1, 34128 Trieste, Italy', 'Our challenge is to develop an international culture, versatility of knowledge and the capacity for individual growth.', 'The University of Trieste ( is a medium-sized university in Trieste in the Friuli-Venezia Giulia region in northwest Italy. The university consists of 12 faculties, boasts a wide and almost complete range of university courses and has about 23,000 students and 1,000 professors. It was founded in 1924.', 'The historical international vocation of the University of Trieste is witnessed by its intense and high-level activity: Trieste is the centre of many research facilities, with which the University is connected by cooperation agreements. Among them, there are the International School for Advanced Studies, the International Centre for Theoretical Physics, the National Institute of Oceanography, the International Centre for Genetic Engineering and Biotechnology, the Elettra Sincrotrone Trieste Facility, the Trieste sections of the Italian National Institute for Nuclear Physics (INFN) and Italian National Institute for Astrophysics (INAF), and many others, building up the so-called \"sistema Trieste\" (Trieste System).', 'Università degli Studi di Trieste', 'www.units.it', null, null, '/uploads/2/lii.png', 'lii.png', '9469', '2', '2016-11-16 04:31:10', '2016-11-16 04:31:10');
INSERT INTO university_infos VALUES ('66', '	Bar Ilan University', 'adminappl.support@mail.biu.ac', '+972 3-531-8111', 'Ramat Gan, 5290002, Israel', 'The sterling academic experience provided by Bar-Ilan University is what one would expect from any world-class institution, in Israel or elsewhere: we impart knowledge to our students, and provide them with the critical ability and tools to analyze that knowledge, to study academic subjects with rigor and discipline, and apply their findings and understandings to contemporary realities.', 'Bar-Ilan University is the fastest-growing institution of higher education in Israel. Those pursuing their BA, MA and PhD degrees on our award-winning campus just outside Tel Aviv and in our six regional colleges across Israel are joined by thousands more who are enrolled in certificate and enrichment programs, including the largest in-service teacher training program in Israel.', 'Prof. Pinkhos Churgin, one of the leading figures in the development of Yeshiva University in New York City and president of the \"Mizrachi\" movement in the USA, is the driving force behind the initiative to establish a university that combines Jewish values and academic excellence.\r\n Bar-Ilan University, named after Rabbi Meir Bar-Ilan (Berlin), a prominent religious Zionist leader, and head of the Mizrachi movement, is opened. The university\'s emblem is chosen as a combination of the Torah and a microscope, symbolizing the integration of the Jewish religion and science. Prof. Churgin serves as the university\'s founding presiden', 'Tradition of Excellence', 'www.biu.ac.il', null, null, '/uploads/2/eee.jpg', 'eee.jpg', '724', '2', '2016-11-16 04:36:46', '2016-11-16 04:36:46');
INSERT INTO university_infos VALUES ('67', 'Chiang Mai University', 'tefl@cmu.ac.th', '+66 53 941 000', 'อำเภอเมืองเชียงใหม่ Chiang Mai 50200, Thailand', '1. Provide higher education and high level professional education emphasizing academic excellence and quality of graduates with high moral and ethical standards under the Sufficiency Economy Philosophy.\r\n\r\n2. Conduct research in various fields to support standards of teaching, learning and technology transfer for the social and economic development of the region and the country.\r\n\r\n3. Provide academic services to the national community in line with the Sufficiency Economy Philosophy, particularly for Northern Thailand.\r\n\r\n4. Preserve and nurture our religious and cultural heritage, and develop the resources of the unique natural environment of Northern Thailand.\r\n\r\n5. Develop the Universitys administration systems and management under the Sufficiency Economy Philosophy while aiming at Sustainable Development.\r\n', 'Chiang Mai University  is a public research university in northern Thailand founded in 1964. It has a strong emphasis on engineering, science, agriculture, and medicine. Its instructional mission includes undergraduate, graduate, professional and continuing education offered through resident instruction. Its main campus lies between Chiang Mai downtown and Doi Suthep in Chiang Mai, Chiang Mai Province.', 'Chiang Mai University was founded in January 1964, under a Royal Charter granted by His Majesty King Bhumibol Adulyadej. \r\n\r\nCMU was the first institution of higher education in the north, and the first provincial university in Thailand. ', '(\"The wise control themselves\")', '	www.cmu.ac.th', null, null, '/uploads/2/cmu.png', 'cmu.png', '1323', '2', '2016-11-16 04:41:21', '2016-11-16 04:41:21');
INSERT INTO university_infos VALUES ('68', 'Northwestern Polytechnical University ', 'service@sicas.cn', '+86 29 8846 0206', '127 Youyi W Rd, Bian JiaCun ShangYe JieQu, Beilin Qu, Xian Shi, Shaanxi Sheng, China, 710000', 'Because of God\'s compelling love, we will teach wisdom and understanding to reach all nations for Christ.', ' About NPU\r\nOverview\r\nMessage from the President\r\nHistory\r\nCurrent Administrators\r\nNPU is classed as a key university in China’s 985 and 211 Projects\r\nOverview\r\n\r\nNPU is classed as a key university in China’s 985 and 211 Projects, and is affiliated to the Ministry of Industry and Information Technology. It is also a member of the “Excellent Union 9 (E9)” in China.\r\n\r\nOriginally founded as the State Northwest Polytechnic Institute in 1938, NPU has developed into an open and research-oriented University by bringing its founding spirit of inquiry and innovation into a wide-ranging curriculum that now includes the Humanities, Law, Management and Foreign Languages. And by incorporating three of China’s leading engineering schools， NPU has gained international recognition for its work in the fields of aeronautics, astronautics, and marine technology', 'NPU was originally established as the State Northwest Institute of Engineering in Hanzhong in 1938. The Institute was an amalgamation of Beiyang Institute of Engineering, the Engineering College of Peking University, the Engineering College of Northeast University and Jiaozuo Institute of Engineering. After eight years in Hanzhong, the Institute moved to Xianyang, and was renamed the Northwest Institute of Engineering in 1950.The Northwest Institute of Engineering moved to Xi’an in October 1957 where it merged with the Xi’an Institute of Aeronautics. The latter had been founded in 1952 as the East China Institute of Aeronautics amalgamating the Aeronautical Departments of Jiaotong University, Zhejiang University and Central University. In 1957 the Northwest Institute of Engineering was officially renamed Northwestern Polytechnical University. In 1970 the Department of Aeronautics of Harbin Institute of Engineering also amalgamated with NPU.', 'Loyalty, Integrity, Courage, and Perseverance', 'http://www.nwpu.edu.cn/', null, null, '/uploads/2/poly.jpg', 'poly.jpg', '5955', '2', '2016-11-16 04:46:52', '2016-11-16 04:46:52');
INSERT INTO university_infos VALUES ('69', 'University of Rostock', 'info.rih@uni-rostock.de', '+49 381 4980', '18051 Rostock, Germany', 'Tradition and innovation are the trademarks of our almost 600-year history. Today, with 2,200 employees and 15,000 students, the University of Rostock offers fascinating perspectives into nearly all scientific fields', 'The Hanseatic university city of Rostock is a great place to study, research and live. The economic and scientific centre of the North-East is very enticing, with all the atmosphere of a major city in the middle of one of the most beautiful tourist areas in Germany.', 'It was founded in 1419 by confirmation of Pope Martin V and thus is the oldest university in Northern Europe.\r\n\r\nIn Germany, there are only five universities that were founded before, while only Heidelberg and Leipzig operated continuously since then: Heidelberg (1386), Cologne (1388), Erfurt (1392/1994), Würzburg (1402/1582) and Leipzig (1409). That makes Rostock University the third oldest German university in continuous operation.\r\n\r\nThroughout the 15th century, the University of Rostock had about 400 to 500 students each year, a large number at that time. Rostock was among the largest universities in Germany at the time and many of its students also came from the Low Countries, Scandinavia or other states bordering the Baltic Sea.\r\n\r\nIn the course of political struggles and pressure from the church, the university moved to Greifswald in 1437 and remained there until 1443. From 1487 to 1488 teaching took place in Lübeck.\r\n\r\nA few years later the city of Rostock, its university also became Protestant in 1542. Humanism and Lutheranism were defining characteristics of the university. After the Thirty Years\' War (1618–1648), the University of Rostock played only a regional role. When the \"ownership\" of the university moved from the city to the state (Grand Duchy of Mecklenburg-Schwerin) in 1827, however, things changed for the better. The end of the 19th century saw generous building activity in Rostock\'s alma mater and the university soon regained its old reputation amongst German universities.', 'Tradition and Innovation', 'www.uni-rostock.de', null, null, '/uploads/2/rost.jpg', 'rost.jpg', '9942', '2', '2016-11-16 04:53:35', '2016-11-16 04:53:35');
INSERT INTO university_infos VALUES ('70', 'Yangzhou University', 'fao@yzu.edu.cn', '+8651487311374', '26 Xingcheng E Rd, Hanjiang Qu, Yangzhou Shi, Jiangsu Sheng, China, 225009', 'We see our job as building a bridge between cultures. Through this bridge, the faculties and students at YZU go out with global perspective. People outside China also come through this bridge to crack the mystery of oriental culture in China. The bridge will help to clear ignorance and get deeper understanding. All our efforts aim at strengthening, buttressing and extending the bridge cross cultures. We are always ready at service.', 'Yangzhou University (YZU) is co-sponsored by the People’s Government of Jiangsu Province and the Ministry of Education, a key comprehensive university of Jiangsu Province, as well as one of the first among colleges and universities authorized to grant master and doctoral degrees, pioneering in China in the merging of higher educational institutions. YZU was established in 1992 as a merger of 6 colleges in Yangzhou, while the history of YZU can be traced back to as early as 1902, when Mr. Zhang Jian, a renowned modern entrepreneur and educator, set up the Tongzhou Private Teachers’ School and Tonghai Agricultural School.', 'The history of Yangzhou University dates back to 1902 when Mr. Zhang Jian, famous industrialist and educator of modern China, established the Tongzhou Normal School, from which both the former Jiangsu Agricultural College and former Yangzhou Teachers’ College were later developed. In 1992, these two colleges merged with four other institutions of higher learning in Yangzhou to form Yangzhou University.\r\n\r\nBy 1992, all six of the colleges which were to become Yangzhou University, namely, Jiangsu Agricultural College, Yangzhou Teachers’ College, Yangzhou Institute of Technology, Yangzhou Medical College, Jiangsu Water Conservancy College and Jiangsu Commerce College, had over 40 years of experience in higher education.', 'Yangzhou University', '	www.yzu.edu.cn', null, null, '/uploads/2/yang.png', 'yang.png', '11646', '2', '2016-11-16 04:59:22', '2016-11-16 04:59:22');
INSERT INTO university_infos VALUES ('71', 'University of Essex', 'ralph@essex.ac.uk', '+44 1206 873333', 'Wivenhoe Park, Colchester CO4 3SQ, UK', 'The University has achieved a great deal over the last five years and in particular our research strength - capped by the award by Her Majesty The Queen of a Regius Professorship in Political Science in 2013 - is something we all take a great deal of pride in.\r\n\r\nHowever, the external environment has changed considerably, with the significant increase in student fees, the deregulation of undergraduate recruitment and greater competition for our fair share of talented students. Our new Strategic Plan therefore focuses on a very clear statement of our mission to contribute to society through excellence in education and excellence in research.', 'The University of Essex is a public research university in Colchester, Essex, England. It was established in 1963 and received its Royal Charter in 1965. The university\'s largest campus is located within Wivenhoe Park in the English county of Essex, less than a mile (1.6 km) from the town of Wivenhoe and two miles (3 km) from the town of Colchester. Apart from the Wivenhoe Park campus, there is a rapidly developing campus in Southend-on-Sea (Essex\'s largest town), and the East 15 Acting School is based in Loughton. The university\'s motto, Thought the harder, heart the keener, is adapted from the Anglo-Saxon poem The Battle of Maldon. The university enjoys collaborative partnerships with a number of institutions across the eastern region. These are University Campus Suffolk (now the University of Suffolk), Colchester Institute (University Campus Colchester), Kaplan Open Learning (KOL), South Essex College and Writtle College.', 'In our 50th anniversary year we are asking our students, alumni, staff and the wider community to help create a shared history of the University of Essex through our Memory Maps project. Full details will be available soon. We have created a University podcast series that celebrates Essex’s achievements and work over 50 years.', 'Thought the harder, heart the keener.', '	www.essex.ac.uk', null, null, '/uploads/2/essex_logo.jpg', 'essex_logo.jpg', '10614', '2', '2016-11-16 05:09:31', '2016-11-16 05:09:31');
INSERT INTO university_infos VALUES ('72', 'Medical University of Vienna', 'infopoint-meduni@meduniwien.ac.at', '+43 1 401600', 'Spitalgasse 23, 1090 Wien, Austria', '“As a Medical University, we espouse the three main tasks “Acquire, pass on and apply knowledge”. The innovations developed by our employees offer the conditions with which we can actively design the future of medicine.”', 'The Medical University of Vienna (MedUni Vienna for short) is one of the longest-standing medical training and research institutions in Europe. With almost 7500 students it is today the largest medical training facility in the German-speaking area. With its 27 university departments and three clinical institutes, 12 medical theory centers and numerous highly specialized laboratories, it is also one of the most important cutting-edge research institutions in the field of biomedicine.', 'As the founding member of the Alma mater Rudolfina (University of Vienna) founded in 1365, the medical faculty was already widely renowned in medieval times as an authority in medicine. Faculty records from as far back as 1399 document its mediation in disputes between barber surgeons, midwives, and local landowners. During the reign of Maria Theresia, Viennese medicine first attained international significance. The Habsburg Monarch summoned the Dutch physician, Gerard van Swieten, to Vienna. He in turn laid the foundation for the Vienna Medical School and paved the way for other leading figures. Anton de Haen, Maximilian Stoll, Lorenz Gasser, Anton von Störck, and the discoverer of the percussion technique, Leopold Auenbrugger, all taught and conducted research in the imperial city. Based on longstanding traditions, what now is referred to as \"bedside teaching\" also became the paradigmatic educational method during this period.', 'Medizinische Universität Wien', 'www.meduniwien.ac.at', null, null, '/uploads/2/medi.jpg', 'medi.jpg', '5175', '2', '2016-11-16 05:16:33', '2016-11-16 05:16:33');
INSERT INTO university_infos VALUES ('73', 'University of Tampere', 'vaihde@uta.fi', '+358 3 355111', 'Kalevantie 4, 33100 Tampere, Finland', 'Tampere University is at the leading edge of technological development and a sought-after collaboration partner among the scientific and business communities. The University produces skilful graduates to serve the needs of society', 'The University of Tampere (UTA) is a culturally-committed higher education institution with the social mission of educating visionaries who understand the world and change it. With its nine schools and some 15,000 degree students, UTA is one of the largest and most popular universities in Finland', 'The University of Tampere began in 1925 in Helsinki as an institution generally referred to as a Civic College. The guiding notion was that enlightenment was conducive to peaceful societal development. It was felt that large sectors of the population and especially young people in the rural areas were in need of enhanced popular education.\r\n\r\nIn the early years of its operations interest in the Civic College focussed increasingly on catering for the educational needs of the municipal administration and press. The major success areas, a qualification in social care and a qualification in librarianship, came into being in the 1940s.\r\n\r\nIn 1960 the institution moved to Tampere and within years the student intake increased fivefold and the former specialised college expanded into a multi-faculty university. The name was changed to the University of Tampere in 1966.', 'Universitas Tamperensis', '	www.uta.fi', null, null, '/uploads/2/fin.jpg', 'fin.jpg', '7457', '2', '2016-11-16 05:23:08', '2016-11-16 05:23:08');
INSERT INTO university_infos VALUES ('74', 'Aberystwyth University ', 'ccd@aber.ac.uk', '+44 1970 623111', 'Penglais Campus, Aberystwyth SY23 3FL, UK', 'We aim to be an approachable, responsive, flexible and agile department alert to technological developments as well as reacting to developments in higher education, legislative changes, research, scholarly publishing, and technology locally, nationally and internationally.', 'Aberystwyth University (Welsh: Prifysgol Aberystwyth) is a public research university located in Aberystwyth, Wales. Aberystwyth was a founding Member Institution of the former federal University of Wales. The University has almost 8,000 students studying across its six academic Institutes.', 'Founded in 1872 as University College Wales, Aberystwyth it became a founder member of the University of Wales in 1894 and changed its name to the University College of Wales, Aberystwyth. In the mid-1990s, the university again changed its name to the University of Wales, Aberystwyth. On 1 September 2007, the University of Wales ceased to be a federal university and Aberystwyth became independent again.', 'A world without knowledge is no world at all', 'www.aber.ac.uk', null, null, '/uploads/2/aber.png', 'aber.png', '14', '2', '2016-11-16 05:29:48', '2016-11-16 05:29:48');
INSERT INTO university_infos VALUES ('75', 'Thomas Jefferson University', 'Admissions@jefferson.edu', '+1 215-503-8890', '130 S 9th St, Philadelphia, PA 19107, USA', 'We are dedicated to the health sciences and committed to educating professionals, discovering new knowledge, and setting the standard for quality, compassionate and efficient patient care.', 'Thomas Jefferson University is a private health sciences university in Center City, Philadelphia, Pennsylvania in the United States. The university consists of six constituent colleges and schools, Sidney Kimmel Medical College, Jefferson College of Biomedical Sciences, Jefferson College of Health Professions, Jefferson College of Nursing, Jefferson College of Pharmacy, and Jefferson College of Population Health. In 2016, the Sidney Kimmel Medical College was ranked by U.S. News & World Report as tied for 56th place among research institutions and tied for 54th among primary care institutions', 'During the early 19th century, several attempts to create a second medical school in Philadelphia had been stymied, largely due to the efforts of University of Pennsylvania School of Medicine alumni. In an attempt to circumvent that opposition, a group of Philadelphia physicians led by Dr. George McClellan sent a letter to the trustees of Jefferson College in Canonsburg, Pennsylvania (now Washington & Jefferson College) in 1824, asking the College to establish a medical department in Philadelphia. The trustees agreed, establishing the Medical Department of Jefferson College in Philadelphia in 1825. In response to a second request, the Pennsylvania General Assembly granted an expansion of Jefferson College\'s charter in 1826, endorsing the creation of the new department and allowing it to grant medical degrees. An additional 10 Jefferson College trustees were appointed to supervise the new facility from Philadelphia, owing to the difficulty of managing a medical department on the other side of the state.Two years later, this second board was granted authority to manage the Medical Department, while the Jefferson College trustees maintained veto power for major decisions.', ' Jefferson', 'www.jefferson.edu', null, null, '/uploads/2/jeff.jpg', 'jeff.jpg', '7819', '2', '2016-11-16 05:40:53', '2016-11-16 05:40:53');
INSERT INTO university_infos VALUES ('76', 'Kaiserslautern University of Technology', 'info@uni-kl.de', '+49 631 2050', 'Erwin-Schrödinger-Straße 1, 67663 Kaiserslautern, Germany', 'guarantee practice-oriented training. In addition, the students profit from successful cooperation of the TU with renowned research facilities such as the German Research Centre for Artificial Intelligence, the Fraunhofer Institute for Experimental Software Engineering and Fraunhofer Institute for Industrial Mathematics ITWM, and the Max-Planck Institute for Software Systems.', 'The Technical University of Kaiserslautern (German Technische Universität Kaiserslautern or simply TU Kaiserslautern) is a research university in Kaiserslautern, Germany.\r\n\r\nThe University of Kaiserslautern has gained international reputation in research and teaching. It has a distinguished reputation in the fields of mathematics and computer science. In addition, students and (young) scientists benefit from the numerous internationally renowned research institutions, including three Fraunhofer Institutes ( IESE, ITWM, and IPM), the Max Planck Institute for Software Systems, the German Research Center for Artificial Intelligence (DFKI) , the Institute for composite materials (IVW), the Institute for technology and work (ITA), the Institute of biotechnology and drug research (IBWF) and the Institute for surface and Thin film analysis (IFOS), all of which cooperate closely with the university for applied research', 'The University of Kaiserslautern was founded on July 13, 1970. Earlier it was part of the twin University Trier/Kaiserslautern. In the winter semester 1970/1971 student and scientific activities started with the matriculation of 191 new students the faculties in Mathematics, Physics and Technology. In 1972 the set-up of the faculties Chemistry and Biology gave a boost to the extension of a scientifically specialized structure. At the same time the faculty of Technology was split into the faculties Mechanical Engineering and Electrotechnology, Architecture/Regional and Environmental Planning/Educational Sciences.', 'Technische Universität Kaiserslautern', 'www.uni-kl.de', null, null, '/uploads/2/kais.gif', 'kais.gif', '7538', '2', '2016-11-16 05:48:34', '2016-11-16 05:48:34');
INSERT INTO university_infos VALUES ('77', 'Alexandria University', 'v-presstd@alexu.edu.eg', '+20 3 5921675', 'El-Gaish Rd, Al Azaritah WA Ash Shatebi, Qesm Bab Sharqi, Alexandria Governorate, Egypt', 'Alexandria University as a pioneer and innovative institution provides an accessible, adaptable and challenging learning environment and to develop graduates and scientific research that are required to meet its local and international level needs. As an academic institution, Alexandria University considers the intellectual and personal growth of individual as a central goal. The university\'s programs are designed to achieve the expansion of perception, enrich knowledge, deepen understanding, create disciplined habits of thought and provide appropriate jobs for students, and thus help to build members have a sense of responsibility and productive citizens.\r\nIn addition to creativity and knowledge transfer and applying through teaching, research, and creative works, Alexandria University\'s mission is to contribute in the society by observation of education, learning and research at the highest international levels of excellence.', 'Alexandria University (Arabic: جامعة الإسكندرية‎‎) is a public research university in Alexandria, Egypt. It was established in 1938 as a satellite of Fuad University (the name of which was later changed to Cairo University), becoming an independent entity in 1942. It was known as Farouk University until the Egyptian Revolution of 1952 when its name was changed to the University of Alexandria. Taha Hussein was the founding rector of Alexandria University. It is now the second largest university in Egypt and has many affiliations to various universities for ongoing research.', 'In 1938, the nucleus of the Alexandria University (formerly known as Farouk University) had its beginning in the form of two faculties of Fouad the First University. These were the faculties of Arts and Law. The faculty of Engineering was then established in 1941.\r\n In the light of the need for developing more disciplines for higher learning and with a view towards meeting the need of the people of Alexandria, Alexandria University became a separate entity in August 1942 with four additional faculties: Science, Commerce, Medicine and Agriculture.', 'knowledge is wisdom', 'http://www.alexu.edu.eg/', null, null, '/uploads/2/alex.jpg', 'alex.jpg', '288', '2', '2016-11-16 10:59:41', '2016-11-16 10:59:41');
INSERT INTO university_infos VALUES ('78', '	Chung Ang University', 'tyche@cau.ac.kr', '+82 2-820-5114', '84 Heukseok-ro, Heukseok-dong, Dongjak-gu, Seoul, South Korea', 'As a major private institution, Chung-Ang University is fully committed to guiding its Korean and international students to envision their life goals and achieve their maximum potential in the increasingly competitive global society.', 'Chung-Ang University (also known as CAU; lit. Central University) is a private university based in Seoul. There are two different campuses.CAU is the first in South Korea to offer courses in Pharmacy, Business Management, Mass Communication, Advertising & Public Relations, Urban Planning and Real Estate, Energy System Engineering, Sociology, Psychology on the Seoul campus. Urban Planning and Real Estate and Energy System Engineering were newly established majors beginning in 2014. At the second campus, Ansung Campus, there are majors such as Creative Writing, Photography, and Drama & Film Studies, and is active in Pharmacy, Media and the Arts. There is also a major called City and Area Planning at the second campus.', 'Chung-Ang University began with the establishment of Chung-Ang Kindergarten as an annex to the Chung-Ang Methodist Church located in Insa-dong, Jongno-gu, Seoul, in April 1918.\r\n\r\nChung-Ang Kindergarten originated as a branch of Jungdong Church in 1916 and separated in 1918.\r\n\r\nIn 1922, the Japanese enacted legislation against kindergartens to restrict expansion, however, other kindergartens including Susong, Kyungsung and Taewha, and kindergartens in Gaesung and Pyongyang were founded by 1924', 'Live in Truth, Live for Justice', '	CAU.ac.kr', null, null, '/uploads/2/cau.jpg', 'cau.jpg', '1412', '2', '2016-11-16 11:05:33', '2016-11-16 11:05:33');
INSERT INTO university_infos VALUES ('79', 'University of Rennes', 'webmaster@esc-rennes.fr', '+33 2 23 23 36 36', ' Rue du Thabor, 35000 Rennes, France', 'There are currently about 26,000 students enrolled, with about 1,800 members of teaching staff and 1,700 other staff members employed by the university', 'The University of Rennes 1 is one of the two main universities in the city of Rennes, France. It is under the Academy of Rennes. It specializes in science, technology, law, economy, management and philosophy. The University of Rennes 1 has been in existence since 1969, but its heritage stems back to the days of the Breton university founded in 1461. There are currently about 26,000 students enrolled, with about 1,800 members of teaching staff and 1,700 other staff members employed by the university', 'In 1969, in order to enforce the growth of French universities, a law was passed, splitting the University of Rennes into two new entities. This new university took the name of \'University of Rennes 1\'', 'The will to progress, innovate, and undertake', 'www.univ-rennes1.fr', null, null, '/uploads/2/fra.png', 'fra.png', '10195', '2', '2016-11-16 11:16:18', '2016-11-16 11:16:18');
INSERT INTO university_infos VALUES ('80', 'Northern Arizona University', 'Marketing@nau.edu', '+1 928-523-9011', 'S San Francisco St, Flagstaff, AZ 86011, USA', 'We offer a rigorous, high-quality, and affordable education to all of our students. See the amazing differences that many of our graduates have made.', 'Northern Arizona University (NAU) is a public university located in Flagstaff, Arizona, United States. It is accredited by the Higher Learning Commission, and has 36 satellite campuses in the state of Arizona. The university offers both undergraduate and graduate degrees.', 'Northern Arizona University opened its doors in 1899 with 23 students, one professor, and two copies of Webster\'s International Dictionary bound in sheepskin. The first president scoured the countryside in horse and buggy seeking students to fill the classrooms of the single school building (now known as Old Main).\r\nSince those humble beginnings, the university has continued to grow, undergoing several name changes in accordance with expansions, added degree programs, and achieving university status', 'The Difference that Matters', 'www.nau.edu', null, null, '/uploads/2/goo.jpg', 'goo.jpg', '5928', '2', '2016-11-16 11:21:24', '2016-11-16 11:21:24');
INSERT INTO university_infos VALUES ('81', 'City University London', 'info@city.ac.uk', '+44 20 7040 5060', 'Northampton Square, London EC1V 0HB, UK', 'City, University of London: A leading global institution committed to academic excellence, focused on business and the professions and located in the heart of London. We are proud of the quality of our education, research and enterprise and are ranked within the top 4% of universities in the world.', 'City, University of London (formerly known as City University London until 2016 and commonly called City) is a public research university located in London, United Kingdom. It was founded in 1894 as the Northampton Institute and became a university when The City University, London was created by royal charter in 1966.The Inns of Court School of Law, which merged with City in 2001, was established in 1852, making it the former City University\'s oldest constituent part. On 1 September 2016, City joined the federal University of London, becoming part of the 18 Colleges and ten research institutes that make up the University.', 'City\'s tradition of providing high quality education relevant to business and the professions dates back 160 years. For many of our graduates, time spent at City laid the groundwork for leadership, innovation and excellence that have changed the world we live in', 'To Serve Mankind', 'www.city.ac.uk', null, null, '/uploads/2/city.jpg', 'city.jpg', '1428', '2', '2016-11-16 11:27:34', '2016-11-16 11:27:34');
INSERT INTO university_infos VALUES ('82', 'National Chengchi University', 'intladm@nccu.edu.tw', '+886 2 2939 3091', 'No. 64, Section 2, Zhinan Rd, Wenshan District, Taipei City, Taiwan 116', 'In the future, NCCU will pass on the outstanding traditions of humanities and social sciences, balancing both teaching and research, theory and practice, internationalization and domestication in academic disciplines including humanities, social sciences, law, business and communications, reinforce dialogues between humanities, technology and society, and promote multi-variant academic research development. Our vision is to build a first-rate international humanities and social sciences academic temple, and nurture “Humane, Global, Innovative” successors for the new century', 'National Chengchi University  is a national co-educational research university located in Taipei. The university was established in Nanjing in 1927, and relocated to Taipei in 1954. It is considered to be one of the most prestigious and important universities of Taiwan. The university, abbreviated as NCCU, specializes in arts and humanities, mass media, social sciences, management, politics, and international affairs programs. It is the only public university in Taiwan which provides courses in journalism, advertising, radio and television, diplomacy, and several languages which are not taught at other institutions. The name Chengchi  means governance or politics, and refers to its founding in 1927 as an incubator for senior civil service for the Nanjing Nationalist government of China.', 'The school was established in 1927 in Nanjing, which was the capital city of China, as the Kuomintang\'s Central School of Party Affairs. In 1929, it was renamed to Central School of Governance, after the Kuomintang reunified China in the Northern Expedition campaign. The school was built on the basis of National Central University in Nanjing, which was the highest academic institution of Republic of China. In 1946, it merged with the Central School of Cadre, which was founded in 1944 by the Youth Corps of Three People\'s Principles in Chongqing. The merged school was named the National Central University of Governance, based in Nanjing. When the Nationalist government lost control of mainland China in 1949, the university\'s activities were suspended.', 'Harmony, Independence, Balance, and Preeminence', 'www.nccu.edu.tw', null, null, '/uploads/2/chen.jpg', 'chen.jpg', '5590', '2', '2016-11-16 11:34:19', '2016-11-16 11:34:19');
INSERT INTO university_infos VALUES ('83', 'University of Cantabria', 'cci.info@gestion.unican.es', '+34 942 20 22 23', 'Av los Castros s/n, 39005 Santander, Cantabria, Spain', 'To coordinate and to organize the integrated efforts of all the private and public sectors of the Community, as well as of the university groups (academic staff, students, administrative staff), to stimulate areas of international excellence capable of contributing regional value across processes of training, research and transfer.', 'UC & Cantabria International Campus is based on the Knowledge Society Paradigm. The main idea of this concept is to create a state where rational messages are communicated and applied3. Consequently, a global network of human interactions, based on scientific culture4, will contribute to the development of communities.\r\nThis paradigm inspired the EU Lisbon Strategy Its main objective: is to become the most competitive and dynamic knowledge‐based economy in the world, with the ability to grow in a sustainable manner and with social cohesion.\r\nIn 2008, the European Council renewed its commitment by stressing the need to invest on people, on knowledge and on innovation. It is thus of crucial importance to promote the free circulation of knowledge by improving our education system. In other words, education must serve to consolidate a truly productive economy that also fosters civic and cultural development as well as individual creativity.', 'The institution was established as such on August 18, 1972, by decree of the Council of Ministers of Spain with the name of University of Santander. Thirteen years later renamed University of Cantabria. It was created by the affiliation of several schools and colleges that were already established either independently or under other universities since the following dates:\r\n\r\n1829: The School of Commerce and Navigation, currently School of Nautical Studies.\r\n1901: The School of Industries, the origin of which is the Polytechnic School of Industrial Engineering and Telecommunications.\r\n1915: The Normal School, which is the origin of the current Faculty of Education.\r\n1929: The Valdecilla Hospital School of Nurses, School of Nursing today.\r\nIn the 50s Torrelavega welcomes School of Mines and Mining-Metallurgical and Mining-Chemical Factories, which will become the School of Technical Mining Engineering.\r\n1966: School of Civil Engineering, under the University of Valladolid.\r\n1969: School of Social Graduate, then belonging to the University of Oviedo and origin of the Diploma in Labour Relations attached to the School of Law.\r\n1969: College of Sciences, initially only with the specialty of Physical and dependant of the University of Valladolid.', 'Cantabriae Universitas', '	http://www.unican.es', null, null, '/uploads/2/cant.jpg', 'cant.jpg', '8352', '2', '2016-11-16 11:39:46', '2016-11-16 11:39:46');
INSERT INTO university_infos VALUES ('84', '	Chonnam National University', 'underia3@jnu.ac.kr', '+82 62-530-5114', '77 Yongbong-ro, Yongbong-dong, Buk-gu, 광주광역시 South Korea', 'The founding idea of Chonnam National University is to foster future leaders of noble character as well as profound knowledge in professional fields and who will be able to contribute to the development of the nation and the world. \r\nThe motto of Chonnam National University is truth, creativity, and service. This motto is focused on the functions of university, i.e. pursuit of truth which is the fundamental responsibility of ivory tower, succession of traditional culture and creation of new culture, and provision of leading services to the development of the local community.', 'Chonnam National University is a South Korean university located in the metropolitan city of Gwangju which lies in the middle of South Jeolla or Jeonnam (Chonnam) province, for which the school is named in the Southwest of the country. The university was formally established in January, 1952 through the union of Gwangju Medical College, Gwangju Agricultural College, Mokpo Commerce College, and Daeseong College. It currently consists of 59 academic departments in 19 colleges and 11 graduate programs. University attached facilities are the University Library, Museum, Health Service Center, Agro-Bioindustry Technical Support Center, Animal Hospital, Language Education Center, School of Lifelong Education, and University Computing Center. In March 2006, Yeosu National University merged with Chonnam National University to become a satellite campus.', 'The Honam area has long cherished its tradition of valuing justice and showing respect to the elderly. On June 9, 1952, a national university, Chonnam National University (CNU), set sail at the center of the region on a long journey of fostering the next leaders of our society, and providing a cradle of creative studies to help lead the 21st century. The university emerged from the ashes of the Korean War with the support of local citizens who wanted to develop talented people. Technically, CNU has existed only about fifty years, but if we consider the schools that were united to create CNU, the university boasts more than 100 years of history.\r\nBefore CNU came into existence, Honam was home to several colleges and schools: Gwangju Agricultural College, for instance, which had been changed from Gwangju Agricultural School that was built in 1909; Provincial Mokpo Commercial College, which evolved from Mokpo Commercial School in 1920; Provincial Gwangju Medical College, which developed from Gwangju Medical Professional School in 1944; and Private Daesung College, which emerged from Daesung Boarding School in 1951. After independence from Japanese rule in 1945, the demand for competent, educated people escalated rapidly. Against this backdrop, local residents yearned to establish a systematic higher learning institute. Their efforts bore fruit on September 16, 1951, with the creation of the Supporting Association for Establishing Chonnam National University.\r\nThe Association started by raising funds. On October 6th, 1951, it acquired the right to authorize Chonnam National University. On January 1st, 1952, a university with five colleges Agricultural College, Commercial College, Humanities College, Medical College, and a newly opened Engineering College was established. The colleges already in existence changed from being separate schools to being under the wing of CNU. On June 1st, 1952, the appointment of Dr. Sang-chae Choi as the first president, as well as eight deans, superintendents, and a chief of the offices gave the CNU the structure and functions of a university. On June 9th, 1952, the citizens in Gwangju and students witnessed CNU\'s historic opening ceremony. When it first started, CNU consisted of the administration offices (Office of Student Affairs and a bureau), the five colleges mentioned above, and a medical graduate school, which was authorized in May 1950.', '(Truth, Creativity, Service)', 'http://global.jnu.ac.kr', null, null, '/uploads/2/Chonnam_uni_logo.gif', 'Chonnam_uni_logo.gif', '1384', '2', '2016-11-16 11:49:24', '2016-11-16 11:49:24');
INSERT INTO university_infos VALUES ('85', 'Braunschweig University of Technology', 'ub-leihstelle@tu-bs.de', '+49 531 3910', 'Pockelsstraße 14, 38106 Braunschweig, Germany', 'Today it has about 19,000 students, making it the third largest university in Lower Saxony after the University of Göttingen and the University of Hanover. Research projects include micro air vehicles, hybrid engines, and digital video broadcasting.', 'The TU Braunschweig (English: \"University of Brunswick – Institute of Technology\") is the oldest Technische Universität[de] (comparable to an institute of technology in the American system) in Germany. It was founded in 1745 as Collegium Carolinum[3] and is a member of TU9, an incorporated society of the most renowned and largest German institutes of technology. It is commonly ranked among the top universities for engineering in Germany', 'It was founded in 1745 as Collegium Carolinum and is a member of TU9, an incorporated society of the most renowned and largest German institutes of technology. ', 'Technische Universität Braunschweig', 'tu-braunschweig.de', null, null, '/uploads/2/bee.jpg', 'bee.jpg', '7529', '2', '2016-11-16 11:59:59', '2016-11-16 11:59:59');
INSERT INTO university_infos VALUES ('86', '	Rockefeller University', 'pubinfo@rockefeller.edu', '+1 212-327-8000', '1230 York Ave, New York, NY 10065, USA', 'In addition to the graduate program, there are other learning/training opportunities available, including postdoctoral research, fellowships for the Center for Studies in Physics and Biology and the Clinical Scholars Program, a master\'s degree for recent M.D. or M.D.-Ph.D. recipients to begin careers in patient-oriented research.', 'The Rockefeller University is a world-renowned center for research and graduate education in the biomedical sciences, chemistry, bioinformatics and physics. The university’s 79 laboratories conduct both clinical and basic research and study a diverse range of biological and biomedical problems with the mission of improving the understanding of life for the benefit of humanity.', 'The Rockefeller University was founded in 1901 by John D. Rockefeller Sr. as The Rockefeller Institute for Medical Research. The first institution in the United States devoted solely to using biomedical research to understand the underlying causes of disease, Rockefeller is today one of the foremost biomedical research centers in the world, and its scientists have made numerous seminal contributions to biology and medicine. Over the years, 24 scientists associated with the university have received Nobel Prizes and 21 have earned the Albert Lasker Medical Research Award. Fourteen Rockefeller scientists have received the Gairdner Foundation International Award and 20 have been given the National Medal of Science, the nation\'s highest scientific honor. In addition to a century of prize-winning breakthroughs, Rockefeller has devoted over half a century to training the next generation of innovative, pathbreaking scientists.\r\n\r\nJUMP TO: Evolution of Found', 'Science for the benefit of humanity', '	Rockefeller.edu', null, null, '/uploads/2/rocke.png', 'rocke.png', '7720', '2', '2016-11-16 12:11:38', '2016-11-16 12:11:38');
INSERT INTO university_infos VALUES ('87', 'Lille University of Science and Technology', 'scolarite@univ-lille1.fr', '+33 3 20 43 43 43', 'Bâtiment M2, Cité Scientifique, 59655 Villeneuve d\'Ascq, France', 'The University focuses on science and technology. Law, business management and medical fields are taught in the independent campus of Université de Lille II, while literature and social sciences are taught as part of the independent campus of Université de Lille III. Altogether, the three university campuses in Lille include more than 90,000 students and are the main parts of the Université Lille Nord de France.', 'Lille 1 is one of the leading science universities in France. Here you will be able to learn how to sharpen your critical thinking, a fundamental element in developing knowledge. You will also apprehend how to look at things from a different perspective, both academically and socially. Furthermore, you will become part of a particularly cosmopolitan French population situated less than 300 kilometres from five European countries. Make the most of your stay with us!', 'Lille1 University is a State University, founded in 1562 by the Spanish. It became French in 1667. Louis PASTEUR was the first Dean of the Science Faculty in 1854. Lille University was, at that time, situated in the town centre. In 1971, the Science Faculty and the different faculties in Lille moved to the new town of Villeneuve d’Ascq', 'Université de Lille I', 'http://www.univ-lille1.fr', null, null, '/uploads/2/lille.png', 'lille.png', '10293', '2', '2016-11-16 14:48:40', '2016-11-16 14:48:40');
INSERT INTO university_infos VALUES ('88', 'Heriot-Watt University', 'enquiries@hw.ac.uk', '+44 131 449 5111', 'Edinburgh Campus, Edinburgh EH14 4AS, UK', 'Heriot-Watt\'s vision is to be world-leading within all its specialist areas of science, technology, engineering and business.', 'Over 92% of our graduates are in full-time employment or further study within 6 months of graduation, with approximately 75% of those going straight into graduate-level jobs.', 'With a history dating back to 1821, we have a long and rich tradition of excellence and a proven track record of educating, inspiring and challenging the professionals of tomorrow', 'Heriot-Watt University', 'www.hw.ac.uk', null, null, '/uploads/2/watt.jpg', 'watt.jpg', '2900', '2', '2016-11-16 14:53:28', '2016-11-16 14:53:28');
INSERT INTO university_infos VALUES ('89', 'University of Denver', 'info@alumni.du.edu', '+1 303-871-2000', '2199 S University Blvd, Denver, CO 80208, USA', 'The mission of the University of Denver is to promote learning by engaging with students in advancing scholarly inquiry, cultivating critical and creative thought and generating knowledge. Our active partnerships with local and global communities contribute to a sustainable common good.', 'At the University of Denver, our culture is steeped in ethics and social responsibility. As a result, our faculty and students represent a wide array of perspectives and enjoy the healthy dialogue that grows out of diversity.\r\n\r\nFor all their differences, the members of our community are united by a common purpose: They\'re determined to confront society\'s most pressing challenges—everything from world health and the global economy to access to education.\r\n\r\nTo prepare our students for the challenges of productive citizenship, the University of Denver offers rigorous programs that emphasize critical thinking, creative problem solving and global experience. When you leave DU, you\'re ready to make a difference in your communities and in the world.', 'Founded in 1864—just a few years after the city of Denver itself was founded—the University of Denver is one of the country\'s premier private universities.', '(\'For Science and Religion\' or \'Knowledge and Spirit\')', 'http://www.du.edu/', null, null, '/uploads/2/den.png', 'den.png', '10582', '2', '2016-11-16 15:00:51', '2016-11-16 15:00:51');
INSERT INTO university_infos VALUES ('90', 'Federal Fluminense University', 'gpcaad@vm.uff.br', '+55 21 2629-5000', 'R. Miguel de Frias, 9 - Icaraí, Niterói - RJ, Brazil', 'The mission of UFF is to produce, disseminate and apply knowledge and culture critically and socially relevant. The institution has academic units in eight municipalities in the state of Rio de Janeiro. Today, the UFF consists of 40  teaching units and 23 institutes, 10 faculties, 6 schools and 1 college application', 'The institution has academic units in eight Municipalities in the state of Rio de Janeiro - Angra dos Reis (Institute of Education of Angra dos Reis); Campos dos Goytacazes (Institute of Science Society and Regional Development); Macaé (Institute of Society Sciences); Nova Friburgo (Health Institute of Nova Friburgo - ISNF); Petrópolis (Petrópolis School of Engineering); Rio das Ostras (Institute of Science and Technology); St. Anthony of Padua (Fluminense Northwest Institute of Higher Education - Infes) and Volta Redonda , where are the Institute of Human Sciences of Volta Redonda, the School of Industrial Engineering and Metallurgy (EEIMVR), and the Institute of Mathematical Sciences (ICEX) .', 'The context of the creation of the Federal University of the State of Rio de Janeiro, the initial name of the Fluminense Federal University, dating back to the effervescent and tumultuous 1950s, although the official date of its foundation is December 18, 1960, When the law was passed 3848, authored by Congressman John Baptist de Vasconcellos Torres.', 'to learn, to teach, to sow)', 'http://www.uff.br/', null, null, '/uploads/2/uff.jpg', 'uff.jpg', '9357', '2', '2016-11-16 15:07:50', '2016-11-16 15:07:50');
INSERT INTO university_infos VALUES ('91', 'Universität Mannheim', 'infocenter@rz.uni-mannheim.de', '+49 621 1812222', '68131 Mannheim, Germany', 'With its unique blend of renowned Economic and Social Sciences that are interwoven with excellent Humanities, Business, Law, Mathematics and Informatics, the University of Mannheim excels in both research and teaching. This interdisciplinary approach ensures long-term competitiveness of its researchers and graduates who are working in national and international enterprises or research centers. \r\n\r\nThe clear-cut portfolio of academic programs is one of the key features of the University of Mannheim, and as such, enhances the visibility of research and teaching.', 'The University of Mannheim is one of the leading research institutions in Germany. This has been confirmed by numerous rankings, awards, by surveys among employers and by the German Excellence Initiative. The Graduate School of Economic and Social Sciences (GESS) has been funded by the Excellence Initiative of the German Federal Ministry of Education and Research since the beginning in 2007. ', '\r\nThe University of Mannheim has always been home to excellent Social and Economic Sciences. The history of the university traces back to 1907, when Mannheim’s civil society fostered the foundation of Mannheim’s first School of Commerce (“Handelshochschule”). With the support of the Chamber of Commerce, the school developed to a flourishing center of higher education. Besides lectures in business administration, young salesmen attended lectures in philosophy, educational science, the arts and natural sciences. During the interwar period, new institutes of psychology and educational science have been founded.', 'Truth in everything should be the supreme law', 'http://www.uni-mannheim.de/1/', null, null, '/uploads/2/omn.jpg', 'omn.jpg', '9933', '2', '2016-11-16 15:26:51', '2016-11-16 15:26:51');
INSERT INTO university_infos VALUES ('92', 'National University of Colombia', 'peama_caribe@unal.edu.co', '+57 1 3165000', 'Cra 45, Bogotá, Colombia', 'The Universidad Nacional de Colombia promotes equal access to the Colombian education system; it provides the largest offering of academic programs and trains competent and socially responsible professionals.\r\n\r\nIt contributes to the development and re-significance of the Nation project; it studies and enriches the cultural, natural and environmental country\'s heritage. As it, assists to the scientific, technological, cultural and artistic order, with academic and research autonomy.', 'The Universidad Nacional de Colombia (English: National University of Colombia), is a public, national, coeducational, research university, located primarily in Bogotá, Medellín, Manizales and Palmira, Colombia. Established in 1867 by an act of the Congress of Colombia, the university is the largest higher education institution of the country with more than 44,000 students, the largest number of graduated professionals per year, and number of academic programmes at undergraduate and graduate levels, with 430 academic programmes, which includes 96 graduate diplomas, 67 Academic specializations, 39 medical specialties, 161 Master\'s degrees, and 58 doctorates. It is also one of the few universities that employs post-doctorate fellows in the country. Approximately 40,000 students are studying for an undergraduate degree and 4,000 for a graduate degree. The National University of Colombia is widely known as the best Colombian university, and one of the best universities in Latin america, for its high degree of education and research achievement in several rankings of universities in Latin America and around the globe', 'The idea of a public and state university, began to take shape shortly after the independence of our country.\r\n\r\nUnder the command of the vice-president of La Gran Colombia, General Santander, took place the organization of the Universidad Central de la República (with campuses in Bogota, Caracas and Quito), as the first legal-institution for a public University in Colombia. Towards 1830 it started to work with professors and students that kept alive the Botanical Experience.', 'Search for the truth among the rooms of the academy', 'http://unal.edu.co/', null, null, '/uploads/2/nacc.png', 'nacc.png', '8789', '2', '2016-11-16 15:40:39', '2016-11-16 15:40:39');
INSERT INTO university_infos VALUES ('93', 'University of Trier', 'presse@uni-trier.de', '+49 651 2010', 'Universitätsring 15, 54296 Trier, Germany', 'We consider it our  mission to develop general explanations in the form of models, concepts and theories and to assess their empirical Relvanz so they  our students  in the future professional practice, the  solution of various problems  allow in the different economic sectors.', 'Trier University is a young, dynamic university with a clear focus on training young academics. All departments are active in research and benefit from robust international networks.', 'Trier was founded March 16, 1473. Battling financial problems for decades, the university was acquired by the Jesuits in 1560. They emphasized the philosophical and theological faculties at the expense of medicine and law. In the 1580s Peter Binsfeld was president of the university. In the 1730s Johann Nikolaus von Hontheim was also a faculty member. After the French occupation of the Rhineland, the French administration ordered the universities of Cologne, Mainz, Bonn and Trier closed, the last closing on April 6, 1798.', 'S. Almi Studii Treverensis', 'https://www.uni-trier.de/index.php?id=48', null, null, '/uploads/2/comp.jpg', 'comp.jpg', '9948', '2', '2016-11-16 15:57:07', '2016-11-16 15:57:07');
INSERT INTO university_infos VALUES ('94', 'National Chung Cheng University', 'ciacoop@ccu.edu.tw', '+886 5 272 0411', 'No. 168, Section 1, Daxue Rd, Minxiong Township, Chiayi County, Taiwan 62102', 'Great mountains and vast oceans,\r\nLook around us, there’re plains of meadow green.\r\nWith words before actions that lead to righteousness,\r\nwe shall be elated with our aspiration.\r\nWith words before actions that lead to righteousness,\r\nwe shall be elated with our aspiration.\r\nResearch, instruction, and service – we accomplish our ideals,\r\nEthics, democracy, and science – we steer our goals.\r\nPursuing fame of the eternities, with altruism;\r\nWe shall model ourselves after the saints and sages!\r\nWe shall model ourselves after the saints and sages', 'National Chung Cheng University  is a public research university in Minxiong Township, Chiayi County, Taiwan. It is distinctive among universities in Taiwan in that it is dedicated to the core humanities and the basic sciences, both natural and social. In both quality and quantity of research it annually places among the top 5% of universities in Taiwan. Chung Cheng is among the four universities of Taiwan\'s Public Ivy - the Taiwan Comprehensive University System.', 'The first public University founded after Taiwan’s economic boom in the 1980′s, National Chung Cheng University broke ground after the Executive Yuan passed the plan to build the university in 1986 in honor of the late president CHIANG Kai-Shek and to develop higher education in the Yun-lin, Chia-yi, and Tainan areas. It was officially founded on July 1, 1989 with Dr. LIN Ching-Jiang being the first president of the University. During the early stage of the University, five colleges were set up: the College of Humanities, the College of Sciences, the College of Social Sciences, the College of Engineering, and the College of Management.', 'To innovate with earnestness; be virtuous with altruism', 'http://www.ccu.edu.tw/', null, null, '/uploads/2/ncc.gif', 'ncc.gif', '5595', '2', '2016-11-16 16:06:43', '2016-11-16 16:06:43');
INSERT INTO university_infos VALUES ('95', 'University of Western Sydney', 'study@westernsydney.edu.au', '+ 61 2 9852 5499', 'Milperra NSW, Australia', 'We want to give a new life and a new meaning in this new nation to the touchstone of modern democracy — to liberty, equality, fraternity.”', 'Western Sydney University, formerly the University of Western Sydney, is an Australian multi-campus university in the Greater Western region of Sydney. It is a provider of undergraduate, postgraduate and higher research degrees with campuses in Bankstown, Blacktown, Campbelltown, Hawkesbury, Parramatta, and Penrith. It is currently ranked in the top 400 in the world in the 2014 QS World University Rankings and 19th in Australia in 2015', 'The University consists of an amalgamation of campuses, each with their own unique and individual history. In 1891, the Hawkesbury campus was established as an agricultural college by the NSW Agricultural Society. At Parramatta, Western Sydney University owns and has renovated the Female Orphan School building, the foundation stone of which was laid by Governor Lachlan Macquarie in 1813.\r\n\r\nIn 1987 the New South Wales Labor government planned to name the university Chifley University, after the former Labor Prime Minister, Ben Chifley. However, in 1989, a new Liberal government reversed this decision and controversially named it the University of Western Sydney.\r\n\r\nIn 1989, teachers\' colleges and Colleges of Advanced Education in Sydney\'s western suburbs were given university status under the University of Western Sydney Act of 1988. The 1990s saw the federation of three education providers: UWS Nepean, UWS Hawkesbury and UWS Macarthur. 1989 was the year the Hawke federal labour government introduced HECS, the Higher Education Contribution Scheme. The University has a legislative basis in NSW state legislation with the passing of the University of Western Sydney Act (NSW) 1997, which also empowers the university to make by-laws affecting the operation of the university. In 2000, in order to reduce administrative expenses and duplication of courses offered by the inner Sydney universities and to eliminate competition between Western Sydney University member institutions, Western Sydney University became one multi-campus university.', 'western sydney university', '	www.westernsydney.edu.au', null, null, '/uploads/2/syd.png', 'syd.png', '11469', '2', '2016-11-16 16:16:12', '2016-11-16 16:16:12');
INSERT INTO university_infos VALUES ('96', 'South China Normal University ', 'cic5@scnu.edu.cn', '+86 20 8521 3863', '55 Zhongshan W Ave, TianHe GongYuan, Tianhe Qu, Guangzhou Shi, Guangdong Sheng, China, 510631', '80 years, the number of schools and easy school name, a few degrees of movement, despite vicissitudes, it is music never stopped. Generation after generation of Chinese people uphold the division reminiscent of Qin University Teachers College \"advanced academic research, to develop expertise of the community,\" the fine tradition Chengzhuan Nan West University \"unity and loyalty, simple open-minded, industrious and brave, realistic,\" the revolutionary spirit, practice \" hard work, rigorous scholarship, innovation, a model for others, \"the motto, arduous, Passing the torch, together we created today\'s prosperity and development of the school.  ', 'South China Normal University was founded in 1933 , the predecessor of the Guangdong Provincial Normal College reminiscent of Qin University. 1996 to enter the national \" 211 Project\" key construction college ranks, , 2015 to become the Guangdong Provincial Government and the Ministry of Education and the universities, the same year in Guangdong Province university level overall construction college ranks. Totally existing school, Foshan and Guangzhou University City 3 campuses, covers an area of 3025 mu, building area of 134 square meters, books 368 million copies.', 'South China Normal University, founded in 1933, its predecessor was Guangdong Provincial Teachers College reminiscent of Qin University, after several generations of Chinese people\'s construction division, has now become one including philosophy, economics, law, education, literature, history, science , wide engineering, agriculture, medicine, management, arts and other subjects, including a more complete and comprehensive teaching and research university.', 'Foster the spirit of working hard; Pursue studies with utmost rigour; Seek truth from facts to blaze new trails; And be a model of virtue for others.', 'http://www.scnu.edu.cn/', null, null, '/uploads/2/cheen.jpg', 'cheen.jpg', '7067', '2', '2016-11-16 16:22:25', '2016-11-16 16:22:25');
INSERT INTO university_infos VALUES ('97', 'Grenoble Institute of Technology', 'contact@grenoble-inp.fr', '+33 4 76 57 45 00', '46 Avenue Félix Viallet, 38000 Grenoble, France', 'Grenoble Institute of Technology\'s mission is to empower new generations of engineers to respond to global challenges in the fields of energy, the digital world, micro- and nanotechnologies, the environment, as industries of the future. For 120 years, Grenoble Institute of Technology has been instrumental in developping innovative solutions with industrial partners to support continuous technological advances and economic growth.', 'The Grenoble Institute of Technology (Grenoble INP) (Institut polytechnique de Grenoble, Groupe Grenoble INP and before INPG) is a French technological university system consisting of six engineering schools', 'Grenoble INP was born in the Alpine environment. It was officially founded in 1900 with the creation of the Electrical Engineering Institute. Industrial pioneers of a century ago found that after mastering hydraulic power and creating the initial industrial applications, they had also created a need for well-trained engineers.\r\n\r\nThe first of its type in France, Grenoble INP became polytechnical and grew continuously in scale, becoming the National Polytechnical Institute (INPG) in 1971 with Louis Néel, Nobel Laureate in Physics as its first President.\r\n\r\nGrenoble INP is currently contributing to the Minatec project, one of Europe\'s biggest nanosciences research center. Since December 2014, Grenoble Institute of Technology is member of the Community Grenoble Alpes University', 'Grenoble Institute of Technology', '	www.grenoble-inp.fr', null, null, '/uploads/2/gre.jpg', 'gre.jpg', '3460', '2', '2016-11-16 16:31:55', '2016-11-16 16:31:55');
INSERT INTO university_infos VALUES ('98', 'University of Debrecen', 'info@unideb.hu', '+965 504 05211', 'Debrecen, Egyetem tér 1, 4032 Hungary', 'The University of Debrecen in the mission statement of wishes to serve Hungary in accordance with the level of training for all citizens of the state while preserving the diversity, unity, systemic activity in the pre-primary to adult. The institution is committed outside of education, research, treatment and prevention activities and services in light of the agriculture sector in social and economic relations, and strengthening of higher education in third mission of fulfilling the tasks of cultural and sports facility. The focus of the activities of the University of Debrecen in the health industry as directed.', 'The University of Debrecen (Hungarian: Debreceni Egyetem) is a university located in Debrecen, Hungary. It is the oldest continuously operating institution of higher education in Hungary (since 1538). The university has a well established programme in the English language for international students, particularly in the Medical field, which first established education in English in 1986. There are nearly 4000 international students studying at the university.Until 2014 technical Academy Awards (Oscars) have been awarded to five former students.', 'The University of Debrecen - the country\'s oldest, continually operating institution of higher education - one of Hungary\'s flagship research universities, which provides the largest domestic training offer 14 faculties, 24 graduate schools of.', 'Universitas Debreceniensis', '	www.unideb.hu', null, null, '/uploads/2/debr.jpg', 'debr.jpg', '1671', '2', '2016-11-16 16:38:12', '2016-11-16 16:38:12');
INSERT INTO university_infos VALUES ('99', 'University of Szeged ', 'international@rekt.szte.hu', '+36 62 544 000', 'Szeged, Dugonics tér 13, 6720 Hungary', 'The University is one of Hungary\'s most important universities and is among the most prominent higher education institutions in Central Europe', 'The University of Szeged (Hungarian: Szegedi Tudományegyetem, About this sound listen (help·info)) is a large research university in Hungary. It is located in Hungary\'s third-largest city, Szeged, in Csongrád County in the Southern Great Plain. The University is one of Hungary\'s most important universities and is among the most prominent higher education institutions in Central Europe. According to the Academic Ranking of World Universities by Shanghai Jiao Tong University (2003, 2004, 2005), it was ranked 203rd–300th in the complete list (in a tie), 80th–123rd in the scientific ranking of European universities, and first in the Hungarian national ranking. In 2013 it was ranked 401-500 in the world, 124th–168th in the scientific ranking of European universities, and second in the national ranking. In 2014, the QS World University Rankings put the University of Szeged as 501-550 among universities globally. Its highest ranked area was Modern Languages with 101-150 globally. The University\'s operating budget for 2014 was US$220 million', 'The predecessor to the modern university was the University of Kolozsvár (University of today\'s Cluj-Napoca), founded in 1872 by Emperor Franz Joseph I., which had to move to Hungary after the Treaty of Trianon in 1921, and was restarted in Szeged', 'Truth – Bravery – Freedom and/or Where knowledge and challenge meet', 'www.u-szeged.hu', null, null, '/uploads/2/sze.jpg', 'sze.jpg', '7385', '2', '2016-11-16 16:45:44', '2016-11-16 16:45:44');
INSERT INTO university_infos VALUES ('100', 'Otto-von-Guericke University Magdeburg', 'akaa@ovgu.de', '+49 391 6701', 'Universitätspl. 2, 39106 Magdeburg, Germany', 'Otto von Guericke University Magdeburg has a distinctive profile. It aims to create a lean and sharply-defined structure with its main focus of expertise in the traditional areas of engineering, the natural sciences and medicine. It also views economics and management and the social sciences and humanities as essential disciplines for a modern university in the information age. The University sees its main task as raising the standard of education and scholarship through teaching and research. As the man from whom we take our name, we are indebted to Otto von Guericke. His name represents:\r\nthe application of scientific methods,\r\nthe quest for innovation and new knowledge, and\r\nthe assumption of social responsibility for today\'s and future generations.', 'The Otto-von-Guericke University Magdeburg ) was founded in 1993 and is one of the youngest universities in Germany. The university in Magdeburg has about 14,000 students in nine faculties. There are 11,700 papers published in international journals from this institute', ' it was founded in 1993 and is one of the youngest universities in Germany. It is named after the physicist (and mayor of Magdeburg) Otto von Guericke, famous for his experiments with the Magdeburg hemispheres.', 'Otto-von-Guericke-Universität Magdeburg, short OvGU', 'www.uni-magdeburg.de', null, null, '/uploads/2/mag.png', 'mag.png', '6215', '2', '2016-11-16 16:52:17', '2016-11-16 16:52:17');
INSERT INTO university_infos VALUES ('101', 'University of Girona', 'informacio@udg.edu', '+34 972 41 80 46', 'Plaça de Sant Domènec, 3, 17004 Girona, Spain', 'The Universitat de Girona is clearly committed to internationalisation and from this page places itself at the disposition of students and professors from around the world, offering programmes of study at different levels (Undergraduate, Master\'s and Doctoral), as well as its experience as a centre for research through its reseach groups and the Science and Technology Park. If you are international student or researcher, please visit our External Relations Office website, where you will find information regarding grants and financial support, acomodation etc.', 'The University of Girona is a public institution that seeks excellence in teaching and research, and participate in the progress and development of society through the creation, transmission, distribution and critical science, technology, humanities, social sciences and the arts. \r\nThe University of Girona is rooted in the country and Catalan culture is a major economic engine and cultural environment. At the same time, expresses the vocation of universality and openness to all traditions, cultures and developments. \r\nThe University has its headquarters in the city of Girona and integrated into the system of Catalan public universities.', 'The first modern reference of Universitat de Girona references to the Escola Normal de Mestres and, specially, the initiative during the 1960s decade to recover university level studies in Girona. During the 80s, the Col·legi Universitari de Girona and the Escola Politècnica Universitària de Girona were created, which depended on the already founded universities UAB and UPC, respectively. Later, the Estudi General was restarted, with the available studies of Humanities, Sciences, Economics and Social science. Finally, on 12 December 1991, the Catalan Parliament created the new and current Universitat de Girona', 'Universitat de Girona', 'http://www.udg.edu/', null, null, '/uploads/2/udg.jpg', 'udg.jpg', '9904', '2', '2016-11-16 16:58:41', '2016-11-16 16:58:41');
INSERT INTO university_infos VALUES ('102', 'National University of Malaysia', 'pkk@ukm.edu.my', '+60 3-8921 5555', 'Kampung Bangi, 43600 Bangi, Selangor, Malaysia', 'Universiti Kebangsaan Malaysia is one of five research universities in the country. It was ranked number 259th in the world by QS World University Rankings in 2014. It is ranked 98th place in the 100 best new universities established within the last 50 years in the world. It is the only university from Malaysia that made it in the 2012 Quacquarelli Symonds (QS) Top 50 Universities Under 50 Years Old list ranked in the 31st place. It placed 56th and 56th in the QS Top 500 Asian University Rankings in 2014 and 2015 respectively.', 'The National University of Malaysia (abbreviation: UKM; Malay: Universiti Kebangsaan Malaysia; abbreviated UKM is a public university located in Bangi, Selangor which is about 35 kilometres (22 mi) south of Kuala Lumpur. Its teaching hospital, Universiti Kebangsaan Malaysia Medical Centre (UKMMC) Pusat Perubatan Universiti Kebangsaan Malaysia (PPUKM) is located in Cheras and also has a branch campus in Kuala Lumpur. There are 17,500 undergraduate students enrolled, and 5,105 postgraduate students of which 1,368 are foreign students from 35 countries', 'Universiti Kebangsaan Malaysia, the national university of Malaysia was born from the aspirations of the nationalists to uphold the Malay Language as a language of knowledge. The quest for a national university was suggested in 1923 by the writer Abdul Kadir Adabi as a move against British colonisation. This nationalist tide galvanised Malay intellectuals of the time but met British suppression. The nationalists never wavered and in 1969 the movement again blossomed. A Sponsoring Committee chaired by Syed Nasir Ismail, a Malay intellectual, was set up to prepare a report recommending the establishment of UKM. Other prominent members of this committee include Dr. Mahathir Mohamed (Tun), Malaysia\'s fourth Prime Minister who was then the Education Minister, and Dr. Mohd Rashdan Haji Baba, who later became UKM\'s first Vice-Chancellor.', 'Inspiring Futures, Nurturing Possibilities', 'http://www.ukm.my/', null, null, '/uploads/2/ukm.png', 'ukm.png', '10403', '2', '2016-11-16 17:03:35', '2016-11-16 17:03:35');
INSERT INTO university_infos VALUES ('103', 'University of Valladolid', 'admon.secretaria.general@uva.es', '+34 983 42 30 00', ' C/Plaza de Santa Cruz, 8, 47002 Valladolid, Spain', 'Internationalization is one of the key objectives of the University of Valladolid. Therefore, the International Relations Office of the UVa has been organizing student mobility since 1987 within the framework of the ERASMUS and other Programmes through wich over 2.000 students are sent and received annually. ', 'The University of Valladolid is a public university in the city of Valladolid, province of Valladolid, in the autonomous region of Castile and Leon, Spain. Established in the 13th century, it is one of the oldest universities in the world. The university has 32,000 undergraduate students and more than 2,000 teachers.', 'The University of Valladolid (UVa) is a Spanish public university founded in 1241 as removal of studies at the University of Palencia, founded by Alfonso VIII of Castile, between 1208 and 1212. It is responsible for teaching higher education in seven campuses distributed through four cities of Castile and Leon: Valladolid, Palencia, Soria and Segovia.', 'Knowledge built its house', 'http://www.uva.es/', null, null, '/uploads/2/uva.jpg', 'uva.jpg', '8502', '2', '2016-11-17 02:44:27', '2016-11-17 02:44:27');
INSERT INTO university_infos VALUES ('104', 'University of Toledo', 'webmaster@utoledo.edu', '+1 800-586-5336', '2801 W Bancroft St, Toledo, OH 43606, USA', 'The mission of The University of Toledo is to improve the human condition; to advance knowledge through excellence in learning, discovery and engagement; and to serve as a diverse, student-centered public metropolitan research university.', 'We are The University of Toledo, a student-centered, public metropolitan research university with 23,000 students and picturesque campuses recognized nationally for their beauty.\r\n\r\nThe University of Toledo is one of 14 state universities in Ohio. We were established in 1872 and became a member of the state university system in 1967. The University of Toledo and the Medical University of Ohio merged July 2006 to form the third-largest public university operating budget in the state. The University is accredited by The Higher Learning Commission.', 'The University of Toledo and the Medical University of Ohio merged July 1, 2006, to form the third-largest public university operating budget in the state.\r\n\r\nHouse Bill 478 was signed on March 31, 2006, by Gov. Bob Taft, creating a university built around eleven academic colleges and professional programs matched only by a handful of public universities nationwide, including Ohio State University and the University of Michigan.\r\n\r\nUT\'s main campus, located along the banks of the Ottawa River in a residential section of the city, includes historic buildings, modern facilities, contemporary residence halls and lots of green space.\r\n\r\nThe University of Toledo Health Science Campus is home to UT Medical Center hospitals and clinics and many of UT\'s health-science research and education programs that are teaching the next generation of physicians, nurses and other health care professionals.', 'Guide to the Present, Moulder of the Future', 'http://www.utoledo.edu/', null, null, '/uploads/2/ut.jpg', 'ut.jpg', '11012', '2', '2016-11-17 03:39:20', '2016-11-17 03:39:20');
INSERT INTO university_infos VALUES ('105', 'University of Greifswald', 'pressoffice@uni-greifswald.de', '+49 3834 860', 'Domstraße 11, 17489 Greifswald, Germany', 'In research and teaching, the University is committed to freedom and autonomy of thought. Research, teaching and studying consider it to be a unity, which is also to be cultivated and developed in a cooperation of the individual scientific disciplines. Aware of its long tradition and social, economic and cultural responsibility, the university is constantly striving to develop new scientific concepts and teaching methods and to transfer its work results into concrete fields of application.', 'The Ernst Moritz Arndt University of Greifswald is one of the oldest academic educational centers in Germany and the Baltic Sea. Founded in 1456, it is also the oldest Swedish university since the region was under Swedish rule until 1815 after the end of the 30 years\' war.', 'The University of Greifswald was founded on 17 October 1456 with the approval of the Holy Roman Empire and the Pope. This was possible due to the great commitment of Greifswald\'s lord mayor, Heinrich Rubenow, who was also to become the university\'s first rector, with the support of Duke Wartislaw IX of Pomerania and Bishop Henning Iven of the local St Nicolas\' Cathedral. The founding took place in the local cathedral, which was later remodeled by Caspar David Friedrich and his brother and can still be visited today. The founding of the university was made possible by a decree that restricted teaching activity at the University of Rostock (founded 1419). Several professors left Rostock for Greifswald to continue their work there, where Heinrich Rubenow took the chance of establishing his own university. Originally, the university consisted of the four traditional divisions: Theology, Philosophy, Medicine and Law.', 'Lange Tradition. Kurze Wege. Weiter Blick', 'www.uni-greifswald.de', null, null, '/uploads/2/ern.jpg', 'ern.jpg', '2095', '2', '2016-11-17 03:45:09', '2016-11-17 03:45:09');
INSERT INTO university_infos VALUES ('106', 'University of Akron', 'transfer@uakron.edu', '+1 330-972-7111', '302 E Buchtel Ave, Akron, OH 44325, USA', 'UA brings together diverse disciplines in ways that provide students with life-long skills, internships and co-ops, opportunities for academic research, study abroad, on-campus student employment and service projects designed for diverse groups of learners, including full-time, part-time and online students, veterans, and adults returning to the classroom.', 'The University of Akron is the region’s most influential public research university, contributing to the resurgence of the local economy, providing a workforce highly trained in diverse disciplines, and known for an innovative approach to higher education.', 'The institution now known as The University of Akron was founded as Buchtel College in 1870 by the Ohio Universalist Convention, which was strongly influenced by the efforts, energy and financial support of Akronites, particularly industrialist John R. Buchtel.', 'Let there be light', 'http://www.uakron.edu/', null, null, '/uploads/2/ua.jpg', 'ua.jpg', '10462', '2', '2016-11-17 03:50:11', '2016-11-17 03:50:11');
INSERT INTO university_infos VALUES ('107', 'University of Los Andes', 'mba@uniandes.edu.co', '+57 1 3394949', 'Cra. 1 #18a12, Bogotá, Colombia', 'Universidad de los Andes is an autonomous, independent and innovative institution that fosters pluralism, tolerance and respect for ideas; seeking academic excellence and gives its students a critical and ethical training to strengthen their awareness of their social and civic responsibilities and its commitment to the environment.\r\n\r\nHas students in an environment of comprehensive, interdisciplinary and flexible training, are the main agent of the educational process. Facilitates its highly trained teaching staff develop draft outstanding academic and professional life, for which supports research activities contributing to the development of the country and its international projection.', 'The University of los Andes (Spanish: Universidad de los Andes), also commonly self-styled as Uniandes, is a private research university located in the city centre of Bogotá, Colombia. Founded in 1948 by a group of Colombian intellectuals led by Mario Laserna Pinzón, it was the first Colombian university established as nonsectarian (independent from any political party or religious institution). Uniandes has traditionally educated the Latin American academic elite, and is broadly considered to be one of the best universities in this region.', 'Founded on November 16, 1948 by a group of young people led by Mario Laserna Pinzón, the University of the Andes is the first institution of private higher education in Colombia secular and independent of political parties, oblivious to defend the interests of some social or economic group.\r\n\r\nIndeed, these characteristics made an educational project Los Andes edge at a historic moment in the country in which private universities had in their classrooms the influence of partisan struggle', 'Universidad de los Andes', 'http://www.uniandes.edu.co/', null, null, '/uploads/2/los.gif', 'los.gif', '8446', '2', '2016-11-17 04:00:17', '2016-11-17 04:00:17');
INSERT INTO university_infos VALUES ('108', 'Rovira i Virgili University', 'info@urv.cat', '+34 977 55 80 00', ' Carrer de l`Escorxador, s/n, 43003 Tarragona, Spain', 'The University is a teaching and research institution with centres in Tarragona, Reus, Vila-seca, Tortosa and El Vendrell.', 'The URV was created in 1991 by the Parliament of Catalonia from the already existing university faculties and schools. In this way the Tarragona University of the 16th century was restored. From the very first day its aim has been very clear: to place knowledge at the service of society so as to contribute to the social and economic development of its environment, which has gradually transformed over time.', 'University education in the Tarragona area goes back to the 16th century when Cardinal Gaspar Cervantes de Gatea founded a university in the city of Tarragona to teach Grammar, the Arts and Theology. This Universitas Tarraconensis was practically wiped out by the reprisals of Philip V after the War of Succession. One school did remain, however: the Estudi Literari, which depended on the new University of Cervera until the middle of the 19th century when university education was discontinued. Only the Escola de Mestres (the Teacher Training School), which had been founded shortly before, was to survive and it continued to provide non-university education until it became a part of the University in 1972.\r\n\r\nFrom the end of the 19th century to the 1930s, the Ecclesiastical University in Tarragona taught further education courses in Philosophy, Theology and Canon Law.', '(for wisdom free, for freedom wise)', 'http://www.urv.cat/en/', null, null, '/uploads/2/vir.png', 'vir.png', '9943', '2', '2016-11-17 13:02:32', '2016-11-17 13:02:32');
INSERT INTO university_infos VALUES ('109', 'Boğaziçi University', 'info@boun.edu.tr', '+90 212 359 54 00', 'Bebek, 34342 Beşiktaş/İstanbul, Turkey', 'Boğaziçi University’s mission is to educate individuals who embrace it’s institutional values, who are able to think both creatively and critically, who are independent and egalitarian, who appreciate ethical values, who respect nature and are aware of environmental issues, who are rooted in the local and open to the global, and who can, with their self-confidence and scholarly, social and cultural foundations, successfully take on leadership positions anywhere in the world.\r\n\r\nBoğaziçi University’s mission also encompasses producing universal thought, science, and technology in service of humanity, and playing a pioneering role in encouraging the spread of science, culture, and the arts throughout society.', 'Boğaziçi University  is a major research university located on the European side of the Bosphorus strait in Istanbul, Turkey. It has four faculties and two schools offering undergraduate degrees, and six institutes offering graduate degrees. The language of instruction is English.', 'Robert College was founded in Istanbul,Turkey, by Dr.Cyrus Hamlin,an educator, inventor, technician, architect and builder, and Mr. Christopher Rheinlander Robert, a well-known philanthropist and a wealthy merchant from New York.', 'Boğaziçi University', 'http://www.boun.edu.tr/', null, null, '/uploads/2/boga.jpg', 'boga.jpg', '938', '2', '2016-11-17 13:15:13', '2016-11-17 13:15:13');
INSERT INTO university_infos VALUES ('110', 'University of Waikato', 'help@waikato.ac.nz', '+64 7-856 2889', 'Hillcrest, Hamilton 3216, New Zealand', 'The University Council works with Te Rōpū Manukura, made up of representatives of the 16 iwi (Māori tribal) authorities in the University’s catchment area. Te Rōpū Manukura is the Kaitiaki (guardian) of the Treaty of Waitangi for the University of Waikato, and acts to ensure that the University works in partnership with iwi to meet tertiary needs and aspirations of Māori communities.', 'This University is committed to delivering a world-class education and research portfolio, providing a full and dynamic university experience, distinctive in character, and pursuing strong international links to advance knowledge.', 'The University of Waikato owes its existence to a determined group of Hamilton locals, who in 1956 launched a petition for a university to serve the needs of the South Auckland region. The group was led by Douglas Seymour, a barrister, and subsequently Anthony \"Rufus\" Rogers, a Hamilton GP and brother to long-time Mayor of Hamilton, Denis Rogers', 'For The People', 'http://www.waikato.ac.nz/', null, null, '/uploads/2/tan.png', 'tan.png', '11036', '2', '2016-11-17 13:21:09', '2016-11-17 13:21:09');
INSERT INTO university_infos VALUES ('111', 'University of Oldenburg', 'internet@uni-oldenburg.de', '+49 441 7980', 'Ammerländer Heerstraße 114, 26129 Oldenburg, Germany', 'The University of Oldenburg is preparing  over 13,700 students for professional life. It offers a broad range of disciplines, from language studies, cultural studies and the humanities to educational sciences, art and musicology, the economic and social sciences, mathematics, computer science, the natural sciences and the new medicine and health science programmes established in 2012.', 'The pathways on the Oldenburg campus are short: the University‘s academic staff and administrative staff work closely together, using an interdisciplinary approach. Many are integrated into special research areas, research groups and European clusters of excellence.', 'The Carl von Ossietzky University of Oldenburg was founded in 1973, making it one of Germany‘s young universities. Its goal is to find answers to the major challenges society faces in the 21st century – through interdisciplinary, cuttingedge research.', 'Open for new ways', 'https://www.uni-oldenburg.de/', null, null, '/uploads/2/carl.jpg', 'carl.jpg', '1132', '2', '2016-11-17 14:04:47', '2016-11-17 14:04:47');
INSERT INTO university_infos VALUES ('112', 'University of New Brunswick', 'int-unbf@unb.ca', '+1 506-453-4666', '3 Bailey Dr, Fredericton, NB E3B 5A3, Canada', 'Our mission is to create the premier university environment for our students, faculty and staff in which to learn, work and live.\r\n\r\nWe will provide an exceptional and transformative education for our students, by encouraging initiative and innovation, unlocking their creative potential. Our graduates will be prepared to make a significant difference - creating opportunities for themselves and for others.', 'UNB has among the best student-to-faculty ratios of Canada’s comprehensive universities. We offer world-class programs with a small-university experience', 'UNB began with a petition presented to Governor Thomas Carleton on Dec. 13, 1785. Headed by William Paine, the seven memorialists asked Carleton to grant a charter of incorporation for an \"academy or school of liberal arts and sciences,\" which they maintained would result in many \"public advantages and conveniences.\"', 'Dare to be Wise', 'http://www.unb.ca/', null, null, '/uploads/2/unb.jpg', 'unb.jpg', '10823', '2', '2016-11-17 14:10:33', '2016-11-17 14:10:33');
INSERT INTO university_infos VALUES ('113', 'University of Calabria', 'international@unical.it', '(+39) 0984 4911', 'Via Pietro Bucci, 87036 Arcavacata, Rende CS, ItalyUniversity of Calabria', 'Our mission is to work alongside university researchers, businesses and stakeholders in general research and technology transfer operating in Calabria and Italy with the aim to support:\r\n\r\nthe financing of scientific research;\r\nthe promotion of scientific research;\r\nlaunching partnerships  technological', 'The University of Calabria  is a state-run university in Italy. Located in Arcavacata, a hamlet of Rende in the suburb of Cosenza, the university was founded in 1972. Among its founders there were Beniamino Andreatta, Giorgio Gagliani, Pietro Bucci and Paolo Sylos Labini. It currently has about 35,000 students, 800 teaching and research staff and about 700 administrative staff.', 'The Campus of the University of Calabria was originally designed by Vittorio Gregotti and Dänen Martensson.', 'on yous side', 'www.unical.it', null, null, '/uploads/2/goog.jpg', 'goog.jpg', '9478', '2', '2016-11-17 14:25:24', '2016-11-17 14:25:24');
INSERT INTO university_infos VALUES ('114', 'University of Kassel', 'studieren@uni-kassel.de', '+49 561 8040', ' Mönchebergstraße 19, 34125 Kassel, Germany', 'The University of Kassel, founded in 1971 as an independent, full-time college model in the course of the reforms of education, is characterized by an unusually complex network of competences that focus on nature, technology, culture and society', 'The University of Kassel  is a university founded in 1971 located in Kassel, Hesse, in Germany. As of October 2013 it had about 23,000 students and more than 2,600 staff, including 307 professors.\r\n\r\nInternational summer universities, intensive German language courses and orientation programmes for international students and students come from over 115 countries.\r\n\r\nEach academic year, more than 100 visiting scholars pursue research projects in cooperation with colleagues from the University of Kassel, making a valuable contribution to the academic and cultural life. The newly established International House is located on the campus. It offers hostels for international guests and is available for meetings, conferences, and cultural events.', 'Founded in 1971 as a reform college, numerous innovative concepts for practice-oriented learning and research, interdisciplinary work, were developed at the Kassel University. The examination of current social challenges has been a hallmark of our university since then. The university is still young, but it can rely on numerous academic predecessors', 'Universität Kassel', 'http://www.uni-kassel.de/uni/', null, null, '/uploads/2/kass.jpg', 'kass.jpg', '9927', '2', '2016-11-17 14:30:44', '2016-11-17 14:30:44');
INSERT INTO university_infos VALUES ('115', 'University of Windsor', 'hr@uwindsor.ca', '+1 519-253-3000', ' 401 Sunset Ave, Windsor, ON N9B 3P4, Canada', 'Enabling people to make a better world through education, scholarship, research and engagement.', 'The University of Windsor (U of W or UWindsor) is a public comprehensive and research university in Windsor, Ontario, Canada. It is Canada\'s southernmost university. It has a student population of approximately 15,000 full-time and part-time undergraduate students and over 1000 graduate students. The University of Windsor has graduated more than 100,000 alumni since its founding', 'The story of our university began with its founding in September of 1857, when the first students arrived to study at its predecessor, Assumption College.\r\n\r\nIn the more than 150 years that have since past, the small, liberal arts college has grown into today\'s non-denominational, comprehensive, teaching and learning university. More than 16,000 students attend the University of Windsor today and its alumni family is more than 100,000 strong.', ' Goodness, discipline, knowledge', 'http://www.uwindsor.ca/', null, null, '/uploads/2/sor.jpg', 'sor.jpg', '11049', '2', '2016-11-17 14:35:24', '2016-11-17 14:35:24');
INSERT INTO university_infos VALUES ('116', 'Bangor University', 'marketing@bangor.ac.uk', '+44 1248 351151', 'Bangor LL57 2DG, UK', 'A strong, confident institution recognised regionally, nationally and internationally as a centre of excellence for its varied portfolio of teaching and research, and for the unique, multicultural, inclusive experience it provides for its staff and students.', 'Bangor University  is a Welsh university in the city of Bangor in the county of Gwynedd in North Wales. It received its Royal Charter in 1885 and was one of the founding member institutions of the former federal University of Wales. It was officially known for most of its history as the University College of North Wales (UCNW), and later as the University of Wales, Bangor . From September 2007 it became known as Bangor University, having become independent from the federal University of Wales', 'The University was founded as a direct result of a campaign in the late nineteenth century for higher education provision in Wales . Funds were raised by public subscription to establish a college of university rank in Bangor . An important feature of its foundation was the voluntary contributions made by local people, including farmers and quarrymen, from their weekly wages over a period of time.', 'The Best Gift is Knowledge\"', 'https://www.bangor.ac.uk/', null, null, '/uploads/2/ban.jpg', 'ban.jpg', '711', '2', '2016-11-17 14:41:18', '2016-11-17 14:41:18');
INSERT INTO university_infos VALUES ('117', 'Nanjing Medical University ', 'service@cucas.cn', '+86 25 8686 2618', '140 Hanzhong Rd, Gulou Qu, Nanjing Shi, Jiangsu Sheng, China, 210029', 'NMU expects its teachers and students to function with erudition and morality, so that they not only make achievements in the field of academics but also seek the beauty of morality. That is, students will be good both in character and at studies, and teachers will have an excellent reputation and outstanding skills. Excellence and perfection are the targets of erudition and morality, which encourage both teachers and students to set high demands on themselves and relentlessly pursue excellence', 'Nanjing Medical University was founded in 1934 as Jiangsu Provincial College of Health Policy and Management. In the year of 1957, it moved from Zhenjiang to Nanjing and changed its name to Nanjing Medical College. In 1962, it became one of the first groups of medical colleges in China to offer six-year medical programs, and in 1981, it was approved to award master and doctoral degrees.In 1993, it was renamed as Nanjing Medical University and is one of the key universities sponsored by Jiangsu Province. In September 2015, NMU has been approved to be one of the first groups of medical universities which are co-sponsored by the Ministry of Education, National Health and Family Planning Commission of the People’s Republic of China and Jiangsu Provincial People’s government.\r\n', '.Nanjing Medical University was founded in 1934. It was then known as Jiangsu Provincial College of Health Policy and Management and its first president was Mr. Chen Guofu. In 1938 the college was renamed National Jiangsu Medical College. In 1957 the college was moved from Zhenjiang to Nanjing and renamed Nanjing Medical College. In 1962 it became one of the first medical colleges in China that offered six-year medical education programs. In 1981 the college was approved to confer doctoral and master\'s degrees. In 1993 the college was renamed Nanjing Medical University. Today it is a key university of Jiangsu ', '南京医科大学', 'http://www.njmu.edu.cn/', null, null, '/uploads/2/nmu.jpg', 'nmu.jpg', '5545', '2', '2016-11-17 14:46:52', '2016-11-17 14:46:52');
INSERT INTO university_infos VALUES ('118', 'Paul Sabatier University', 'info@univ-tlse3.fr', '+33 5 61 55 66 11', ' 118 Route de Narbonne, 31062 Toulouse, France', 'Our ambition is clear: to offer you various successful path for you to choose your path and your future. At the Université Toulouse III - Paul Sabatier, all offered are backed by the world of research and taught by research professors and senior researchers. Whatever training you choose, basic training or training in engineering, short curricula type Professional license or doctoral program, our university is to serve your ambition, academic and professional, and the extent of your talents. We are here to help you succeed. ', 'Paul Sabatier University  is a French university, in the Academy of Toulouse.', '\r\nFounded in 1229, the University of Toulouse is one of the oldest in Europe', 'Les sciences au coeur', 'http://www.univ-tlse3.fr/', null, null, '/uploads/2/baba.jpg', 'baba.jpg', '10350', '2', '2016-11-17 14:54:34', '2016-11-17 14:54:34');
INSERT INTO university_infos VALUES ('119', 'New Jersey Institute of Technology', 'graduatestudies@njit.edu', '+1 973-596-3000', '323 Dr Martin Luther King Jr Blvd, Newark, NJ 07102, USA', 'A preeminent engineering, design, science and technology university known for research and education fostering innovation, entrepreneurship, and engagement.', 'The New Jersey Institute of Technology (NJIT) is a public research university in the University Heights neighborhood of Newark, New Jersey. NJIT is New Jersey\'s Science & Technology University. Centrally located in the New York metropolitan area its campus is within walking distance of downtown Newark. New York City, 9 miles (14.5 km) and under 30 minutes away, is directly accessible from campus via public transit', 'On March 24, 1880, the Essex County Assemblyman in the state legislature introduced “An Act to Provide for the Establishment of Schools of Industrial Education.” The Newark Board of Trade sponsored the bill. The Act established three schools of industrial education: one in Newark, one in Trenton, and one in Hoboken. The first Board of Trustees met on July 1, 1884. The Newark Technical School opened on Monday, February 9, 1885 with 88 students who attended despite a terrible snowstorm.', 'New Jersey Institute of Technology', 'http://www5.njit.edu/', null, null, '/uploads/2/nj.jpg', 'nj.jpg', '5786', '2', '2016-11-17 15:04:00', '2016-11-17 15:04:00');
INSERT INTO university_infos VALUES ('120', 'University of Caen Normandy', 'communication@unicaen.fr', '+33 2 31 56 55 00', 'Espl. de la Paix, 14032 Caen, France', 'Normandie University aims to enhance the attractiveness and visibility of its member institutions, especially internationally.', 'The university of Caen Normandy (UNICAEN) is a major player for Basse-Normandie higher education and research developments. UNICAEN is member of Normandie Université, a research and higher education cluster, gathering the universities of Caen, Rouen, Le Havre and the engineering schools of Caen (ENSICAEN) and Rouen (INSA).', 'The institution was founded in 1432 by John of Lancaster, 1st Duke of Bedford, the first rector being a Cornishman, Michael Tregury, afterwards Archbishop of Dublin.[4] It originally consisted of a faculty of Canon Law and a faculty of Law. By 1438, it already had five faculties. The foundation was confirmed by the King of France Charles VII the Victorious in 1452.\r\n\r\nOn July 7, 1944, during the Battle for Caen, the university was totally destroyed by aerial bombing. Reconstruction began in 1948, the new university was inaugurated on June 1 and 2, 1957. Its logo, the mythical Phoenix, symbolises this revival', 'Universitatis Cadomensis', 'http://www.unicaen.fr/', null, null, '/uploads/2/caen.png', 'caen.png', '10131', '2', '2016-11-17 15:12:33', '2016-11-17 15:12:33');
INSERT INTO university_infos VALUES ('121', 'National University of Defense Technology', 'dfao@nudt.edu.cn', '(0731)84575601', 'China, Hunan, Changsha, Kaifu, 百花园路（麦德龙西侧）往北至浏阳河畔', 'On the threshold of the new century NUDT has set its goal of building a world-class university. We hope to boost the scientific development of the university by accumulating valuable experience and advice through exchanges with universities at home and abroad', 'NUDT is a comprehensive national key university under the dual supervision of the Ministry of National Defense and the Ministry of Education as designated by Project 211 and Project 985, the two national plans for facilitating the development of Chinese higher education. NUDT was originally founded in 1953 as the Military Academy of Engineering at Harbin in Heilongjiang Province. In 1970 the Academy of Engineering moved southward to Changsha and was renamed the Changsha Institute of Technology. It changed its name to the National University of Defense Technology in 1978. NUDT is located in the urban area of Changsha, the capital city of Hunan Province in South-Central China, covering a total area of 373 hectares.', 'NUDT was originally founded on September 1, 1953 as the People\'s Liberation Army (PLA) Military Academy of Engineering  or Harbin Military Academy of Engineering under the direct leadership of the Chinese Central Military Commission. Grand General Chen Geng (Chinese: 陈赓) (similar to a Five-Star general in the U.S., see Five-star rank) was appointed the first President. It was located in Harbin, Heilongjiang Province, in Northeastern China, close to the boarder with the former Soviet Union.\r\n\r\nThe university was founded as the supreme military academy of China. It had five departments and one prep-department at the time of its founding, including departments of Air Force Engineering, Artillery Engineering, Naval Engineering, Armoring Force Engineering, and Corps of Engineers. Departments of Chemical Warfare and Nuclear Warfare were later established in the university', 'Excel in Virtue and Knowledge; Strengthen the Armed Forces and the Nation', 'http://www.nudt.edu.cn/', null, null, '/uploads/2/un.gif', 'un.gif', '5709', '2', '2016-11-17 15:24:57', '2016-11-17 15:24:57');
INSERT INTO university_infos VALUES ('122', 'University of Concepción', 'clmunoz@udec.cl', '+56 41 220 4000', 'Concepción, Bío Bío Region, Chile', 'YOU ARE HERE\r\nHome » UdeC » Strategic Plan\r\nSTRATEGIC PLAN\r\n\r\nimage UdeC\r\nIn structuring its Strategic Plan, the University considers four functional axis and a transverse axis recognized as functional training; the graduate; research, development and innovation; and extension and cultural diffusion; and as a crosscutting institutional management. \r\n\r\nFor each of these axes objectives, strategies, indicators and targets are defined. The connectedness is a university function that interacts and integrates the functional priorities of the University so organized and explicit strategies and own shares of this feature in the functional axes. \r\n\r\nThe Strategic Plan will be implemented through the generation of short - term operational plans at the institutional level and faculties and / or units. These plans define, for each axis, disaggregated targets, binding measures, deadlines, responsible and, depending on availability, associated resources. \r\n\r\nImplementation of the plan will be monitored through the monitoring of indicators established management and compliance respective goals, in order to evaluate their results. ', 'The University of Concepción  is one of the most prestigious universities in Chile. It is the third oldest university in the country and is part of the Council of Rectors. It was the first university founded in the south of Chile, and the first to become a private-law corporation. In addition, it belongs to the Southern Cross University Network ', 'The idea of ​​founding the University of Concepcion was an old aspiration of the penquistas. Since the last century, distinguished rectors of Liceo de Concepción advocated the creation of career under the tutelage of the campus. This idea had great support within the penquista society had not been able to materialize mainly because of the lack of organization \"of all people and thought,\" says an article in the newspaper El Sur, February 1917. This article I could appear overestimated the penquista society of the time, but is based on the impression they had the capital at the beginning of this century, the inhabitants of Concepción vibrant and organized men, with a great spirit of initiative. ', 'For the free development of the spirit.', 'http://www.udec.cl/', null, null, '/uploads/2/cop.png', 'cop.png', '8378', '2', '2016-11-18 02:05:36', '2016-11-18 02:05:36');
INSERT INTO university_infos VALUES ('123', 'California State University, Fullerton', 'admissions@fullerton.edu', '+1 657-278-2011', '800 N State College Blvd, Fullerton, CA 92831, USA', 'Learning is preeminent at California State University, Fullerton. We aspire to combine the best qualities of teaching and research universities where actively engaged students, faculty and staff work in close collaboration to expand knowledge.', 'California State University, Fullerton is a major regional university in a vital, flourishing area that includes Orange County, metropolitan Los Angeles and the expanding Inland Empire. The beautiful, 236-acre campus is set in Fullerton in north Orange County, about 25 miles from downtown Los Angeles and about 21 miles from nearby beaches.\r\n\r\nCal State Fullerton has more than 37,000 students and approximately 1,800 full- and part-time faculty members. The University offers 107 degree programs in eight colleges.', 'In 1957, CSUF became the twelfth state college in California to be authorized by the state legislature as a degree-granting institution. The following year, a site was designated for the campus to be established in northeast Fullerton. The property was purchased in 1959. This is the same year that Dr. William B. Langsdorf was appointed as founding president of the school.\r\n\r\nThe university was originally named Orange County State College. Classes began with 452 students in September 1959. The name of the school was changed to Orange State College in July 1962. In 1964, its name was changed to California State College at Fullerton. In June 1972, the final name change occurred and the school became California State University, Fullerton.', '\"Voice, Truth, Life\"', 'http://www.fullerton.edu/', null, null, '/uploads/2/cal.jpg', 'cal.jpg', '1088', '2', '2016-11-18 02:10:15', '2016-11-18 02:10:15');
INSERT INTO university_infos VALUES ('124', '	Belarusian State University', 'bsu@bsu.by', '+375 17 209-50-44', 'Praspiekt Niezaliežnasci 4, Minsk, Belarus', 'The BSU is an integral complex of academic, research, production, social and cultural, administrative, auxiliary and other units.', 'Belarusian State University  Minsk, Belarus, was founded on October 30, 1921. The BSU is a higher education establishment in the Republic of Belarus', 'On February 25, 1919, the Central Executive Committee of the Byelorussian SSR resolved to establish the first national university in Belarus. However, the occupation of Minsk by the Polish army delayed these plans, and the university was actually opened on October 30, 1921.[5] The historian and slavist Vladimir Picheta became its first rector.\r\n\r\nInitially the university comprised three faculties (Workers, Medicine, and Humanities) that enrolled a total of 1,390 students. The faculty included 14 professors, 49 lecturers and 10 teaching assistants, most of whom were transferred from the universities of Moscow, Kazan and Kiev. In 1922, the Pedagogical Faculty was established. The first class that counted 34 economists and 26 lawyers graduated in 1925. The university started offering post-graduate programs in 1927. Construction of the campus was started in the fall of the same year. In 1928, the university actively participated in the creation of the Institute of Belarusian Culture that was later reorganized into the Belarusian Academy of Sciences.', 'Беларускі дзяржаўны ўніверсітэт', 'http://www.bsu.by/', null, null, '/uploads/2/bsu.jpg', 'bsu.jpg', '813', '2', '2016-11-18 02:17:38', '2016-11-18 02:17:38');
INSERT INTO university_infos VALUES ('125', 'University of Nebraska Medical Center', 'jobs@unmc.edu', '+1 402-559-4000', 'S 42nd St & Emile St, Omaha, NE 68198, USA', 'Our mission is to lead the world in transforming lives to create a healthy future for all individuals and communities through premier educational programs, innovative research and extraordinary patient care.', 'A vital enterprise in the nation’s heartland, the University of Nebraska Medical Center has its eye on improving the future of health care in Nebraska and beyond.', 'The University of Nebraska Medical Center builds on a rich, vibrant history that dates back to the end of the 19th century. UNMC continues to be committed to its mission to improve the health of Nebraskans and beyond.\r\n\r\nFrom the state’s first medical college in 1880 to a dental college (1903), pharmacy college (1908), nursing college (1917), allied health training programs (early 1930s) and the Graduate College (1942), UNMC not only expanded to meet the needs of future health professionals but also consolidated several of its colleges into an Omaha campus destined to sustain its growth.', 'University of Nebraska Medical Center', 'http://www.unmc.edu/', null, null, '/uploads/2/unmc.jpg', 'unmc.jpg', '10818', '2', '2016-11-18 02:23:02', '2016-11-18 02:23:02');
INSERT INTO university_infos VALUES ('126', 'Federal University of Sao Paulo', 'info@unifesp.br', '+55 11 5576-4848', 'R. Sena Madureira, 1500 - Vila Clementino, São Paulo - SP, 04021-001, Brazil', 'Regarding campuses, imposed the need to plan - the medium and long term - its expansion and infrastructure, which is why we opted for the formulation of master plans, whose projects are being developed by the Dean of Planning. With the reorganization, this pro-rectory started to build new power, accounting for the use of physical space and property management.', 'The Federal University of São Paulo is a university in the state of São Paulo, Brazil.\r\nThe strong growth experienced by the institution for decades was reflected both in the occupation of more than a hundred buildings in the vicinity of its headquarters in Vila Clementino (SP), in which were installed teaching centers, research institutes and clinics, as the construction of own buildings as Research Buildings I and II, the National Institute of Pharmacology and the Regional Blood Center.', 'Traditionally recognized as an institution specialized in health sciences, Unifesp is responsible for the training of qualified human resources and the development of scientific research in health. Your source core is the Paulista School of Medicine, whose foundation dates back to 1933 and which is supported by private funds and government subsidies to the federalization in 1956. With the enactment of Law No. 8957 in 1994, EPM turned themselves in federal university, keeping the courses in Medicine, Nursing, Life Sciences (medical modality), Speech Technology Ophthalmic - which now integrates the Health Technology.', 'Universidade Federal de São Paulo', 'http://www.unifesp.br/', null, null, '/uploads/2/unifesp.png', 'unifesp.png', '9325', '2', '2016-11-18 02:31:08', '2016-11-18 02:31:08');
INSERT INTO university_infos VALUES ('127', 'University of Verona', 'cognome@univr.it', '+39 045 802 8588', 'Via dell\'Artigliere, 8, 37129 Verona VR, Italy', 'The University of Verona (Italian: Università degli Studi di Verona) is a university located in Verona, Italy. It was founded in 1982 and is organized in 12 Departments. According to the business newspaper \"Il Sole 24 Ore\", it is ranked as the best university in Italy in both 2014 and 201', 'The University of Verona is dedicated to innovation and to maintaining the high quality of its teaching and research. The institution has 22,000 students, and 1,500 teaching and non-teaching staff all dedicated to a continual process of growth and to the development of human, structural and financial resources. The University has strong links to the local community and looks to the future through its constant strengthening of the link between courses offered and the world of work. In the immediate future, one of the University’s principle objectives is to continue with its building programme in order to create an improved and welcoming environment. ', 'In Verona, at the beginning of the 1950s, a group of Catholic intellectuals established the \"Ludovico Antonio Muratori\" Free High School of Historical Science together with the magazine \"Nova Historia\".\r\n\r\nIt was from this group of scholars that the idea of building a University in Verona was created. The idea took shape in February 1959 when the then Mayor, Prof. Giorgio Zanotto, placed as the order of the day during a session of the Municipal Council \"the institution in Verona of a University Faculty of Economics and Commerce\".\r\n\r\nThe Provincial Administration and Chamber of Commerce were in ready agreement. Thus they created the Free Faculty of Economics and Commerce and the Consortium for university studies to manage it. In the summer of 1959 the project began, the location in Palazzo Giuliari was decided, donated by Countess Giuliari Tusini and which is now home to the Chancellor\'s office. Enrolments began and on 1 November of the same year, the inauguration ceremony of the new Faculty was held.\r\n\r\nBut the lack of government recognition hindered everyone\'s expectations, both of the Veronese public bodies and the students themselves. The city authorities immediately joined together to find a solution and in 1963 Padua University recognised the Faculty of Economics and Commerce as part of its own Faculty with a branch in Verona. In July 1963 the first thesis of the first graduate of the new Veronese faculty was examined.\r\n\r\nShortly after Padua decided to transfer the Medical and Surgical and Legal sections to Verona, which has now become Arts and Philosophy.\r\n\r\nThe project that gave rise to the history of Verona University was finally and definitively achieved in 1982, when the governmental authorities gave Verona the autonomy and status of its university.', 'Università degli Studi di Verona', 'http://www.univr.it', null, null, '/uploads/2/an.jpg', 'an.jpg', '9471', '2', '2016-11-18 02:37:59', '2016-11-18 02:37:59');
INSERT INTO university_infos VALUES ('128', 'National Taiwan University of Science & Technology', 'oia@mail.ntust.edu.tw', '+886 2 2733 3141', 'No. 43, Section 4, Keelung Rd, Da’an District, Taipei City, Taiwan 106', 'Our vision is to build Taiwan Tech into an international applied research university producing high-tech and management personnel with the ability to compete on a global level, thus supporting the future growth of our nation and society.\r\n \r\nOur overall goals are to employ multifaceted excellence, innovative expertise, technology integration, and holistic education on the platforms of intelligent green building technology and creative design while recruiting internationally-renowned professors to help us achieve cutting-edge breakthroughs in all aspects of our teaching and research. This will inspire the development of the entire university, neighboring academic and research institutions, and local industry in the upgrading of our national ability to compete on a global stage.', 'The National Taiwan University of Science and Technology , commonly referred to as Taiwan Tech, is a public/national technological university located in Taipei, Taiwan. Taiwan Tech was established in 1974,as the first and the leading higher education institution of its kind within Taiwan\'s technical and vocational education system', 'The National Taiwan University of Science and Technology, formerly known as the National Taiwan Institute of Technology, was established on July 22, 1974, as the first and the best higher education institution of its kind of technological and vocational education system in Taiwan.[3][4] By extending this system to the highest level, the university was intended to meet the need created by the rapid economic and industrial development for highly trained engineers and managers', 'Precision in Work, Sincerity in Attitude', 'http://www.ntust.edu.tw/home.php', null, null, '/uploads/2/tww.gif', 'tww.gif', '5694', '2', '2016-11-18 03:30:54', '2016-11-18 03:30:54');
INSERT INTO university_infos VALUES ('129', 'Isfahan University of Technology', 'info@iut.ac.ir', '+98 31 3391 3110', 'Isfahan Province, Khomeyni Shahr, Daneshgah e Sanati HW, Iran', 'We certainly use the latest technologies and equipment and always encourage our personnel to use the latest methods', 'Isfahan University of Technology is one of the most prestigious engineering universities in Iran. It is located 15 kilometers north west of Isfahan and educates in the fields of science, engineering and agriculture. It has dormitories, a shopping center, sports and recreation centers, and medical centers on the campus. The university enjoys the advantages of being situated in the vicinity of the historical, industrial, and commercial city of Isfahan; a city with a long-standing tradition in science, art and culture as well as a leading center of technological activities.', 'The university was founded in 1974 and admitted its first students in 1977. It was founded as Aryamehr University of Technology Isfahan branch and was renamed after the Islamic Revolution of Iran. Plans to make the institution the largest university in the Middle East were not completed because of political changes in the country.\r\n\r\nIsfahan University of Technology is a state university under the supervision of the Ministry of Science, Research, and Technology. IUT began its academic activities in 1977 with around 800 students in five departments; the enrollment has grown to 10000 in twelve departments.\r\n\r\nThe university was designed and planned based on models of MIT and University of Illinois Urbana-Champaign', 'Dāneshgāh-e San\'ati-ye Esfahān', 'http://www.iut.ac.ir/', null, null, '/uploads/2/dars.png', 'dars.png', '3827', '2', '2016-11-18 03:38:23', '2016-11-18 03:38:23');
INSERT INTO university_infos VALUES ('130', 'Birkbeck University of London', 'its@bbk.ac.uk', '+44 20 7631 6000', 'Malet St, London WC1E 7HX, UK', 'The principal aims of Birkbeck are to:\r\n\r\nProvide flexible and part-time higher education courses which meet the changing educational, cultural, personal and career needs of students of all ages; in particular those who live or work in the London region.\r\nEnable adult students from diverse social and educational backgrounds to participate in our courses.\r\nMake available the results of research, and the expertise acquired, through teaching, publication, partnerships with other organisations and the promotion of civic and public debate.\r\nMaintain and develop excellence in research and provide the highest quality research training in all our subject areas.', 'Part of the world-renowned University of London, Birkbeck is a world-class research and teaching institution, based in central London.\r\n\r\nNearly all of our courses are taught in the evening, and Birkbeck is London\'s only specialist provider of evening higher education.', 'On the evening of 11 November 1823, around 2000 people flocked to the Crown and Anchor Tavern on the Strand to witness Dr George Birkbeck and his supporters, including Jeremy Bentham, JC Hobhouse MP and H Brougham MP, discuss education for the working men of London. From this grew the London Mechanics’ Institute, dedicated to the education of working people, formally created on 2 December at the same location.', 'Study by night', 'http://www.bbk.ac.uk/', null, null, '/uploads/2/owl.jpg', 'owl.jpg', '904', '2', '2016-11-18 03:43:28', '2016-11-18 03:43:28');
INSERT INTO university_infos VALUES ('131', 'Johannes Kepler University Linz', 'socialmedia@jku.at', '+43 732 24680', 'Altenbergerstraße 69, 4040 Linz, Austria', 'Anchored in the university’s Development Plan, the JKU’s strengths also include:\r\n\r\nTop quality interdisciplinary approach to research, teaching, and continual education that has been reinforced in recent years through supportive educational policies and facilitated by the physical proximity of almost all JKU institutes located on campus.\r\nStrategic partnership agreements with the Upper Austrian government and the city of Linz which, among other things, is reflected in the work by the Linz University Fund.\r\nAbove-average, large amounts of external funding: an extensive proportion of research is financed by EU research programs, national research funding programs, regional research and technology programs, direct cooperation with the local business community, and the public sector.\r\nModern building structures designed to meet the needs of today: The Science Park concept brought externally located institutions back to campus, enabling a rapid expansion of the polymer engineering program.\r\nThe development and application of modern educational methods: computer-assisted teaching which enables students to partly complete their studies independent of time and location constraints. In cooperation with the FernUniversität Hagen, the JKU also offers degree programs via distance learning at several locations throughout Austria.\r\nPioneering role in gender research. The JKU also strongly supports work-life balance for its students and employees with families. The university’s commitment will be rewarded: The Federal Ministry of Economy, Family & Youth has presented the JKU with the \"Audit hochschuleundfamilie\" certificate.', 'Since its inception in 1966, the JKU has become a successful and innovative center for science, academics and society. Today, the JKU has become one of the largest educational institutions in Upper Austria and enjoys an international reputation not only in conducting base-knowledge research, but also in applied-oriented research. The university offers interdisciplinary and hands-on educational programs designed to meet today’s business and societal needs and our cooperation agreements with over 300 partner universities in over 50 countries as well as over 120 professors and over 1800 academic faculty ensure superior research and study conditions.\r\n\r\n\r\nThe JKU Linz is ranked among the world’s best young universities (under 50 years). For the second year, the most recent \"Times Higher Education 100 Under 50\" ranking placed the JKU among the Top 70 of the world’s best young universities (under 50 years). With nine active Christian Doppler laboratories on campus, the JKU is among the best universities in Austria', 'The JKU was established as the \"College of Social Sciences, Economics and Business\" (Hochschule für Sozial- und Wirtschaftswissenschaften) in 1966. The Faculty of Sciences and Engineering was established three years later and in 1975, the college was awarded university status and the Faculty of Law was integrated on campus. The university was named in honor of astronomer Johannes Kepler (1571-1630) who wrote his magnum opus harmonices mundi (\"The Harmony of the world\") in Linz during the early 17th century and taught mathematics at a school for the landed gentry (Adelichen Landt-Schuelen) near Linz.[3] At present, the campus added the \"JKU Science Park\", an additional building for science and engineering institutes.', 'Alma Mater Kepleriana', 'www.jku.at', null, null, '/uploads/2/book.png', 'book.png', '4174', '2', '2016-11-18 03:58:00', '2016-11-18 03:58:00');
INSERT INTO university_infos VALUES ('132', 'Ningbo University', 'service@sicas.cn', '+86 574 8818 0001', '199 Taikang E Rd, Yinzhou Qu, Ningbo Shi, Zhejiang Sheng, China, 315100', 'School and vigorously promote international education process that has been in 60 countries and more than 160 colleges and universities to establish a cooperation and exchange relations. ', 'Ningbo University is a comprehensive teaching and research university, and its disciplines covering economics, law, education, literature, history, science, engineering, agriculture, medicine, management, arts and other 11 type door, has 20 colleges, construction there are two provincial priority disciplines, 2 provincial key discipline, two provincial key research base of Humanities and Social Sciences College, 20 provincial key disciplines; according to data released by ESI, engineering, clinical medicine two subjects in the top 1% of the world\'s academic institutions. Existing two doctoral level, 13 two disciplines doctoral, three post-doctoral research stations, 19 master\'s degree level subjects, 17 professional master\'s degree programs (including Master of Engineering in the field), 75 undergraduate majors . Existing ordinary full-time undergraduate students 26671, various graduate 6131, 19,255 adult students.', 'Ningbo University was established in 1986 by the donation of Yue-Kong Pao. Other major benefactors include Sir Run-run Shaw, Sir Chao An Chung (赵安中), Sir Hans Tang, Sir Yue-shu Pao (包玉书), Sir Cao Guangbiao (曹光彪), Sir Li Dashan (李达三), Sir Zhu Yinglong (朱英龙). Deng Xiaoping wrote the school title.[clarify]\r\n\r\nIn 1996, Ningbo Normal College (宁波师范学院) and Zhejiang Shuichan College, Ningbo (浙江水产学院宁波分院) were merged into Ningbo University.\r\n\r\nIn the early years of the school founding, Zhejiang University, Fudan University, China University of Science and Technology, Beijing University and other counterparts reconstruction, starting point to begin the school history.\r\n\r\nAfter 2000, Ningbo Maritime School, Ningbo Forestry School, and Ningbo Normal School were merged into Ningbo University.\r\n\r\nThe first President was Zhu Zhaoxiang (朱兆祥), from September 1985 to September 1988.\r\n\r\nIn 2012, the government of Zhejiang province and Ningbo city decided to build the university as Ministry of school[clarify] (the same level as 211 program).', '\"Seeking truth from facts and applying knowledge to the service of the nation', 'http://www.nbu.edu.cn/', null, null, '/uploads/2/ning.png', 'ning.png', '5840', '2', '2016-11-18 04:06:12', '2016-11-18 04:06:12');
INSERT INTO university_infos VALUES ('133', 'University of Las Palmas de Gran Canaria', 'universidad@ulpgc.es', '+34 928 45 10 00', ' Calle Juan de Quesada, 35001 Las Palmas de Gran Canaria, Las Palmas, Spain', 'The University of Las Palmas and has an IV Institutional Strategic Plan (PEI), approved by its governing bodies. Following evaluation of the III Institutional Strategic Plan, it is concluded that it has met its essential objectives as today ULPGC is an international leader in marine and maritime pole, internationalization has reached unknown heights and actions of the Campus of International Excellence and Science and Technology park set us apart ULPGC University of excellence.', 'The ULPGC was founded in 1989, and despite his youth, in few years has managed to position itself as a leading Spanish universities, highlighting the use of new technologies, research related to marine and maritime areas, programs international mobility and its close involvement with the local society with sound finances and a high scientific productivity.\r\n\r\nThe ULPGC has six campuses , three of which are located in Las Palmas; one in the municipality of Arucas (Gran Canaria) and two on the islands of Lanzarote and Fuerteventura.\r\n\r\nThe ULPGC has more than 1,500 teachers played an important research activity, --avalada by 153 research groups , some of which are internationally reference, which has led to the ULPGC has obtained the consideration of Campus of Excellence International in the marine-sea area call 2010 the Ministry of Education.\r\n\r\nThe ULPGC has opted for the creation of Science and Technology Parks (PCT) that stimulate the transfer of results of R + D + i to society the environment as well as to serve as a basis for the creation of technology - based companies.', 'The ULPGC was founded in 1989, and despite his youth, in few years has managed to position itself as a leading Spanish universities, highlighting the use of new technologies, research related to marine and maritime areas, programs international mobility and its close involvement with the local society with sound finances and a high scientific productivity.', 'Universidad de Las Palmas de Gran Canaria', 'http://www.ulpgc.es/', null, null, '/uploads/2/ulp.jpg', 'ulp.jpg', '8431', '2', '2016-11-18 04:10:58', '2016-11-18 04:10:58');
INSERT INTO university_infos VALUES ('134', 'Depaul University', 'info@mail.depaul.edu', '+1 312-362-6783', '1 E Jackson Blvd, Chicago, IL 60604, USA', 'Guided by the university\'s 2018 strategic plan and its mission statement, the Office of Mission and Values collaborates with university departments and constituencies in ways that measurably enhance their understanding and support of DePaul University\'s distinctive Catholic, Vincentian, and urban identity. Together we provide the leadership that enables the university to achieve excellence in its educational mission, serve its diverse student body, and maximize its strategic capacities. As the premier international resource for Vincentian studies, the Office also serves a wide range of external constituencies who seek to deepen their engagement with Vincentian history, spirituality, and service.', 'Guided by the university\'s 2018 strategic plan and its mission statement, the Office of Mission and Values collaborates with university departments and constituencies in ways that measurably enhance their understanding and support of DePaul University\'s distinctive Catholic, Vincentian, and urban identity. Together we provide the leadership that enables the university to achieve excellence in its educational mission, serve its diverse student body, and maximize its strategic capacities. As the premier international resource for Vincentian studies, the Office also serves a wide range of external constituencies who seek to deepen their engagement with Vincentian history, spirituality, and service.', 'Originally named St. Vincent\'s College, DePaul University was founded in 1898 by the Congregation of the Mission priests and brothers, known as the Vincentians. Followers of 17th-century French priest Saint Vincent de Paul, they founded the university to serve Roman Catholic children of immigrants. Student enrollment grew from 70 in 1898 to 200 in 1903 in what is now the Lincoln Park neighborhood of Chicago. In that year, James Quigley, Archbishop of Chicago, announced plans to create a preparatory seminary, now Archbishop Quigley Preparatory Seminary, for the archdiocese and allow the Jesuit Saint Ignatius College, now Loyola University Chicago to move its collegiate programs to the north side, threatening St. Vincent College\'s survival. In response, the Vincentians re-chartered in 1907 as DePaul University, expressly offering all of its courses of study to men and women of any religious background. DePaul began admitting women in 1911 and awarded degrees to its first female graduates in 1912. It was one of the first Catholic universities to admit female students in a co-educational setting.', '\"I will show you the way of wisdom.\"', 'http://www.depaul.edu/', null, null, '/uploads/2/dep.png', 'dep.png', '1666', '2', '2016-11-18 04:16:22', '2016-11-18 04:16:22');
INSERT INTO university_infos VALUES ('135', 'Ajou University / 아주대학교', 'gsis@ajou.ac.kr', '+82 31-219-2114', '산5, Woncheon-dong, Yeongtong-gu, Suwon-si, Gyeonggi-do, South Korea', 'Emphasis on customized professional education\r\nCultivation of global academic groups\r\nExpansion of Humanities Education that foster global citizens\r\nIntensification of research ability\r\nCultivation of outstanding faculty members and their competence\r\nEmphasis on the social contribution of continuing education', 'Ajou University, established in 1973 under the motto of \"Asia\'s best university for the 21st century\", is a leading research university with 10 colleges in Korea. Located in Suwon, about 30km south of Seoul, Ajou has 14,000 students (9,000 undergraduate, 3,500 graduate, and 1,500 in other courses).\r\n\r\nThe strength in Ajou\'s academic programs and research lies in Engineering, IT, BT, NT, Medical Science, Business and International Studies. Ajou is widely recognized for its innovative international programs and strong support for international students and has collaborative partnership with over 200 universities in 58 countries. There is a wide range of international programs at Ajou including student and faculty exchanges, international summer school, Korean language program, etc. International students are taking courses offered in English by various majors. Today Ajou is welcoming about 750 international students a year.', 'Starting as Ajou Engineering Junior College, Ajou College recruited 280 students during its first year from four depart- ments, including Electronics, Precision Mechanical\r\nEngineering, Fermentation Chemical Engineering, and Industrial Management. The school was promoted to Ajou Engineering College a year later and produced its first graduates in 1997. In 1997, Kim, Woo-jung, the chairman of Daewoo International, contributed his personal wealth to establish Daewoo Institute and took over Ajou University.', 'Asia\'s best university for the 21st century\"', 'http://www.ajou.ac.kr/', null, null, '/uploads/2/ajou.jpg', 'ajou.jpg', '151', '2', '2016-11-18 04:21:07', '2016-11-18 04:21:07');
INSERT INTO university_infos VALUES ('136', 'Dublin City University', 'international.office@dcu.ie', '+353 1 700 5000', 'Glanevin, Dublin 9, Ireland', 'DCU is a young, dynamic and ambitious university with a distinctive mission to transform lives and societies through education, research and innovation. Since admitting its first students in 1980, DCU has grown in both student numbers and size and is now a multi campus environment Glasnevin, located just north of Dublin city. In the last nine years, DCU has twice been named Sunday Times ‘University of the Year’', 'Dublin City University is growing! September 2016 saw the completion of the process by which St Patrick’s College Drumcondra (SPD), Mater Dei Institute (MDI) and Church of Ireland College of Education (CICE) were fully incorporated with DCU. From this date, all students and staff of St Patrick’s College, Mater Dei Institute and the Church of Ireland College of Education are students and staff of DCU.\r\n\r\nTwo of the most significant changes arising from Incorporation are the establishment of a new Faculty of Education that will be known as the “DCU Institute of Education”, the first faculty of education in an Irish university and one of the largest in Europe; and an enhanced Faculty of Humanities and Social Sciences which has a much broader array of subjects on offer.\r\n\r\nDCU now has a larger community and our multi campus university has a stronger, more visible, presence in North Dublin, underpinning our position as the most significant and comprehensive provider of University education on the rapidly growing and economically important Eastern corridor. St Patrick’s College, Drumcondra campus is now known as DCU - St Patrick’s Campus. All Hallows campus, also in Drumcondra, is now the third academic campus of DCU.', 'The institution was created in 1975, on an ad hoc basis, and on 18 June that year Dr Danny O\'Hare was made acting director of the institution, and a day later the first governing body met. It was intended at this stage that the institution become the unified structure under which the colleges of what later became Dublin Institute of Technology would unite, but by 1978 it became apparent that this would not be the case and instead an independent institution developed with a distinct identity and mission', 'Ireland\'s University of Enterprise', 'http://www.dcu.ie/', null, null, '/uploads/2/dcu.jpg', 'dcu.jpg', '1817', '2', '2016-11-18 04:25:43', '2016-11-18 04:25:43');
INSERT INTO university_infos VALUES ('137', 'University of Modena and Reggio Emilia', 'urp@unimore.it', '+39 059 205 6511', 'Via Università, 4, 41121 Modena MO, Italy', 'The mission of University is to raise highly capable individuals who will be able to produce and apply scientific knowledge by creating high performance areas at the national and global levels with social responsibility', 'The University of Modena and Reggio Emilia (Italian: Università degli Studi di Modena e Reggio Emilia), located in Modena and Reggio Emilia, Emilia-Romagna, Italy, is one of the oldest universities in Italy, founded in 1175, with a population of 20,000 students.\r\n\r\nThe medieval university disappeared by 1338 and was replaced by \"three public lectureships\" which did not award degrees and were suspended in the 1590s \"for lack of money\". The university was not reestablished in Modena until the 1680s and did not receive an imperial charter until 1685', 'The origins of our University date back to 1175 or so, when Pillio of medicine , doctor of laws active in Bologna, Modena was invited to the elite of the City Manager to open a legal training school focused on Roman law. So this is one of the oldest universities in Europe , after that of Bologna and Paris.', 'Universitas Studiorum Mutinensis et Regiensis', 'http://www.unimore.it/', null, null, '/uploads/2/unimore.jpg', 'unimore.jpg', '9455', '2', '2016-11-18 04:32:47', '2016-11-18 04:32:47');
INSERT INTO university_infos VALUES ('138', 'University of Ioannina', 'aagapiad@cc.uoi.gr', '+30 2651 007105', 'Mpizani 455 00, Greece', 'The mission of OPTIMA is the production of high-quality research in Computational Optimization and relative fields. It aims at offering a cell for hosting innovative ideas and bringing together scientists and engineers that work in complementary research fields that involve the solution of hard optimization tasks. OPTIMA welcomes international collaborations and joint efforts towards the development of new Computational Optimization algorithms and techniques. Challenging optimization problems and real-world applications are also gladly accommodated.', 'The University has a good reputation should not be denied and that the corner is the Greek earth\'s precious and it is what, and will no one for her is less than that actually deserves.\"', 'The change of government that took place in 1964, amended by the new law on organization and management of schools. Within the framework of the educational reform on May 8, 1964, was announced by the press, the Department establishing the Faculty of Philosophy in Ioannina, as an annex of the same School of the Aristotle University of Thessaloniki. The Department was founded with Nos. 735/64 northwest and began operating in the academic year 1964-65 with two hundred students. Initially the Department was housed in the old building of Zosimaia Pedagogical Academy. A wing of the same building, which held the military hospital 406, granted by the military authorities to meet the first administrative and teaching needs. For the same reason, it turned into classroom the large hall of the Academy ceremonies. The official opening took place on November 7, 1964.', 'Πανεπιστήμιο Ιωαννίνων', 'http://www.uoi.gr/', null, null, '/uploads/2/lao.jpg', 'lao.jpg', '10681', '2', '2016-11-18 04:39:17', '2016-11-18 04:39:17');
INSERT INTO university_infos VALUES ('139', '	Brno University of Technology', 'vut@vutbr.cz', '+420 541 141 111', 'Antonínská 548/1, 601 90 Brno-střed, Czech Republic', 'A vibrant learning environment – fostering innovation and creativity, informed by practice, inspired by research, focusing on the globally relevant areas in which we excel.', 'Brno University of Technology  is a university located in Brno, Czech Republic. Being founded in 1899 and initially offering a single course in civil engineering, it grew to become a major Czech university with over 24,000 students enrolled at 8 faculties and 2 university institutes.', 'In the beginning the university was settled in Augustine Street and had to make do with 4 professors and 47 students who could study only Civil Engineering. In the following year (1900) the teaching of the field of machine engineering was started and followed by the cultural engineering (landscaping), electrical engineering and chemical engineering. After World War I it was also possible to study architecture. In 1911 the university was moved into a newly built luxurious building in Veveří Street which is still used by the Faculty of civil enegineering. In the interwar period it was connected with the German Technical University and was renamed the Brno University of Technology. The school has used the name of the University of Technology of Dr. E. Benes for a short time.', 'Have the courage to be wise', 'https://www.vutbr.cz', null, null, '/uploads/2/brno.png', 'brno.png', '11359', '2', '2016-11-18 04:48:27', '2016-11-18 04:48:27');
INSERT INTO university_infos VALUES ('140', 'University of Kwazulu Natal', 'education@ukzn.ac.za', '+27 31 260 1111', ' King George V Ave, Durban, 4041, South Africa', 'A truly South African university that is academically excellent, innovative in research, critically engaged with society and demographically representative, redressing the disadvantages, inequities and imbalances of the past.', 'The University of KwaZulu-Natal or UKZN is a university with five campuses in the province of KwaZulu-Natal in South Africa.[4] It was formed on 1 January 2004 after the merger between the University of Natal and the University of Durban-Westville', 'The University of KwaZulu-Natal was formed on 1 January 2004 as a result of the merger between the University of Durban-Westville and the University of Natal. The new university brings together the rich histories of both the former Universities. \r\n\r\nThe University of Durban-Westville was established in the 1960s as the University College for Indians on Salisbury Island in Durban Bay. Student numbers throughout the 1960s were low as a result of the Congress Alliances’ policy of shunning apartheid structures. This policy gave way in the 1980s to a strategy of “education under protest” which sought to transform apartheid institutions into sites of struggle. Student numbers grew rapidly and in 1971, the College was granted University status. The following year, the newly-named University of Durban-Westville moved into its modern campus in Westville and was a site of major anti-apartheid struggle. UDW became an autonomous institution in 1984, opening up to students of all races. \r\n\r\nFounded in 1910 as the Natal University College in Pietermaritzburg, the University of Natal was granted independent University status in 1949 owing to its rapid growth in numbers, its wide range of courses and its achievements in and opportunities for research. By that time, the NUC was already a multi-campus institution, having been extended to Durban after World War 1. The distinctive Howard College building was opened in 1931, following a donation by Mr T B Davis, whose son Howard Davis was killed during the Battle of Somme in World War I. In 1946, the government approved a Faculty of Agriculture in Pietermaritzburg and, in 1947, a Medical School for African, Indian and Coloured students in Durban. ', 'University of KwaZulu-Natal', 'http://www.ukzn.ac.za/', null, null, '/uploads/2/kwaz.png', 'kwaz.png', '10721', '2', '2016-11-18 04:54:19', '2016-11-18 04:54:19');
INSERT INTO university_infos VALUES ('141', 'Istanbul University', 'iubasin@istanbul.edu.tr', '+90 212 440 00 00', 'Beyazıt, 34452 Fatih/İstanbul, Turkey', 'İstanbul University brings together the East and the West; the past and the future; also it is the leading University raising competent individuals who produce beneficial knowledge for our country and humanity.', 'Istanbul University (Turkish: İstanbul Üniversitesi) is a prominent Turkish university located in Istanbul. The main campus is adjacent to Beyazıt Square in Fatih, the capital district of the province, on the European side of the city.', 'Istanbul University was established in 1453 by the Ottoman Sultan Mehmed II.[1] However, Richard Honig, a German law historian, who claims that Byzantine and Ottoman traditions could be analyzed together, expressed that the history of Istanbul University can be traced back to 1 March 1321.[2] The university, which was first established in today\'s main building, was equivalent to Roman universities consisting of schools of medicine, law, philosophy and letters, and is considered to be the pioneer of university education in Istanbul.[2]\r\n\r\nIt was founded as an institution of higher education named the Darülfünûn (دار الفنون) (House of Multiple Sciences) on 23 July 1846; but the Medrese (Islamic theological school) which was founded immediately after Mehmed II conquered Constantinople (Istanbul) in 1453 is regarded as the precursor to the Darülfünûn which evolved into Istanbul University in 1933.[3] Education in a number of sciences and fields (such as medicine, mathematics, astronomy, cartography, geography, history, philosophy, religion, literature, philology, law, etc.) became available, and, until the 19th century, they were instrumental in educating the ruling cadres of the Ottoman society. However, when the medreses were no longer able to meet the needs of the modern world, a restructuring process began, and as a result, the institutions of higher education called Darülfünûn, the core of Istanbul University, was established.', '\"Leadership in Higher Education for Centuries\"', 'http://www.istanbul.edu.tr/tr/', null, null, '/uploads/2/st.png', 'st.png', '3987', '2', '2016-11-18 06:28:45', '2016-11-18 06:28:45');
INSERT INTO university_infos VALUES ('142', 'University of New England', 'hnass@une.edu', '+61 2 6773 3333', 'Armidale NSW 2351, Australia', 'Since it was established, the University of New England has undertaken fundamental and applied research in many disciplines. Its scholars and scientists have established international reputations through their contributions in areas including rural science, agricultural economics, geology, educational administration, linguistics, archaeology. Collaborative research with other institutions, such as the CSIRO, has led to many important projects including participation in Cooperative Research Centres. It is through its research activities that the University is able to assist in the economic, social and cultural advancement of Australia and in the advanced training of undergraduate and postgraduate students.\r\n\r\nThe University seeks to serve regional, national and international communities through the progressive pursuit of excellence in scholarship, research and teaching. In committing itself to this mission, the University of New England uncompromisingly endeavours to build on its strengths and gladly accepts its responsibility to serve the educational, cultural, intellectual and social needs of regional/rural Australia in general, and the New England region in particular.', 'The University of New England (UNE) is a public university in Australia with approximately 21,000 higher education students. Its original and main campus is located in the city of Armidale in northern central New South Wales.\r\n\r\nThe University of New England was the first Australian university established outside a state capital city.', 'The University of New England was originally established in 1938 as the New England University College, a College of the University of Sydney. It became fully independent in 1954.\r\n\r\nThe University of New England has undergone two major changes since 1989. The University of New England Act, 1989, created a network University consisting of: (i) a campus at Armidale, incorporating the former University of New England and the former Armidale College of Advanced Education; and (ii) a campus at Lismore, incorporating the former Northern Rivers College of Advanced Education. The following year the Orange Agricultural College joined the network University. The network also included the UNE-Coffs Harbour Centre, which provided courses from within academic departments of the Armidale and Lismore campuses.', 'Out Of Wisdom Comes Moderation', 'http://www.une.edu.au/', null, null, '/uploads/2/une.jpg', 'une.jpg', '10824', '2', '2016-11-18 06:54:11', '2016-11-18 06:54:11');
INSERT INTO university_infos VALUES ('143', 'University of Ferrara ', 'ateneo@pec.unife.it', '+39 0532 293111', 'Via Savonarola, 9, 44121 Ferrara FE, Italy', 'We have been looking ahead for 600 years. It is not only the tag-line of the University’s communication logo, but also one of the objectives which we consider a priority. The University of Ferrara looks ahead and the future can only lead to internationalisation.', 'Ferrara is a safe and welcoming open Campus with teaching and research facilities conveniently located in the centre as well as just outside the Renaissance walls.', 'The University of Ferrara was founded in 1391 by the Marquise Alberto V of Este with the permission of Pope Boniface IX.  The first courses to be inaugurated were Arts, Theology and Law and were taught by famous teachers such as Bartolomeo Saliceto, an expert among jurists.\r\nDuring the 15th and 16th centuries, Ferrara became one of the most thriving centers of Italian Renaissance culture and the University enjoyed a period of great prestige, thanks  also to the presence of illustrious intellectuals such as Nicholas Copernicus and Paracelsus.  After its assimilation into the Papal State in 1598, the University was transformed from a prestigious Estensi City University to a University in the outskirts.  In the Napoleonic Age, with the plan for national universities, the University lost its power to grant degree titles and normal academic activity did not resume until 1816.  After the unification of Italy, the University of Ferrara became a free university.  In the years preceding the First World War, with over 500 students, the University was the most highly attended free university in Italy. The identity of the University is therefore rooted in a historical and cultural tradition which sets it apart from others.  Since its foundation it has welcomed and educated illustrious personalities from the worlds of Culture, the Arts and the Sciences.  In terms of its size, facilities and the quality and quantity of education and research, the university is a point of excellence within Italy.  This is also demonstrated  by its excellent position in international rankings.\r\n\r\n ', 'In labore fructus', 'http://www.unife.it/', null, null, '/uploads/2/fer.png', 'fer.png', '9446', '2', '2016-11-18 11:34:45', '2016-11-18 11:34:45');
INSERT INTO university_infos VALUES ('144', 'University of Ulster', 'registryce@ulster.uk', '+44 28 7012 3456', 'Ulster University, Cromore Rd, Coleraine BT52 1SA, UK', 'Our core business activities are teaching and learning, widening access to education, research and innovation and technology and knowledge transfer.  Look at our courses and see how we\'re preparing students for tomorrow\'s world today.', 'Ulster University has a national and international reputation for excellence, innovation and regional engagement and continues to make a major contribution to the economic, social and cultural development of Northern Ireland..', 'The New University of Ulster (NUU) incorporated Magee College founded in 1865 in Derry. Magee College was a college of the Royal University of Ireland from 1880 and later became associated with the University of Dublin (better known as Trinity College) when the Royal University was dissolved in 1908 and replaced by the National University of Ireland. In 1953 Magee College broke its links with Dublin and became Magee University College. It was hoped by groups led by the University for Londonderry Committee that this university college would become Northern Ireland\'s second university after The Queen\'s University of Belfast. However, this did not happen and instead it was subsumed into the New University, primarily as a result of the unwillingness of the Unionist government at Stormont to have the second university sited in overwhelmingly nationalist Derry, in which \"The Troubles\" were just beginning to break out. The decision caused an outcry at the time', 'Ulster University\'s coat of arms', 'https://www.ulster.ac.uk/', null, null, '/uploads/2/she.jpg', 'she.jpg', '8072', '2', '2016-11-18 11:58:10', '2016-11-18 11:58:10');
INSERT INTO university_infos VALUES ('145', 'University of Stirling', 'studentsupport@stir.ac.uk', '+44 1786 473171', 'University of Stirling, Stirling FK9 4LA, UK', 'The University of Stirling is an international university with a global reputation for high-quality teaching and research. We are an agent for change, connecting people, innovating and transforming the lives of our students, staff and the global communities we serve.', 'The University of Stirling is a UK research intensive campus university founded by Royal charter in 1967. It is a plate glass university located in the Central Belt of Scotland, built within the walled Airthrey Castle estate. Since its foundation, it has expanded to have four Faculties, a Business School, a Graduate School and a number of Institutes and Centres covering a broad range of subjects. It is ranked among the top 50 universities in the world that are under 50 years old by the Times Higher Education World University Rankings and among the top 40 in the UK in the complete university guide. In the 2014 assessment of research in the UK, the Research Excellence Framework, it was ranked 5th in Scotland and 40th in the UK for research intensity. Stirling has a reputation for excellence in graduate employment prospects ranking 7th in the UK in 2015 and 3rd in 2016', 'Stirling was the first new university to be established in Scotland for nearly 400 years.[16] The original site of the campus was selected from a shortlist of competing sites which include, Falkirk, Perth and Inverness. The author of the Robbins Review, which recommended an expansion of the number of universities in the UK during the 1960s, Lord Robbins, was appointed as the University\'s first Chancellor in 1968. In 1967 a house for the University Principal Dr Tom Cottrell was completed, designed by architects Morris and Steedman. It was listed as category A in 2009', 'Innovation and Excellence', 'http://www.stir.ac.uk/', null, null, '/uploads/2/stir.jpg', 'stir.jpg', '10946', '2', '2016-11-18 12:09:56', '2016-11-18 12:09:56');
INSERT INTO university_infos VALUES ('146', '	Wroclaw University of Technology', 'J.M.Rektor@pwr.edu.pl', '+48 71 320 26 00', 'wybrzeże Stanisława Wyspiańskiego 27, 50-370 Wrocław, Poland', 'The mission of our University is to shape the creative and critical personalities of students and define the directions of development in science and technology. The education offered at our institution is strongly linked with scientific research and the needs of economy and is consistent with standards of the European Higher Education Area.', 'Wrocław University of Science and Technology  is an autonomous technical university in Wrocław, Poland. With buildings dispersed throughout the city, its main facilities are gathered at a central location near Plac Grunwaldzki, alongside the Oder river. It operates three regional branches in Jelenia Góra, Legnica, and Wałbrzych.', 'Wrocław University of Science and Technology was founded in 1945, mainly thanks to the commitment of the academic staff of Lviv Polytechnic and Jan Kazimierz University of Lviv, who adapted the destroyed buildings of the Technology School – Technische Hochschule. ', 'Polytechnica Wratislaviensis', 'http://pwr.edu.pl/en/', null, null, '/uploads/2/wr.jpg', 'wr.jpg', '6076', '2', '2016-11-18 12:18:48', '2016-11-18 12:18:48');
INSERT INTO university_infos VALUES ('147', 'University of Udine', 'urp@uniud.it', '+39 0432 229773', 'Via Palladio, 8, 33100 Udine UD, Italy', 'The University of Udine was founded in 1978 as part of the reconstruction plan of Friuli after the earthquake in 1976. Its aim was to provide the Friulian community with an independent centre for advanced training in cultural and scientific studies', 'The University is actively involved in student and staff exchange projects with universities within the EU and is currently engaged in close collaboration with several universities from Eastern Europe and other non-EU countries. Moreover the University participates in many research projects at national and international level. The present number of students enrolled at the University is approx. 17000.', 'The University of Udine was founded in 1978 as part of the reconstruction plan of Friuli after the earthquake in 1976. Its aim was to provide the Friulian community with an independent centre for advanced training in cultural and scientific studies', 'Universitas Studiorum Utinensis', 'https://www.uniud.it/', null, null, '/uploads/2/udine.jpg', 'udine.jpg', '9470', '2', '2016-11-18 12:28:13', '2016-11-18 12:28:13');
INSERT INTO university_infos VALUES ('148', 'University of Alcalá', 'ciu@uah.es', '34 918 85 40 00', 'Plaza de San Diego, s/n, 28801 Alcalá de Henares, Madrid, Spain', 'The comprehensive training of students and their personal and professional development through quality teaching, creation and transmission of knowledge and spread of science and culture.', 'The University of Alcalá (Spanish: Universidad de Alcalá) is a public university located in Alcalá de Henares, a city 35 km (22 miles) northeast of Madrid in Spain and also the third-largest city of the region. Originally founded in 1293 as a General Studio for the public, and later refounded in 1977 the University of Alcalá is especially renowned in the Spanish-speaking world for its annual presentation of the highly prestigious Cervantes Prize. The University currently enrolls 28,336 students, 17,252 of whom are studying undergraduate degrees which are taught by a teaching staff of 2,608 professors, lecturers and researchers belonging to 24 departments. The University is also proud of its modern and efficient administration, which is carried out by the Administration and Services, comprising approximately 800 people', '\r\nAlthough since 1293, Alcala had a General Study approved by King Sancho IV, the University of Alcalá was founded by the Regent of Spain, Cardinal Cisneros in 1499 as a completely new educational project. In it the best models of the tradition of then-Paris and Salamanca- with those other more innovative as Bologna and Louvain were reconciled. Cardinal  Cisneros  wanted this University, which was born with the modern age as advanced in Spain of Renaissance and humanist currents of Europe outside the crucible where the regular and secular clergy willing to face the ecclesiastical reform educate not only, but also new competent officials who needed the kingdoms of Spain. The success of that company made that Alcala became the seat of a university aristocracy that made possible our Golden Age.', 'Universidad de Alcalá', 'http://www.uah.es/es/', null, null, '/uploads/2/alc.png', 'alc.png', '8331', '2', '2016-11-18 12:34:08', '2016-11-18 12:34:08');
INSERT INTO university_infos VALUES ('149', 'University of North Carolina at Greensboro', 'admissions@uncg.edu', '+1 336-334-5000', '1400 Spring Garden St, Greensboro, NC 27412, USA', 'The University of North Carolina at Greensboro will redefine the public research university for the 21st century as an inclusive, collaborative, and responsive institution making a difference in the lives of students and the communities it serves. \r\n\r\nUNCG is ...\r\nA learner-centered, accessible, and inclusive community fostering intellectual inquiry to prepare students for meaningful lives and engaged citizenship;\r\nAn institution offering classes on campus, off campus, and online for degree-seeking students and life-long learners;\r\nA research university where collaborative scholarship and creative activity enhance quality of life across the life-span;\r\nA source of innovation and leadership meeting social, economic, and environmental challenges in the Piedmont Triad, North Carolina, and beyond; and\r\nA global university integrating intercultural and international experiences and perspectives into learning, discovery, and service.', 'The University of North Carolina at Greensboro (UNCG), also known as UNC Greensboro, is a public liberal arts and research university in Greensboro, North Carolina, United States and is a constituent institution of the University of North Carolina system. However, UNCG, like all members of the UNC system, is a stand-alone university and awards its own degrees. UNCG is accredited by the Southern Association of Colleges and Schools Commission on Colleges to award baccalaureate, masters, specialist and doctoral degrees.', 'Credit for the founding of UNCG goes mainly to , a crusader for the cause of women\'s education. served the institution as its first chief executive officer with the title of President. This position has also seen various names, with the administrator being known as the Dean of Administration after 1934 and Chancellor from 1945 to present.\r\n\r\nThe school was established as a women\'s college by legislative enactment on February 18, 1891 as the State Normal and Industrial School and opened October 5, 1892. The school provided instruction in business, domestic science, and teaching with a student body of 223 and a faculty of 15 in its first year. R. S. Pullen and R. T. Gray gave the original 10-acre (40,000 m2) site in Greensboro, N.C. where the first building was erected with state funds totaling $30,000. It is the first and only public university in North Carolina founded for the purpose of educating women. In 1949, it became the largest all-female institution in the United States.', '\"Service\"', 'http://www.uncg.edu/', null, null, '/uploads/2/uncg.jpg', 'uncg.jpg', '10839', '2', '2016-11-18 15:39:11', '2016-11-18 15:39:11');
INSERT INTO university_infos VALUES ('150', 'University of Hull', 'hefunding@hull.ac.uk', '+44 1482 346311', 'Cottingham Rd, Hull HU6 7RX, UK', 'We shall encourage and empower individuals to achieve their full potential and to make and implement well-informed decisions about their careers and continuing professional development.', 'The University of Hull is a public university, founded in 1927, located in Kingston upon Hull, a city in the East Riding of Yorkshire, England. The main university campus is located in Hull and there was a smaller campus in Scarborough on the North Yorkshire coast. The main campus is home to the Hull York Medical School, a joint initiative with the University of York. Students are served by Hull University Union.', 'The foundation stone of University College Hull, then an external college of the University of London, was laid in 1927 by Prince Albert, the Duke of York (who later became king as George VI). The college was built on land donated by Hull City Council and by two local benefactors, Thomas Ferens and G F Grant. A year later the first 14 departments, in pure sciences and the arts, opened with 39 students. The college at that time consisted of one building, now named the Venn building (after the mathematician John Venn, who was born in Hull). The building now houses the administrative centre of the university. Other early buildings include the Cohen Building, which originally housed the college library, and Staff House, built in 1948 as the Student\'s Union. Another early structure was the Chemistry Building, built in 1953. With the rapid expansion of student numbers which took place in the 1950s many many academic departments were housed in temporary buildings, colloquially known as \'huts,\' which gave the campus the feel of an \'academic army camp.', 'Bearing the Torch [of learning]', 'http://beta.www.hull.ac.uk/', null, null, '/uploads/2/hull.png', 'hull.png', '7745', '2', '2016-11-18 16:00:34', '2016-11-18 16:00:34');
INSERT INTO university_infos VALUES ('151', 'University of Memphis (including Lambuth)`', 'parents@memphis.edu', '+1 901-678-2000', '3720 Alumni Ave, Memphis, TN 38152, USA', 'The University of Memphis is a learner-centered metropolitan research university providing high quality educational experiences while pursuing new knowledge through research, artistic expression, and interdisciplinary and engaged scholarship.', 'The University of Memphis, also called The U of M, is an American public research university located in the Normal Station neighborhood of Memphis, Tennessee. Founded in 1912, the University has an enrollment of more than 22,000 students. With twenty-five Chairs of Excellence and five state-approved Centers of Excellence, the school is the flagship institution of The Tennessee Board of Regents system.', 'The Daily Helmsman, the independent daily newspaper on the campus, in operation since 1925, remains a prominent student organization. In addition, many other student organizations and academic departments, such as the University of Memphis Institute for Egyptian Art and Archaeology, the Cecil C. Humphreys School of Law Moot Court Board, the University of Memphis Advertising Federation and the University of Memphis chapter of the Public Relations Student Society of America, play an active and involved role in the community, both nationally and internationally.\r\n\r\nThe University of Memphis attracts most of its undergraduate students from Memphis and West Tennessee, though many current undergraduate and graduate students have come from public and private schools across the southeastern United States as well as from all the other states and about 100 other nations.', 'Driven By Doing.\"', 'http://www.memphis.edu/', null, null, '/uploads/2/mem.png', 'mem.png', '10786', '2', '2016-11-18 16:20:04', '2016-11-18 16:20:04');
INSERT INTO university_infos VALUES ('152', 'Federal University of Ceará', 'prex@ufc.br', '+55 85 3366-7300', 'Av. da Universidade, 2853 - Benfica, Fortaleza - CE, 60020-180, Brazil', 'The Federal University of Ceará, which for over 50 years has been committed to serve the region, without forgetting the universal character of its production, arrives today with practically all areas of knowledge represented on their campuses.', 'The Federal University of Ceará is a federal university with campuses in the cities of Fortaleza, Sobral, Barbalha, Russas and Quixadá, in the state of Ceará, Brazil. UFC is a public and tuition-free university, with several academic programs in most areas of knowledge.', 'UFC was created by the Brazilian federal government in 1955 and is under the Ministry of Education. The University was created as the result of great public debate, which had begun on 1949. The main character of this movement was Antônio Martins Filho, an intellectual who became the first director of the recently created \"Universidade do Ceará\" (\'University of Ceará\'). The University itself was created by Law #2.373, ratified on December 1954 and began to function on June 25, 1955. Its implementation was owed to the union of the several higher education institutes then present in the city of Fortaleza: the School of Agronomy, the Law College of Ceara, the Medicine College and the Pharmacy & Odontology College. Today, the University consists of four centers of basic science and education and five professional colleges, and is one of the most respected universities of Brazil.', 'The more united the virtues, the stronger', 'http://www.ufc.br/', null, null, '/uploads/2/dade.png', 'dade.png', '9339', '2', '2016-11-18 16:24:29', '2016-11-18 16:24:29');
INSERT INTO university_infos VALUES ('153', 'California Polytechnic State University Cal Poly', 'catalog@calpoly.edu', '+1 805-756-1111', 'San Luis Obispo, CA 93407, USA', 'We are a Learn by Doing library. We help every member of the Cal Poly community engage in open and informed inquiry, and contribute through creation, innovation, and collaboration, to the quality of life of our community.', 'California Polytechnic State University or California Polytechnic State University, San Luis Obispo, also known as Cal Poly San Luis Obispo or Cal Poly, is a public university located in San Luis Obispo, California, United States. Founded in 1901 as a vocational high school, it is currently one of only two polytechnic universities in the 23-member California State University system. Comprising six distinct colleges, the university offers 64 bachelor\'s degrees, 32 master\'s degrees, and 7 teaching credentials. The university does not currently grant doctoral degrees.', 'The founding of California Polytechnic State University, with its “learn-by-doing” philosophy, began when local journalist Myron Angel gathered a group of citizens in 1894 to lobby for a state school in San Luis Obispo. On March 8, 1901, Governor Gage signed legislation to establish the California Polytechnic School. On a visit to San Luis Obispo on May 9, 1903, President Theodore Roosevelt praised the citizens for their support of the state school. The first classes met October 1, 1903.', 'To Learn by Doing', 'http://www.calpoly.edu/', null, null, '/uploads/2/cal.jpg', 'cal.jpg', '1078', '2', '2016-11-18 16:36:47', '2016-11-18 16:36:47');
INSERT INTO university_infos VALUES ('154', 'University of Burgundy', 'info@u-bourgogne.fr', '+33 3 80 39 50 00', 'Esplanade Erasme, 21078 Dijon, France', 'With numerous student societies and good support services for international and disabled students, the campus is a welcoming place with numerous CROUS restaurants and canteens providing subsidised food and snacks.', 'The University of Burgundy  is a university in Dijon, France.\r\n\r\nThe University of Burgundy is situated on a large campus called Campus Montmuzard, 15 minutes by bus from the city centre. The humanities and sciences are well represented on the main campus, along with law, medicine, and literature in separate buildings. The IUT (Institute of technology) is also on the campus, providing specialist higher level diplomas in business, biology, communications and computer science.', 'The University of Burgundy (uB) sinks its roots deep into the history of France. The origins of uB go back to the times of the French monarchy, with the founding of the Dijon faculty of law in 1722, at the instigation of King Louis XV of France.\r\n\r\nAfter the French Revolution, between 1805 and 1809, Emperor Napoleon I of France founded the faculties of Science, Arts and Medicine, at the heart of Dijon.\r\n\r\n150 years later, in the 1950’s, the entire University, along with its new faculties, settled on the beautiful current campus, at the doors of the city centre.\r\n\r\nOver the past 20 years, five other campuses have been created all across Burgundy. Each one of them contributes to making uB the leading higher education and research institution in the region.', 'Université de Bourgogne', 'http://www.u-bourgogne.fr/', null, null, '/uploads/2/ub.png', 'ub.png', '10127', '2', '2016-11-18 16:43:42', '2016-11-18 16:43:42');
INSERT INTO university_infos VALUES ('155', 'Nicolaus Copernicus University in Toruń', 'monchod@econ.umk.pl', '+48 56 611 40 10', 'Jurija Gagarina 11, 87-100 Toruń, Poland', 'The University Library holds an imposing collection of nearly 3 million printed volumes, periodicals and special collection items. NCU campus hosts the Academic Centre for Arts and Culture ‘Od Nowa’, one of the oldest students’ clubs in Poland.', 'The Nicolaus Copernicus University in Toruń (NCU) was founded in 1945. It is one of the largest universities in Poland, currently comprising 17 faculties (including 3 medical faculties at Collegium Medicum UMK in Bydgoszcz). It provides graduate and postgraduate courses for almost 30 000 students, offering education in over 80 fields of study, 100 specialisations and 50 postgraduate courses. The university employs 4300 staff on both Toruń and Bydgoszcz campuses, over half of whom are academic teachers. NCU alumni now number nearly 200 000.\r\n\r\nThe university participates in student and staff exchange programs at both international (the Erasmus program) and national (the MOST program) levels. It develops studies in cooperation with universities abroad and is currently collaborating with the universities in Angers (economics) and Moscow (history).', 'The first institution of higher education in Torun, the Toruń Academic Gymnasium was founded in 1568 on Piekary street. It was one of the first universities in northern Poland. The Academic Gymnasium was the precursor to scientific and cultural life (including the first museum created in 1594) in the region. Thanks to the efforts of Heinrich Stroband, city mayor in 1594, academics in Toruń received good working conditions for teaching and research. Among his professors in the seventeenth and eighteenth centuries were meritorious scholars of Polish and Prussian history, authors of textbooks and papers from various disciplines of humanities, and associates scientific journals.\r\n\r\nThe establishment of the university in a modern form began in the nineteenth century. During the partitions of Poland the Prussian government planned to create a University of Theology, which was to include faculties of law and economics, unfortunately this project did not materialise.', 'Uniwersytet Mikołaja Kopernika w Toruniu', 'http://www.umk.pl/', null, null, '/uploads/2/nico.png', 'nico.png', '11135', '2', '2016-11-18 16:57:47', '2016-11-18 16:57:47');
INSERT INTO university_infos VALUES ('156', 'San José State University', 'outreach@sjsu.edu', '+1 408-924-1000', '1 Washington Sq, San Jose, CA 95192, United States', 'In collaboration with nearby industries and communities, SJSU faculty and staff are dedicated to achieving the university\'s mission as a responsive institution of the state of California: To enrich the lives of its students, to transmit knowledge to its students along with the necessary skills for applying it in the service of our society, and to expand the base of knowledge through research and scholarship.', 'San José State University (commonly referred to as San Jose State or SJSU) is a comprehensive public university located in San Jose, California, United States. It is the founding school of the 23-campus California State University (CSU) system, and holds the distinction of being the oldest public institution of higher education on the West Coast of the United States.\r\n\r\nLocated in downtown San Jose, the SJSU main campus is situated on 154 acres (62 ha), or roughly 19 square blocks. SJSU offers 134 bachelor\'s and master\'s degrees with 110 concentrations and five credential programs with 19 concentrations. The university also offers three joint doctoral degree programs and one independent doctoral program as of 2014. SJSU is accredited by the Western Association of Schools and Colleges (WASC)', 'From its beginnings as a normal school that trained teachers for the developing frontier, SJSU has matured into a metropolitan university offering more than 145 areas of study with an additional 108 concentrations.', 'Powering Silicon Valley', 'http://www.sjsu.edu/', null, null, '/uploads/2/koko.jpg', 'koko.jpg', '6626', '2', '2016-11-18 17:15:07', '2016-11-18 17:15:07');
INSERT INTO university_infos VALUES ('157', 'University of Liverpool', 'irro@liverpool.ac.uk', '+44 151 794 2000', 'Liverpool L69 3BX, UK', 'For the advancement of learning and ennoblement of lifed', 'The University of Liverpool is a public university based in the city of Liverpool, England. Founded as a college in 1881, it gained its royal charter in 1903 with the ability to award degrees and is also known to be one of the six original \"red brick\" civic universities. It comprises three faculties organised into 35 departments and schools. It is a founding member of the Russell Group of research-intensive universities, the N8 Group for research collaboration and the University Management school is AACSB accredite', 'Following a Royal Charter and Act of Parliament in 1903, it became an independent university with the right to confer its own degrees called the University of Liverpool. The next few years saw major developments at the university, including Sir Charles Sherrington\'s discovery of the synapse and William Blair-Bell\'s work on chemotherapy in the treatment of cancer. In the 1930s to 1940s Sir James Chadwick and Sir Joseph Rotblat made major contributions to the development of the atomic bomb.[13] From 1943 to 1966 Allan Downie, Professor of Bacteriology, was involved in the eradication of smallpox', 'These days of peace foster learning', 'https://www.liverpool.ac.uk/', null, null, '/uploads/2/fl.jpg', 'fl.jpg', '10735', '2', '2016-11-19 04:16:47', '2016-11-19 04:16:47');
INSERT INTO university_infos VALUES ('158', '	Okayama University', 'istudent@cc.okayama-u.ac.jp', '+81 86-252-1111', '1 Chome-1-1 Tsushimanaka, Kita Ward, Okayama, Okayama Prefecture 700-0082, Japan', 'How can we, the human race, develop and grow in a steady and sustainable manner for the sake of future generations? At Okayama University, we have the answer. It is imperative that we build up our knowledge in order to advance education and research. As a public institution of higher learning, we are committed to contributing to this advancement by providing a positive environment for the creation of higher knowledge through research and the passing on of wisdom to younger generations through education and community service.', 'Okayama University originates from the Okayama-Han(domain) Medical Training School founded in 1870 by the family of Lord Ikeda who already founded the domain school for the samurai that continued for 200 years. This medical school was reorganized several times and became Okayama Medical College in 1922, which merged with several schools such as the Okayama Medical School and the Sixth Higher School, and was established as Okayama National University in 1949.', 'Okayama University is a top-class national university with over 140 years of history. We have 11 faculties, 7 graduate schools and various programs. You can gain a unique learning experience which will positively impact the future success of your academic and professional career.', '\"Creating and fostering higher knowledge and wisdom', 'http://www.okayama-u.ac.jp/', null, null, '/uploads/2/oka.png', 'oka.png', '6047', '2', '2016-11-19 04:26:26', '2016-11-19 04:26:26');
INSERT INTO university_infos VALUES ('159', 'Sharif University of Technology Tehran', 'info@sharif.ir', '+98 21 66022721', ' Tehran, Azadi Avenue، Iran', 'The fundamental aims of Sharif University of Technology are three. The first is the creation of an institution where students can be instructed in both theoretical and applied sciences with special emphasis on the particular needs of our society. The second is to teach students the advanced knowledge and techniques required to participate in the fields of engineering and technology and to cultivate them into creative engineers, good scientists and innovative technologists. The third is to educate engineers who are ready to be employed, who contribute significantly to their jobs, who have a strong sense of public responsibility and a desire to continue to learn. Particular emphasis is placed on the promotion of multi-disciplinary research at the graduate and doctoral levels.', 'Sharif University of Technology is one of the largest engineering schools in the Islamic Republic of Iran. It was established in 1966 under the name of Aryarmehr University of Technology and, at that time, there were 54 faculty members and a total of 412 students who were selected by national examination. In 1980, the university was renamed Sharif University of Technology. SUT now has a total of 300 full-time faculty members, approximately 430 part-time faculty members and a student body of about 12,000.', 'The university was founded in 1966 with the name Aryamehr University of Industry by Dr. Mohammad Ali Mojtahedi (محمدعلي مجتهدی). At that time, there were 54 faculty members and a total of 412 students who were selected by national examination. Also only four departments were established: Electrical, Metallurgical, Mechanical, and Chemical Engineering. In 1972, Mohammad Reza Pahlavi appointed Sayyed Hosein Nasr as president of the university with the goal of modeling the school based on the Massachusetts Institute of Technology, but with roots in Iranian culture. In 1974 a new campus of the university was established in Isfahan. But later that campus became an independent university, named Isfahan University of Technology (IUT). The emblem of IUT still closely resembles SUT\'s emblem', 'دانشگاه صنعتی شریف', 'http://www.sharif.ir/', null, null, '/uploads/2/tech.jpg', 'tech.jpg', '6848', '2', '2016-11-19 04:31:25', '2016-11-19 04:31:25');
INSERT INTO university_infos VALUES ('160', 'University of Texas Medical Branch Galveston', 'public.affairs@utmb.edu', '+1 409-772-1011', '301 University Blvd, Galveston, TX 77555, USA', 'UTMB\'s mission is to improve health for the people of Texas and around the world. ', 'For 125 years, UTMB has stood with Texas—training the health care workforce; helping make the state a leader in advancing the understanding and treatment of illness and injury; serving as a major provider of health care for Texans and their families; and innovating the future of how care is delivered.', 'The location of the Medical Department of the University of Texas was decided between Galveston and Houston in a popular vote in 1881, but its opening was delayed due to the construction of the main university campus in Austin, Texas. The need for medical training in Texas was great: in 1891, 80% of doctors in the state had under a year of formal training in medicine, and so the \"Texas Medical College\" was formed in Galveston with the idea that it would become the medical department once state funding began.', ' Cultivated mind is the guardian genius of democracy', 'https://www.utmb.edu/', null, null, '/uploads/2/utmb.png', 'utmb.png', '7788', '2', '2016-11-19 04:38:33', '2016-11-19 04:38:33');
INSERT INTO university_infos VALUES ('161', 'Murdoch University', 'international@murdoch.edu.au', '+61 8 9360 6000', '90 South St, Murdoch WA 6150, Australia', 'Murdoch University will be a leading international research-led university pursuing excellence in select areas of knowledge production and dissemination.', 'At Murdoch University in Perth, Australia, we\'re proud to have more than 22,000 students and 2,000 staff from across 90 different countries with a desire to discover, use their imaginations and ultimately make a difference.\r\n\r\nWe embrace free thinking and encourage our Murdoch community to share ideas, pool knowledge and find new ways of thinking. Across Australia, we\'re recognised for excellent teaching, ground-breaking research and our high number of satisfied students.', 'It began operations as the state\'s second university in 1973, and accepted its first undergraduate students in 1975. Its name is taken from Sir Walter Murdoch (1874–1970), the Founding Professor of English and former Chancellor of the University of Western Australia.', 'Murdoch University', 'http://www.murdoch.edu.au/', null, null, '/uploads/2/mur.jpg', 'mur.jpg', '5458', '2', '2016-11-19 04:43:07', '2016-11-19 04:43:07');
INSERT INTO university_infos VALUES ('162', '	National Research University Higher School of Economics', 'inter@hse.ru', ' +7 495 771-32-32', 'Myasnitskaya ul., 20, Moskva, Russia, 101000', 'The Higher School of Economics is a research university that carries out its mission through academic, programming, peer review and sociocultural work based on international academic and organizational standards. We perceive ourselves as a part of the global academic community and believe that international partnership and engagement in global university cooperation are the key elements of our movement forward. As a Russian university, we work for the welfare of Russia and its citizens.', 'Consistently ranked as one of Russia’s top universities, the Higher School of Economics is a leader in Russian education and one of the preeminent economics and social sciences universities in eastern Europe and Eurasia.  Having rapidly grown into a well-renowned research university over two decades, HSE sets itself apart with its international presence and cooperation. \r\nOur faculty, researchers, and students represent over 50 countries, and are dedicated to maintaining the highest academic standards.  Our newly-adopted structural reforms support HSE’s drive to internationalize and the groundbreaking research of our faculty, researchers, and students.', 'HSE was founded on November 27, 1992, by Yevgeny Yasin, Yaroslav Kuzminov, Revold Entov, Oleg Ananyin and Rustem Nureev. These founders were well known Russian economists who believed in market reforms and HSE was established to support the new Russian reformist government plans. From the very start, HSE was able to benefit from resources under the European Communities TACIS programme', 'Not for the school but for life we study', 'https://www.hse.ru/en/', null, null, '/uploads/2/koh.jpg', 'koh.jpg', '5676', '2', '2016-11-19 04:48:07', '2016-11-19 04:48:07');
INSERT INTO university_infos VALUES ('163', 'Federal University of Bahia', 'gabinete@ufba.br', '+55 71 3283-7072', ' Ondina, Salvador - State of Bahia, 40170-115, Brazil', '\r\nThe Distributed Systems Laboratory (LaSiD) is a research laboratory within the Computer Science Department at Federal University of Bahia (UFBA). It involves faculty members of the Computer Science Department, research assistants, and research students (Ph.D, MSc. and BSc.). The mission of LaSiD is to develop methods, techniques and tools that help in the design of correct and dependable distributed systems, preparing the next-generation of researchers and developers in these areas by investigating challenging problems. \r\n', 'The Federal University of Bahia  is a public university located mainly in the city of Salvador. It is the largest university of the state of Bahia.\r\n\r\nStudents can study there without paying tuition fees, as it is a public university. To join the university they must pass an annual examination, known as the \"vestibular', 'The Federal University of Bahia has its beginning on February 18, 1808, when the Prince Regent Dom João VI establishing the School of Bahia Surgery, first university course in Brazil. In the nineteenth century, incorporated the Pharmacy courses (1832) and Dentistry (1864), the Academy of Fine Arts (1877), Law (1891) and Polytechnic (1896). In the twentieth century, Isaiah Alves creates the Faculty of Philosophy, Sciences and Letters (1941). ', 'Virtue of the Spirit', 'https://www.ufba.br/', null, null, '/uploads/2/vir.png', 'vir.png', '9303', '2', '2016-11-19 12:03:49', '2016-11-19 12:03:49');
INSERT INTO university_infos VALUES ('164', 'Jiangnan University', 'xb@jiangnan.edu.cn', '+86 510 8591 5666', '1800 Lihu Ave, Binhu Qu, Wuxi Shi, Jiangsu Sheng, China', 'Our mission is to promote student and community success. We achieve our mission through quality teaching and an interactive learning environment that:\r\n    •  Provides relevant, accessible, and value added programs and services that engage and develop the student as a whole\r\n    •  Proactively addresses the needs of a constantly changing labor market\r\n    •  Supports community and economic development through innovative Partnerships and applied research initiatives', 'Jiangnan University North American College (“North American College” for short) is an International Cooperative Educational Institution for nurturing students’ talents in the fields of high technology and business administration. JNU North American College is supported by a Cooperative International Program involving five Universities and Colleges, namely Memorial University of Newfoundland, Canada, Northwood University U.S.A, Lambton College, College of North Atlantic, and Jiangnan University, China, which is one of Key universities of “211 Project” directly under the Ministry of Education.', 'The root of Jiangnan University stretches back to San Jiang Normal School which was founded in Nanjing in 1902 which later renamed National Central University and Nanjing University. The private Jiangnan University, another source of JU, was founded in Wuxi in 1948 by Rong Desheng (the father of Rong Yiren), the largest national capitalist in the Republic of China era. Later during restructuring of higher education happened after the establishment of the People’s Republic of China, the engineering related departments of Nanjing University merged related departments of private Jiangnan University and several other universities and formed Nanjing Institute of Technology (later renamed Southeast University) in 1952, and in 1958, the related department of Nanjing Institute of Technology moved to Wuxi and established Wuxi College of Light Industry which was named university in 1995. In 2001, Jiangnan University was formed by the combination of Wuxi University of Light Industry（无锡轻工大学）, Jiangnan College （江南学院） and Wuxi Education College （无锡教育学院）', 'Learning and Practice to Perfection', 'http://www.jiangnan.edu.cn/', null, null, '/uploads/2/jia.png', 'jia.png', '4113', '2', '2016-11-19 12:10:35', '2016-11-19 12:10:35');
INSERT INTO university_infos VALUES ('165', 'Ca\' Foscari University of Venice', 'erasmusin@unive.it', '+39 041 234 8111', 'Dorsoduro, 3246, 30123 Venezia, Italy', ' Our mission is:\r\n\r\nPromote scientific advances by undertaking the highest quality research, addressing global questions and deliver acknowledged impact across various disciplines;\r\nEncourage a transformative learning experience based on dedicated academic tutoring, a research-inspired, demand-led curriculum and an engaging student life;\r\nAttract a diverse and international community of scholars and students at the very heart of one of the world’s most stunning locations;\r\nAct as an accountable and stable institution, capitalizing on culture and academic excellence to promote civic innovation and economic growth.', 'Founded on August 6, 1868 as the “Scuola Superiore di Commercio” (Advanced School for Commerce), Ca\' Foscari was the first Italian institution to deal with advanced education in Business and Economics. The original main office is still found in the grand gothic palace “volta de canal” (on the bend of the Grand Canal), in the heart of Venice.', 'The institution was founded as the Regia Scuola Superiore di Commercio (\"royal high school of commerce\") by a Royal Decree dated 6 August 1868, and teaching commenced in December of the same year. The idea of establishing such a school had arisen after the annexation of the Veneto to the new Kingdom of Italy in 1866, and was promoted by three people in particular: the Jewish political economist Luigi Luzzatti, later Prime Minister of Italy; Edoardo Deodati, senator of the Kingdom of Italy and vice-president of the province of Venice; and the Sicilian political economist Francesco Ferrara, director of the school for its first thirty years', 'Venetiarum universitas in domo Foscari', 'http://www.unive.it/', null, null, '/uploads/2/univer.jpg', 'univer.jpg', '9420', '2', '2016-11-19 12:14:49', '2016-11-19 12:14:49');
INSERT INTO university_infos VALUES ('166', 'Kangwon National University ', 'tkim@kangwon.ac.kr', '+82 33-250-6114', '1 Gangwondaehak-gil, Seoksa-dong, Chuncheon, Gangwon-do, South Korea', 'Boasting of its 70-year history, Kangwon National University has been making every effort to respond to the rapidly-changing global era and nurture global talents contributing to advancement of the nation and the region as a regional stronghold university', 'Kangwon National University (KNU) was established in 1947 in Chuncheon, Gangwon-do, South Korea. As one of 10 flagship Korean national universities, Kangwon National University serves as the flagship educational institution of Gangwon-do', 'Initially established as an agricultural college, Kangwon National University has steadily expanded to the comprehensive university encompassing a full spectrum of academic fields. KNU expanded in 1997 adding a medical degree program and in 2000 a University Hospital. A law school, now called \'Graduate School of Judicial Affairs\', has been operated to the University\'s graduate schools in 2002, is the only laboratory school in South Korea, as a model for the very-early stage of \'reform on Korean legal system\'. In 2006, KNU merged with Samcheok University, adding the colleges of Veterinary medicine and Information Technology to KNU\'s existing colleges. Since March 2, 2009, KNU operates a state-of-the-art professional Law School as one of the officially approved school by Korean Government', '\"seek for the truth from reality, seek for the very truth to enable us to renovate the world as it should be from the world as it is.\"', 'http://www.kangwon.ac.kr/', null, null, '/uploads/2/knu.gif', 'knu.gif', '4275', '2', '2016-11-19 12:23:16', '2016-11-19 12:23:16');
INSERT INTO university_infos VALUES ('167', 'Shiraz University of Medical Sciences', 'abbulbaqi_amini@yahoo.com', '+98 71 3230 5410', 'Fars Province, Shiraz, Zand, Iran', 'The main mission of Shiraz University is to enrich society’s intellectual, cultural, scientific, economic, and environmental spheres. Shiraz University enjoys accomplished faculty, dedicated staff and talented students. Our faculty creates, discovers and adds to the word’s base of knowledge in everything from agriculture to humanities, from engineering to supercomputing. Our Ph.D. graduates have become valuable human resources in all Iranian and Abroad Universities. ', 'Shiraz University of Medical Sciences (SUMS) (Persian: دانشگاه علوم پزشکی شیراز Dāneshgāh-e Olum Pezeshki-e Shirāz‎‎) is a public medical school located in Shiraz, Iran. It is ranked as one of Iran\'s top medical schools, with more than 9000 students studying in over 150 different disciplines, and a faculty staff of nearly 900 and 25,000 personnel.[citation needed] as it is one of the best medical universities in Iran. Iranian students are recruited to SUMS through National Entrance Exam (Konkur) and registered to the main campus of the university. Shiraz University of Medical Sciences (SUMS), exhibiting nearly 70 years of Medical education experience, is the most popular University of Medical Sciences in southern Iran, and offers international degree and non-degree programs to international students at different levels and deciplines including Doctor of Medicine (M.D.), Doctor of Dental Medicine (D.M.D.), Doctor of Pharmacy (Pharm.D.), B.Sc., M.Sc.,Ph.D., Specialty, Subspecialty, and Fellowship', 'The Foundation of Shiraz University of Medical Sciences(SUMS) dates back to about 70 years ago when Shiraz Institute of Higher Health Education admitted a few medical students (1945). The High Institute of Health developed into Medical Faculty in 1946. The medical school is located in central Shiraz, which was founded in 1946 as a college within Pahlavi University. In 1953, a Faculty of Nursing was added, followed by a Faculty of Dentistry in 1969. After the 1979 Islamic Revolution overthrew the Pahlavi dynasty, drastic changes were implemented at all universities. The name of Pahlavi University was immediately changed to Shiraz University. In 1986, the Iranian Ministry of Health, Treatment and Medical Education took over the departments and faculties in the medical sciences and SUMS became an independent institution.', 'Shiraz University of Medical Sciences', 'http://www.sums.ac.ir/fa/index.html', null, null, '/uploads/2/aloom.jpg', 'aloom.jpg', '6906', '2', '2016-11-19 12:29:59', '2016-11-19 12:29:59');
INSERT INTO university_infos VALUES ('168', 'Universidad de La Laguna', 'orincom@ull.es', '+34 922 31 90 00', 'C/ Padre Herrera, s/n, 38207 San Cristóbal de La Laguna, Santa Cruz de Tenerife, Spain', 'The University of La Laguna has served an important function of educational, scientific and cultural leadership in the Canary Islands during its two centuries of history, promoting the progress of our community and contributing decisively to its modernization. \r\n\r\nAccording to this tradition, the University of La Laguna states as its main social mission, contribute to the welfare of the citizens of the Canaries, guaranteeing quality higher education, promoting economic development through scientific and technical high - level research and disseminating culture, scientific knowledge and the arts along . whole archipelago through its university extension activities ', 'The University of La Laguna (in Spanish: Universidad de La Laguna), also known as the ULL, is situated in San Cristóbal de La Laguna, on the island of Tenerife. It is the oldest university in the Canary Islands. It has six campuses: Central, Anchieta, Guajara, Campus del Sur, Ofra and Santa Cruz de Tenerife.\r\n\r\nIn 2015, the University of La Laguna entered the ranking of the top 500 universities in the world by the Institute of Education in Shanghai (China), being the only of the two Canarian public universities to enter the ranking. In addition, the Leiden ranking, prepared by the Center for Studies of Science and Technology of the Leiden University (Netherlands), has been at the University of La Laguna as the first Spanish university in scientific collaboration. Meanwhile, in 2016 the University of La Laguna was recognized as the second best university in Spain in Humanities, according to a survey by the Everis Foundation', 'Its origins date to the year 1701 when a center for advanced studies was established by the Augustinians in the town of La Laguna. A Papal Bull of 1744 proposed that it be converted into the Ecclesiastical University of San Agustín.\r\n\r\nIn 1792, by royal decree, Charles IV of Spain ordered the establishment in San Cristóbal de La Laguna, then the capital of Tenerife and Canary Islands, of the first Universidad Literaria of the Canaries, but the political situation on the mainland prevented its establishment. However, with the restoration of the House of Bourbon in the guise of Fernando VII of Spain, the university was established at La Laguna as the Universidad de San Fernando. In this role it played an important role the priest Cristóbal Bencomo y Rodríguez, confessor of King Ferdinand VII and Titular Archbishop of Heraclea.', 'University of La Laguna', 'http://www.ull.es/', null, null, '/uploads/2/reg.png', 'reg.png', '8419', '2', '2016-11-19 12:34:57', '2016-11-19 12:34:57');
INSERT INTO university_infos VALUES ('169', 'University of Salerno', 'ammicent@pec.unisa.it', ' +39 089 961111', ' Via Giovanni Paolo II, 132, 84084 Fisciano SA, Italy', 'The Mission of the University of Salerno is to carry out research and training, developing collaborative relationships with the territory, respecting the environment, in order to create, enrich and, at the same time, make available the scientific and cultural heritage in service students, businesses, institutions and, more generally, the whole community.', 'The University of Salerno  is a university located in Salerno, Italy. It is organized in 10 Faculties. Its main campus is located in Fisciano, other faculties in Baronissi.', 'Salerno\'s Schola Medica Salernitana was the most important medical school in Europe between the 10th and 13th centuries. Following the rise of university medical schools, it briefly merged with the University of Naples, which moved to Salerno from 1253 to 1258 before returning to Naples and establishing its own medical school there. Meanwhile, the University of Montpellier displaced Salerno as the most prestigious medical school internationally and by the 14th century the latter had ceased to exist.\r\n\r\nThe modern University of Salerno traces its origin to the Istituto Universitario di Magistero “Giovanni Cuomo”, a teacher training college founded in 1944 with this renowned and ancient tradition in mind. In 1968 the institute became a State university, the University of Salerno, and it has since seen a great increase in student numbers.', 'Hippocratica Civitas Studium Salerni', 'http://web.unisa.it/home', null, null, '/uploads/2/ratica.jpg', 'ratica.jpg', '9462', '2', '2016-11-19 12:52:31', '2016-11-19 12:52:31');
INSERT INTO university_infos VALUES ('170', 'Worcester Polytechnic Institute', 'LinkedIn@wpi.edu', '+1 508-831-5000', '100 Institute Rd, Worcester, MA 01609, USA', 'humanities in preparation for careers of professional practice, civic contribution, and leadership, facilitated by active lifelong learning. This educational process is true to the founders\' directive to create, to discover, and to convey knowledge at the frontiers of academic inquiry for the betterment of society. Knowledge is created and discovered in the scholarly activities of faculty and students ranging across educational methodology, professional practice, and basic research. Knowledge is conveyed through scholarly publication and instruction.', 'Worcester Polytechnic Institute (WPI) is a private research university in Worcester, Massachusetts, focusing on the instruction and research of technical arts and applied sciences.\r\n\r\nFounded in 1865 in Worcester, WPI was one of the United States\' first engineering and technology universities and now has 14 academic departments with over 50 undergraduate and graduate degree programs in science, engineering, technology, management, the social sciences, and the humanities and arts, leading to bachelor\'s, master\'s and PhD degrees. WPI\'s faculty works with students in a number of research areas, including biotechnology, fuel cells, information security, materials processing, and nanotechnology.', 'Worcester Polytechnic Institute was founded by self-made tinware manufacturer, John Boynton, and Ichabod Washburn, owner of the world’s largest wire mill. Boynton envisioned science schooling that would elevate the social position of the mechanic and manufacturer, but not necessarily teach the skills needed to become either. Washburn, on the other hand, wanted to teach technical skills through a sophisticated apprenticeship approach. Boynton consulted Seth Sweetser, a pastor, for ways to realize his vision. By chance it happened that Ichabod Washburn had previously consulted Sweetser about the proper way to actualize his own vision', '\"Theory and Practice\"', 'https://www.wpi.edu/', null, null, '/uploads/2/wpi.jpg', 'wpi.jpg', '11529', '2', '2016-11-19 12:59:42', '2016-11-19 12:59:42');
INSERT INTO university_infos VALUES ('171', 'Miami University of Ohio', 'kygermk@miamioh.edu', '+1 513-529-1809', '501 E High St, Oxford, OH 45056, USA', 'The University of Miami’s mission is to educate and nurture students, to create knowledge, and to provide service to our community and beyond. Committed to excellence and proud of the diversity of our University family, we strive to develop future leaders of our nation and the world.', 'Nationally recognized as one of the most outstanding undergraduate institutions, Miami University is a public university located in Oxford, Ohio. With a student body of nearly 19,000, Miami effectively combines a wide range of strong academic programs with the personal attention ordinarily found only at much smaller institutions', 'The foundations for Miami University were first laid by an Act of Congress signed by President George Washington, stating that an academy should be located Northwest of the Ohio River in the Miami Valley. The land was located within the Symmes Purchase; Judge John Cleves Symmes, the owner of the land, purchased the land from the government with the stipulation that he lay aside land for an academy. Congress granted one township to be located in the District of Cincinnati to the Ohio General Assembly for the purposes of building a college, two days after Ohio was granted statehood in 1803; if no suitable location could be provided in the Symmes Purchase, Congress pledged to give federal lands to the legislature after a five-year period. The Ohio Legislature appointed three surveyors in August of the same year to search for a suitable township, and they selected a township off of Four Mile Creek. The Legislature passed \"An Act to Establish the Miami University\" on February 2, 1809, and a board of trustees was created by the state; this is cited as the founding of Miami University. The township originally granted to the university was known as the \"College Township,\" and was renamed Oxford, Ohio, in 1810.', 'To Accomplish Rather Than to Be Conspicuous', 'http://miamioh.edu/', null, null, '/uploads/2/mi.png', 'mi.png', '5222', '2', '2016-11-19 13:19:47', '2016-11-19 13:19:47');
INSERT INTO university_infos VALUES ('172', '	Novosibirsk State University', 'hamit1987@mail.ru', '+7 383 363-43-33', ' Novosibirsk, Novosibirsk Oblast, Russia, 630090', 'The University mission lies in training well-educated people ready to apply their knowledge in science, education, knowledge-intensive production, and business based on fundamental education. This approach makes it possible for graduates to meet the needs of modern society.', 'Novosibirsk State University  is among the most famous universities in Russia, although is somewhat young. NSU is one of top three Russian schools present in top ratings, as of 2016, The university is located 20 kilometers from the city of Novosibirsk, a cultural and industrial center of Siberia. The total number of students is 7131 as of 2016. Novosibirsk State University alumni mainly known in Engeneering, Research and IT', 'Three fellow members of the Academy of Sciences of the USSR Mikhail Lavrentyev, Sergei Sobolev, and Sergei Khristianovich decided to bring international level research over the Urals from Moscow to the vast territories of Siberia. Siberia possessed copious natural resources but lacked large research institutions which would promote economic development and growth in the region. In 1958, the idea was implemented with the establishment of the Siberian Division of the Academy of Sciences of the Soviet Union near the large industrial city of Novosibirsk. A new academic town, Akademgorodok, started to grow rapidly and half a year later a new university was founded to train young researchers for the newly born science center', 'We will not make you smarter, we will teach you how to think!', 'http://www.nsu.ru/', null, null, '/uploads/2/nsu.png', 'nsu.png', '5979', '2', '2016-11-19 13:23:33', '2016-11-19 13:23:33');
INSERT INTO university_infos VALUES ('173', 'University of Limerick', 'international@ul.ie', '+353 61 202 700', 'Sreelane, Castletroy, Co. Limerick, Ireland', 'The graduate entry medical programme at the University of Limerick will produce doctors who are competent, confident and caring; who understand the scientific basis of medicine; who recognise the social and environmental context in which health and illness exist and in which medicine is practised; and who have skills for and commitment to service, teamwork, scientific enquiry, self-fulfilment and life-long learning.', 'The University of Limerick  is a university in the city of Limerick, Ireland. It was established in 1972 as the National Institute for Higher Education, Limerick and became a university by statute in 1989 in accordance with the University of Limerick Act 1989.[4] The university was the first university established since the foundation of the State in 1922, followed later the same day by the establishment of Dublin City University', 'According to Dr Edward M. Walsh, Founding President of the University of Limerick, the Mayor of Limerick applied to have a Queen\'s College located in the city in 1845, but instead Belfast, Cork and Galway were established.\r\n\r\nIn 1908 there was also an attempt to establish a link between the National University of Ireland and Mungret College located about 5 km from Limerick. The college offered courses in the faculty of Arts to degree and masters level which were both conferred upon by the Royal University of Ireland from 1888 to 1908. The Royal University of Ireland was dissolved in 1909 and was replaced by the National University of Ireland. which marked the end of tertiary education at Mungret. Degrees were awarded to students at Mungret College by the NUI from 1909 to 1912 to accommodate students who had matriculated in the now extinct Royal University', 'eagna chun gnimh', 'http://www.ul.ie/', null, null, '/uploads/2/limer.jpg', 'limer.jpg', '10732', '2', '2016-11-19 13:29:16', '2016-11-19 13:29:16');
INSERT INTO university_infos VALUES ('174', '	Ritsumeikan University', 'skp@st.ritsumei.ac.jp', '+81 75-465-8230', '56-1 Tojiin Kitamachi, Kita Ward, Kyoto, Kyoto Prefecture 603-8577, Japan', 'The Mission of the Graduate School of Management (GSM) is to cultivate creative well-rounded professionals and leaders who will play a central role in resolving management issues at globalizing enterprises and other organizations by imparting advanced management skills, a good understanding of business ethics and a deep insight into globalization', 'Ritsumeikan university is known as one of western Japan\'s four leading private universities. KAN-KAN-DO-RITS 関関同立 (Kwansei Gakuin University, Kansai University, Doshisha University, and Ritsumeikan University) is the abbreviation that many people refer to when talking about the four leading private universities in the region (of 20 million people). Ritsumeikan University is considered to be one of Japan\'s top universities, and is especially well known for its International Relations programme which has been ranked as first place in Japan. Moreover, in today’s newspaper, it is listed as the ‘top private university in Japan for policy science’. It has exchange programmes with schools throughout the world, including The University of British Columbia, The University of Melbourne, The University of Sydney, University of Hong Kong and King\'s College London. The school also offers a dual bachelor\'s degree program and dual master\'s degree programme in collaboration with American University, and offers a dual bachelor\'s degree in collaboration with The University of British Columbia. It has a relatively strong network of alumni in Kansai region and has produced a number of CEOs in Japanese companies as well as politicians.', 'Ritsumeikan was first founded as a private academy in 1869 by Prince Saionji Kinmochi. In 1900, Kojuro Nakagawa (the former secretary of Prince Saionji) established the Kyoto Hosei School, a law school that eventually adopted the Ritsumeikan name (with the prince\'s permission) and was awarded full university status in 1922.[2] Historically, the school was seen as a liberal alternative to the state-run Kyoto University.', 'Beyond Borders', 'http://www.ritsumei.ac.jp/', null, null, '/uploads/2/rr.jpg', 'rr.jpg', '6421', '2', '2016-11-19 13:33:33', '2016-11-19 13:33:33');
INSERT INTO university_infos VALUES ('175', 'Florida Atlantic University', 'ASKpersonnel@fau.edu', '+1 561-297-3000', '777 Glades Rd, Boca Raton, FL 33431, USA', 'Some universities measure greatness in decades and centuries. Florida Atlantic University measures it with every student who earns a degree, every researcher who makes a discovery and every community that is transformed.', 'Florida Atlantic University (also referred to as FAU or Florida Atlantic) is a public university located in Boca Raton, Florida, with five satellite campuses located in the Florida cities of Dania Beach, Davie, Fort Lauderdale, Jupiter, and in Fort Pierce at the Harbor Branch Oceanographic Institution.FAU belongs to the 12-campus State University System of Florida and serves South Florida, which has a population of more than five million people and spans more than 100 miles (160 km) of coastline. Florida Atlantic University is classified by the Carnegie Foundation as a research university with high research activity. The university offers more than 180 undergraduate and graduate degree programs within its 10 colleges in addition to a professional degree from the College of Medicine. Programs of study cover arts and humanities, the sciences, medicine, nursing, accounting, business, education, public administration, social work, architecture, engineering, and computer science', 'On a bright October day in 1964, Lyndon Baines Johnson, 36th President of the United States, squinted into the South Florida sun and, in his famous Texas drawl, declared Florida Atlantic University officially open.\r\n\r\nFor a sitting U.S. chief executive to officiate the dedication of a new regional university was most unusual – but, then, FAU was no ordinary institution of higher learning. From its very inception, FAU was envisioned as the first of a new breed of American universities that would quite deliberately throw off the ivy-covered trappings of the tradition-bound world of academe and invent new and better ways of making higher education available to those who sought it.\r\n\r\nIndeed, in his dedication remarks, President Johnson said that America had entered an era “when education is no longer only for the sons of the rich, but for all who can qualify.” Speaking on an outdoor stage before a crowd of 15,000, he called for “a new revolution in education” and said that a fully educated American public could vastly enrich life over the next 50 years.', 'Where Tomorrow Begins', 'http://www.fau.edu/', null, null, '/uploads/2/flu.png', 'flu.png', '2328', '2', '2016-11-19 13:39:51', '2016-11-19 13:39:51');
INSERT INTO university_infos VALUES ('176', 'Swansea University', 'engineering@swansea.ac.uk', '+44 1792 205678', 'Singleton Park, Sketty, Swansea SA28PP, UK', 'we have new goals. They are to:\r\n\r\nBecome a UK top 30-ranked university by 2018\r\nContinue our ambitious expansion plans\r\nExtend our global reach; and\r\nMove closer to becoming one of the world’s top 200 universities.', 'Swansea University Medical School is a medical school on Swansea University\'s Singleton campus with additional teaching centres located throughout South and West Wales, including Cefn Coed Hospital, Singleton Hospital and Morriston Hospital in Swansea, Prince Philip Hospital in Llanelli, Withybush Hospital in Haverfordwest and Bronglais Hospital in Aberystwyth. The Medical School also has an extensive network of primary care (General Practice) teaching centres.\r\n\r\nOne of the fastest growing medical schools in the UK, Swansea University Medical School is ranked as the 6th best medical school in the UK by the Complete University Guide. Swansea University is the top university in Wales in The Times and The Sunday Times Good University Guide 2017 league table – and has also won the inaugural Welsh University of the Year title.', 'Swansea University first attempted to establish a medical school in the 1960s but initially missed out to other schools. The university did succeed in introducing Genetics and Biochemistry departments, laying the foundations for future expansion into medicine.\r\n\r\nFollowing Welsh political devolution in the 1990s, fresh calls were made to establish a medical school to serve the people of south-west Wales. In 2001, the Welsh Government established a medical school at the university’s Singleton Park campus. By 2004, the clinical school had developed into the School of Medicine, welcoming its first students onto the Graduate Entry Medicine course - a 4-year fast track graduate entry programme in 2004 in collaboration with Cardiff University', 'Swansea University Medical School', 'http://www.swansea.ac.uk/', null, null, '/uploads/2/gol.jpg', 'gol.jpg', '7367', '2', '2016-11-19 13:45:48', '2016-11-19 13:45:48');
